(1, 'Hacia la Historia Clinica Electronica Ocupacional en Venezuela - mpardo 2012', 'pdf', 'Hacia la Historia Clinica Electronica Ocupacional en Venezuela - mpardo 2012.pdf', 'Resumen:<br/><br/>\n\nEn Venezuela los requisitos para la conformaciÃ³n de los servicios de salud ocupacional estÃ¡n normalizados por la ComisiÃ³n Venezolana de Normas Industriales (COVENIN). La norma 2274:1997 incluye la estructura general de la Historia ClÃ­nica Ocupacional (HCO) del trabajador, sin embargo con el avance de las tecnologÃ­as de informaciÃ³n y comunicaciÃ³n, son muchas las empresas que han desarrollado e implementado plataformas tecnolÃ³gicas para el soporte de la HCO, y en consecuencia han adaptado, modificado, y actualizado el formato de la HCO, observÃ¡ndose mÃºltiples plataformas con caracterÃ­sticas y estructuras diferentes, con poca o nula comunicaciÃ³n entre ellas  Por otro lado, el estÃ¡ndar openEHR define una arquitectura para sistemas de informaciÃ³n en salud que permite normalizar el conocimiento y la informaciÃ³n clÃ­nica, implementar sistemas flexibles a nuevos requerimientos, mantenibles a largo plazo y a bajo costo.<br/><br/>\n\nEl presente trabajo plantea un camino para la formalizaciÃ³n de la HCO venezolana, utilizando openEHR como norma para la informatizaciÃ³n de la HCE. Comenzando con un anÃ¡lisis de la estructura normativa de la HCO, identificando conceptos clÃ­nicos individuales, realizando bÃºsquedas sistemÃ¡ticas de definiciones formales para esos conceptos clÃ­nicos, y el modelado de algunos conceptos que pertenecen a la HCO pero que no habÃ­an sido considerados  hasta ahora.<br/><br/>\n\nEl resultado es el diseÃ±o de diversos arquetipos basados en el estÃ¡ndar OpenEHR, para la HCO, que permiten la evaluaciÃ³n del proceso de formalizaciÃ³n de los conceptos clÃ­nicos que definen la estructura interna de la HCO, asÃ­ como tambiÃ©n del modelo de arquetipos, del modelo de informaciÃ³n de openEHR y de las herramientas de modelado existentes. Como conclusiones se obtuvieron que tanto el modelo de arquetipos como el modelo de informaciÃ³n son lo suficientemente genÃ©ricos y flexibles para representar los conceptos clÃ­nicos necesarios para conformar la HCO, permitiendo que estos conceptos puedan ser definidos, compartidos y (re)utilizados en distintos sistemas de informaciÃ³n desarrollados con distintas tecnologÃ­as.<br/><br/>\n\nPalabras clave:<br/>\nsalud ocupacional, historia clÃ­nica electrÃ³nica, openehr, arquetipos.', 89818, '2012-03-24 02:19:17', 'FileInfo', 0, 19),
(2, 'Plantilla para publicaciones openEHR_org_es', 'doc', 'Plantilla para publicaciones openEHR_org_es.doc', 'Esta plantilla establece el formato general de los trabajos que se publican en nuestro portal.', 126976, '2012-03-24 02:44:54', 'FileInfo', 0, 20),
(3, 'Estandarizacion de la Historia Clinica Informatizada e Interoperabilidad Semantica con openEHR - aprieto 2012', 'pdf', 'Estandarizacion de la Historia Clinica Informatizada e Interoperabilidad Semantica con openEHR - aprieto 2012.pdf', 'Resumen:<br/><br/>\n\nEn los centros de atenciÃ³n sanitaria de Venezuela predominan los sistemas de historia clÃ­nica electrÃ³nica que se limitan a tratar la historia clÃ­nica de un paciente asociada solo a un centro sanitario particular. Actualmente existe una demanda por sistemas de historia clÃ­nica abiertos, interconectados e interoperables, que permitan pensar en servicios sanitarios integrados, capaces de intercambiar informaciÃ³n clÃ­nica para mejora de los cuidados mÃ©dicos sobre el paciente. Esto requiere establecer estÃ¡ndares para el modelado de la informaciÃ³n clÃ­nica, protocolos para el intercambio de informaciÃ³n, y hacer uso de formatos y codificaciones comunes que permitan definir tanto la sintaxis como una semÃ¡ntica de la informaciÃ³n existente en las distintas Ã¡reas del conocimiento mÃ©dico.<br/><br/>\nOpenEHR es un estÃ¡ndar abierto para crear historias clÃ­nicas electrÃ³nicas normalizadas, orientadas a la gestiÃ³n del conocimiento. Su objetivo es soportar proyectos de historias clÃ­nicas electrÃ³nicas econÃ³micamente viables, mantenibles a largo plazo y altamente adaptables a nuevos requisitos. El modelo dual de openEHR plantea la separaciÃ³n de la informaciÃ³n y el conocimiento, donde lo primero es implementado dentro del software, y lo segundo es gestionado por fuera del software. Este enfoque permite que el conocimiento clÃ­nico y el software puedan cambiar y evolucionar en el tiempo de forma independiente. Por otro lado, el formalismo propuesto por openEHR para el modelado de conceptos clÃ­nicos, los arquetipos, permiten definir estructuras de informaciÃ³n clÃ­nica y sus restricciones, en un formato procesable por computadora, capaz de ser compartido entre diversos sistemas. Estas caracterÃ­sticas permiten que los arquetipos puedan ser utilizados tambiÃ©n para la comunicaciÃ³n y el procesamiento efectivo de informaciÃ³n clÃ­nica entre diversos sistemas, sin que Ã©stos estÃ©n previamente diseÃ±ados para dicho fin, acercÃ¡ndonos a la interoperabilidad semÃ¡ntica global. Por lo tanto, la aplicaciÃ³n del estÃ¡ndar openEHR puede ser crucial para la integraciÃ³n de sistemas informÃ¡ticos en salud.\nEl presente trabajo explora un posible escenario de interoperabilidad, analizando las ventajas y desventajas de utilizar o no utilizar arquetipos para la comunicaciÃ³n de informaciÃ³n clÃ­nica.<br/><br/>\n\nPalabras clave:<br/><br/>\n\nHistoria ClÃ­nica ElectrÃ³nica, Interoperabilidad, openEHR', 69836, '2012-03-29 19:28:52', 'FileInfo', 0, 19),
(4, 'notepad++_adl', 'xml', 'notepad++_adl.xml', 'Coloreado de sintaxis ADL (Archetype Definition Language) para <a href=\\\"http://notepad-plus-plus.org\\\" target=\\\"_blank\\\">Notepad++</a>\n\nAutor: <a href=\\\"http://tinyurl.com/armandoprieto\\\" target=\\\"_blank\\\">Lic. Armando Prieto</a>', 3355, '2012-12-04 13:55:23', 'FileInfo', 0, 28),
(5, 'estandarizando_la_hce', 'pdf', 'estandarizando_la_hce.pdf', 'IntroducciÃ³n a openEHR y cÃ³mo Ã©ste estÃ¡ndar ayuda a estandarizar la Historia ClÃ­nica ElectrÃ³nica.', 77356, '2013-05-26 15:19:15', 'FileInfo', 0, 19),
(6, 'Infolac2014_Palau-Cuadrado-Pazos', 'pdf', 'Infolac2014_Palau-Cuadrado-Pazos.pdf', 'GeneraciÃ³n de Interfaces de Usuario para Sistemas de InformaciÃ³n ClÃ­nicos basados en una MetodologÃ­a Multi-nivel\n\nEl trabajo muestra cÃ³mo utilizar el Modelo de InformaciÃ³n y Arquetipos de openEHR para generar Interfaces de Usuario para ingreso y visualizaciÃ³n de datos en sistemas de informaciÃ³n clÃ­nicos.', 1519409, '2014-10-15 23:29:26', 'FileInfo', 0, 19);
INSERT INTO `cms_html_module` (`id`, `content`, `class`, `deleted`) VALUES
(1, '<div align=\"center\"><img src=\"http://www.fsrgrp.com/sitebuilder/images/landscape_banner-924x339.jpg\" border=\"0\" alt=\"dsfgsdfg\" title=\"sfgsdgds\" width=\"760\" /></div>', 'HtmlModule', 0),
(3, '<h2><br />&iquest;Cu&aacute;l es la situaci&oacute;n actual de la inform&aacute;tica en salud?</h2>\n<p>Hoy en d&iacute;a existens muchos problemas preocupantes en el desarrollo de sistemas de informaci&oacute;n en salud. Si bien <span style=\"text-decoration: underline;\">la informatizaci&oacute;n es un requerimiento para permitir una gesti&oacute;n efectiva de las instituciones sanitarias</span>, muchas veces la forma en la que se implementan estos proyectos, la baja calidad de las soluciones de software, y los problemas de comunicaci&oacute;n entre los actores, hacen que estos proyectos fracasen antes de lograr un retorno acorde a la inversi&oacute;n realizada.</p>\n<p>Algunos de los problemas m&aacute;s frecuentes son:</p>\n<ul>\n<li><span>No se siguen est&aacute;ndares y buenas pr&aacute;cticas a la hora de dise&ntilde;ar y desarrollar sistemas de informaci&oacute;n en salud.</span></li>\n<li><span>Los sistemas que se comercializan en general son enormes sistemas monol&iacute;ticos, que buscan controlar todos los procesos de las instituciones sanitarias, generan dependencias tecnol&oacute;gica y con el proveedor, y no respetan los sistemas existentes en la instituci&oacute;n.</span></li>\n<li><span>Las soluciones actuales cambian los flujos de trabajo del personal de salud, interfieren de forma disruptiva con estos, los sistemas no son suficientemente flexibles para poder adaptarse a cada flujo de trabajo para cumplir con las necesidades de los usuarios, y el proceso de adaptaci&oacute;n es costoso.</span></li>\n<li><span>Los sistemas actuales se centran en la funcionalidad y olvidan al usuario: problemas de usabilidad, performance, interfaz de usuario no amigable.</span></li>\n<li><span>Informaci&oacute;n cl&iacute;nica altamente dependiente de la plataforma tecnol&oacute;gica, comunicaci&oacute;n y migraci&oacute;n de informaci&oacute;n entre sistemas costosa en tiempo, recursos humanos y econ&oacute;micos.</span></li>\n<li><span>Aplicaci&oacute;n de procesos de ingenier&iacute;a de software actuales generan problemas de comunicaci&oacute;n entre los profesionales y de calidad en la herramienta final. Estos procesos no se adaptan bien al desarrollo de sistemas en el &aacute;rea sanitaria, y generan problemas de comunicaci&oacute;n y visibilidad con los interesados.</span></li>\n<li><span>Los sistemas no est&aacute;n dise&ntilde;ados para adaptarse al cambio y no son flexibles para incorporar nuevos requisitos de forma din&aacute;mica por parte del equipo de salud, los cambios son costosos y existe un desfazaje entre lo que se necesita y lo que la herramienta provee.</span></li>\n<li><span>Los proyectos actuales son inviables a largo plazo, debido a altos costos, tiempos y recursos necesarios en proyectos a gran escala (regionales o nacionales).</span></li>\n<li><span>Las instituciones m&eacute;dicas gastan miles de d&oacute;lares en licencias de sistemas de sofware que muchas veces no llegan a implementarse.</span></li>\n</ul>\n<h2><br />&iquest;Porqu&eacute; debemos preocuparnos?</h2>\n<p>Seguimos creando peta-bytes de informaci&oacute;n cl&iacute;nica no computable (interpretable autom&aacute;ticamente), que no se puede compartir y procesar f&aacute;cilmente. La reingenier&iacute;a que requieren estos sistemas para hacer computable a esta informaci&oacute;n es un enfoque demasiado caro como para ser viable. - <a href=\"https://www.linkedin.com/in/thomasbeale\" target=\"_blank\">Thomas Beale</a>.</p>\n<p>Los sistemas de informaci&oacute;n actuales tienen el conocimiento cl&iacute;nico implementado de forma \"dura\" en el software, haciendo imposible su reutilizaci&oacute;n fuera de este. El conocimiento cl&iacute;nico es un activo del sistema de salud y deber&iacute;a poder ser definido, estandarizado y compartido para poder implementar proyectos de alto impacto, a gran escala y viables a largo plazo. Los altos costos de mantenimiento del software cl&iacute;nico actual, la falta de flexibilidad de estos sistemas y la dependencia tecnol&oacute;gica hacen que los proyectos de informatizaci&oacute;n en salud fracasen o no puedan ser mantenidos a largo plazo.</p>\n<p>La informatizaci&oacute;n en salud es obligatoria, no existe otra forma de poder gestionar estos complejos sistemas, procesos y datos sin ayuda de sistemas inform&aacute;ticos, pero estos sistemas deben ser dise&ntilde;ados para el cambio, estandarizar la informaci&oacute;n cl&iacute;nica para que pueda ser compartida y procesada por diversos sistemas, y adoptar nuevo conocimiento cl&iacute;nico de forma natural y sencilla.</p>\n<h2><br />&iquest;C&oacute;mo podemos mejorar?</h2>\n<p>El &uacute;nico camino para resolver los problemas y lograr el gran objetivo de viabilizar una atenci&oacute;n sanitaria de calidad y una gesti&oacute;n racional de los recursos disponibles, es la aplicaci&oacute;n de tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n (TIC) basadas en est&aacute;nders nacionales e internacionales que sean complementarios. Informatizaci&oacute;n + estandarizaci&oacute;n es la soluci&oacute;n.</p>\n<p>Creemos que el est&aacute;ndar openEHR es fudamental en este contexto, y por lo tanto buscamos ser un agente para la investigaci&oacute;n, la capacitaci&oacute;n, el desarrollo, la promoci&oacute;n, y la adopci&oacute;n del est&aacute;ndar, complementado con otros est&aacute;ndares que cubren diferentes &aacute;reas de los sistemas de informaci&oacute;n en salud, como son HL7 (v2.x, v3, CDA, CCD), DICOM, SNOMED, CIE9/10, ASTM CCR, CEN/ISO 13606, entre otros.</p>\n<h2><br />Interesante... me gustar&iacute;a saber m&aacute;s &iquest;c&oacute;mo empiezo?</h2>\n<ol>\n<li><a id=\"tooltip_login_box\" href=\"#\">Reg&iacute;strate como miembro en nuestra comunidad.</a></li>\n<li><a id=\"tooltip_social\" href=\"#\">S&iacute;guenos y participa de nuestras redes sociales.</a></li>\n<li><a id=\"tooltip_foro\" href=\"#\">Pres&eacute;ntate en nuestro foro.</a></li>\n<li><a id=\"tooltip_openehr\" href=\"#\">Lee la introducci&oacute;n a openEHR.</a></li>\n<li>Pregunta, comenta, comparte, lee, investiga, participa!</li>\n</ol><!-- Tooltips -->\n<script type=\"text/javascript\" src=\"https://openehr.org.es/apps/cms2/skins/openehr/jquery.scrollTo-min.js\"></script>\n<script type=\"text/javascript\" src=\"https://openehr.org.es/apps/cms2/skins/openehr/jquery.qtip-1.0.0-rc3.min.js\"></script>\n<script type=\"text/javascript\">// <![CDATA[\n$(\'#tooltip_login_box\').click( function () {\n  \n  $(\'#login_box\').qtip({\n	   content : {\n	     text : \'Registrate aqui completando el formulario. Tendras acceso a todo el contenido para miembros y podras participar activamente en nuestra comunidad.\',\n	     title: {\n           //text: \'About Me\',\n		   text: \'Â \',\n           button: \'X\'\n         }\n	   },\n	   position: {\n		  corner: {\n			 tooltip: \'topRight\', target: \'bottomMiddle\'\n		  },\n                adjust: {\n			x: 15\n		}\n	   },\n	   show: {\n		  when: false, // Don\'t specify a show event\n		  ready: true // Show the tooltip when ready\n	   },\n	   hide: false, // Don\'t specify a hide event\n	   style: {\n		  border: { width: 5, radius: 5 },\n		  padding: 10, \n		  textAlign: \'center\',\n		  tip: true, // Give it a speech bubble tip with automatic corner detection\n		  name: \'cream\' // cream, dark, green, light, red, blue\n	   }\n  });\n	\n  return false;\n});\n  \n$(\'#tooltip_social\').click( function () {\n\n  $(\'#footer td:first-child ul\').qtip({\n	   content : {\n	     text : \'Siguenos y comparte!\',\n	     title: {\n           //text: \'About Me\',\n		   text: \'Â \',\n           button: \'X\'\n         }\n	   },\n	   position: {\n		  corner: {\n			 tooltip: \'bottomLeft\', target: \'topMiddle\'\n		  },\n                adjust: {\n			y: -5, x: -30\n		}\n	   },\n	   show: {\n		  when: false, // Don\'t specify a show event\n		  ready: true // Show the tooltip when ready\n	   },\n	   hide: false, // Don\'t specify a hide event\n	   style: {\n		  border: { width: 5, radius: 5 },\n		  padding: 10, \n		  textAlign: \'center\',\n		  tip: true, // Give it a speech bubble tip with automatic corner detection\n		  name: \'cream\' // cream, dark, green, light, red, blue\n	   }\n    });\n	\n  // Quiero que haga scroll hasta donde va a mostrar el tooltip\n  $.scrollTo(\'#footer td:first-child ul\', {duration:800});\n\n  return false;\n});\n  \n$(\'#tooltip_foro\').click( function () {\n  \n  // Cuidado que dependen del id del modulo!\n  $(\'#MenuModule__9\').qtip({\n	   content : {\n	     text : \'Ingresa a nuestro foro para preguntar, proponer temas, compartir tu opinion y aprender junto a otros profesionales!\',\n	     title: {\n           //text: \'About Me\',\n		   text: \'Â \',\n           button: \'X\'\n         }\n	   },\n	   position: {\n		  corner: {\n			 tooltip: \'leftBottom\', target: \'rightBottom\'\n		  },\n                adjust: {\n			y: -45, x: -115\n		}\n	   },\n	   show: {\n		  when: false, // Don\'t specify a show event\n		  ready: true // Show the tooltip when ready\n	   },\n	   hide: false, // Don\'t specify a hide event\n	   style: {\n		  border: { width: 5, radius: 5 },\n		  padding: 10, \n		  textAlign: \'center\',\n		  tip: true, // Give it a speech bubble tip with automatic corner detection\n		  name: \'cream\' // Style it according to the preset \'cream\' style\n	   }\n    });\n	\n  // Quiero que haga scroll hasta donde va a mostrar el tooltip\n  $.scrollTo(\'#MenuModule__9\', {duration:800});\n\n  return false;\n});\n  \n  \n$(\'#tooltip_openehr\').click( function () {\n  \n  // Cuidado que dependen del id del modulo!\n  $(\'#MenuModule__9\').qtip({\n	   content : {\n	     text : \'La introduccion a openEHR te dara un panorama general de que es y para que sirve, y como nos ayuda a resolver problemas y mejorar la calidad de los sistemas de informacion en salud\',\n	     title: {\n           //text: \'About Me\',\n		   text: \'Â \',\n           button: \'X\'\n         }\n	   },\n	   position: {\n		  corner: {\n			 tooltip: \'leftTop\', target: \'rightMiddle\'\n	  	  },\n                adjust: {\n			y: 70, x: -75\n		}\n	   },\n	   show: {\n		  when: false, // Don\'t specify a show event\n		  ready: true // Show the tooltip when ready\n	   },\n	   hide: false, // Don\'t specify a hide event\n	   style: {\n		  border: { width: 5, radius: 5 },\n		  padding: 10, \n		  textAlign: \'center\',\n		  tip: true, // Give it a speech bubble tip with automatic corner detection\n		  name: \'cream\' // Style it according to the preset \'cream\' style\n	   }\n  });\n\n  // Quiero que haga scroll hasta donde va a mostrar el tooltip\n  $.scrollTo(\'#MenuModule__9\', {duration:800});\n\n  return false;\n});\n// ]]></script>', 'HtmlModule', 0),
(4, '<p>openEHR es el est&aacute;ndar abierto para sistemas de informaci&oacute;n preparados para el futuro.<br /><br />Este portal busca promover la difusi&oacute;n, formaci&oacute;n e implementaci&oacute;n del est&aacute;ndar en los pa&iacute;ses de habla hispana.<br /><br /><br /><strong>Informaci&oacute;n r&aacute;pida</strong><br /><br />1. <a href=\"https://www.openehr.org/about/foundation\" target=\"_blank\">The openEHR Foundation</a> es la organizaci&oacute;n que mantiene las especificaciones del est&aacute;ndar openEHR, y d&oacute;nde se coordinan las actividades de la comunidad.<br /><br />2. Las <a href=\"https://www.openehr.org/programs/specification/workingbaseline\" target=\"_blank\">especificaciones de openEHR</a> son abiertas y de uso libre. Est&aacute;n en ingl&eacute;s.<br /><br />3. openEHR es un est&aacute;ndar internacional <a href=\"https://www.openehr.org/who_is_using_openehr/healthcare_providers_and_authorities\" target=\"_blank\">implementado en todo el mundo</a>.<br /><br />4. Dentro de la openEHR Foundation existen tres programas donde se organizan las actividades de <a href=\"https://www.openehr.org/programs/specification/\" target=\"_blank\">revisi&oacute;n y actualizaci&oacute;n de las especificaciones</a>, de <a href=\"https://www.openehr.org/programs/clinicalmodels/\" target=\"_blank\">creaci&oacute;n de modelos y gesti&oacute;n del conocimiento cl&iacute;nico</a>, y d&oacute;nde se <a href=\"https://www.openehr.org/programs/software/\" target=\"_blank\">organiza y promueven herramientas y sistemas de software</a> que implementan openEHR. En este momento se est&aacute; organizando un cuarto programa que estar&aacute; encargado de las actividades relativas a la formaci&oacute;n y certificaci&oacute;n.<br /><br /><br /><strong>&iquest;Qu&eacute; aporta openEHR a la Inform&aacute;tica en Salud?</strong><br /><br />openEHR define un conjunto de componentes arquitect&oacute;nicos a modo de plano general de cualquier sistema de informaci&oacute;n en salud, donde cada uno de estos componentes cumple un rol importante y la falta de estos se har&aacute; notar en el futuro, cosa que ocurre con frecuencia en los dise&ntilde;os actuales que no est&aacute;n basados en est&aacute;ndares ni buenas pr&aacute;cticas. Es importante considerar que <a href=\"https://www.openehr.org/about/origins\" target=\"_blank\">esta arquitectura fue dise&ntilde;ada, mejorada y estandarizda desde 1988</a>, con diversos proyectos de la Uni&oacute;n Europea, que derivaron en la creaci&oacute;n de openEHR en 2002. Y desde esa fecha hasta ahora openEHR ha tenido <a href=\"https://www.openehr.org/programs/specification/historicalreleases\" target=\"_blank\">varias mejoras y versiones de las especificaciones</a>.<br /><br />Por otro lado, openEHR define un modelo de informaci&oacute;n completo, expresivo, bien organizado, y estable, que adem&aacute;s permite ser mapeado con otros est&aacute;ndares, como est&aacute;ndares de mensajer&iacute;a HL7. En comparaci&oacute;n con los est&aacute;ndares HL7, openEHR est&aacute; enfocado en la interna de los sistemas de informaci&oacute;n, en c&oacute;mo la informaci&oacute;n cl&iacute;nica es modelada, almacenada y accedida, mientras que HL7 est&aacute; enfocado en el intercambio. Esto hace que ambos est&aacute;ndares sean complementarios y aliados en la implementaci&oacute;n de sistemas de informaci&oacute;n en salud.<br /><br />En openEHR toda la informaci&oacute;n cl&iacute;nica est&aacute; definida mediante una metodolog&iacute;a formal, y basada en el modelo de informaci&oacute;n de openEHR. Cada estructura de datos debe ser definida como un arquetipo. Los arquetipos no son m&aacute;s que definiciones de conceptos, que incluyen estructura de datos, definiciones textuales, restricciones y codificaci&oacute;n. Por ejemplo, la presi&oacute;n arterial, frecuencia respiratoria, diagn&oacute;stico, resultados de estudios de laboratorio, triage, etc., cada uno de estos conceptos ser&aacute; definido con un arquetipo. Luego tenemos las plantillas que son contenedores de muchos arquetipos, conformando una definici&oacute;n de documentos cl&iacute;nicos, de los que participar&aacute;n los conceptos representados mediante arquetipos. No es necesario crear todos los arquetipos desde cero para cada proyecto, <a href=\"https://www.openehr.org/about/origins\" target=\"_blank\">contamos con un repositorio internacional de arquetipos</a> donde profesionales de todo el mundo comparten, validan y traducen arquetipos. Estos arquetipos son de uso libre y gratuito.<br /><br />La comunidad tambi&eacute;n provee <a href=\"https://www.openehr.org/downloads/modellingtools\" target=\"_blank\">herramientas de software para trabajar con plantillas y arquetipos</a>. Algunos son desarrollos comerciales, otros de uso gratuito, y otros de c&oacute;digo abierto. Los arquetipos y las plantillas se usan con otros fines m&aacute;s all&aacute; de la definici&oacute;n sem&aacute;ntica de conceptos cl&iacute;nicos, por ejemplo se pueden generar formularios de registro desde una plantilla, se pueden crear consultas de datos, tambi&eacute;n validar datos desde una plantilla, para mapear datos hacia diversos est&aacute;ndares y formatos, etc. Como son conjuntos de meta-datos, pueden ser utilizados con distintos fines.<br /><br /><br /><strong>Comunidad</strong><br /><br />Puedes utilizar nuestro <a href=\"http://openehr.org.es/foro/\" target=\"_blank\">foro</a> para realizra preguntas. Tambi&eacute;n contamos con un <a href=\"https://groups.google.com/forum/#!forum/openehr-es\" target=\"_blank\">grupo de Google</a> y un <a href=\"https://www.linkedin.com/groups/4347256/\" target=\"_blank\">grupo en LinkedIn</a>.<br /><br /><a href=\"https://www.openehr.org/community/mailinglists\" target=\"_blank\">Listas de correo de la comunidad internacional</a>.<br /><br /><br /><br /><br /><br /></p>', 'HtmlModule', 0),
(5, '<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\n<tbody>\n<tr>\n<td valign=\"top\">\n<p>Social:</p>\n<ul>\n<li><a class=\"twitter-follow-button\" href=\"https://twitter.com/openehr_org_es\" data-show-count=\"false\" data-lang=\"es\">Seguir a @openehr_org_es</a>\n<script type=\"text/javascript\">// <![CDATA[\n!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0];if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=\"//platform.twitter.com/widgets.js\";fjs.parentNode.insertBefore(js,fjs);}}(document,\"script\",\"twitter-wjs\");\n// ]]></script>\n</li>\n<li><a href=\"https://www.linkedin.com/groups?about=&amp;gid=4347256\"><img src=\"https://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></li>\n<li><a href=\"https://www.facebook.com/openEHR\"><img src=\"https://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></li>\n</ul>\n</td>\n<td valign=\"top\">\n<p>Portal:</p>\n<ul>\n<li>FAQ</li>\n<li>Mapa del sitio</li>\n<li><a href=\"https://openehr.org.es/cms2/cms/displayPageRO?pageId=12\">Glosario</a></li>\n<li><a href=\"https://openehr.org.es/publicaciones\">Publicaciones</a></li>\n</ul>\n</td>\n<td valign=\"top\">\n<p>Proyectos:</p>\n<ul>\n<li>Modelado</li>\n<li>Estandarizaci&oacute;n</li>\n<li><a href=\"https://www.openehr.org/downloads/modellingtools\" target=\"_blank\">Software</a></li>\n<li>Capacitaci&oacute;n</li>\n</ul>\n</td>\n<td valign=\"top\">\n<p>Comunidad:</p>\n<ul>\n<li><a href=\"https://openehr.org.es/cms2/cms/displayPage?pageId=8\">Consejo directivo</a></li>\n<li><a href=\"https://openehr.org.es/cms2/cms/displayPage?pageId=7\">Grupos de trabajo</a></li>\n<li><a href=\"https://openehr.org.es/cms2/user/publicList\">Miembros</a></li>\n<li><a title=\"Foro\" href=\"https://openehr.org.es/foro\" target=\"_blank\">Foro</a></li>\n<li><a href=\"https://www.openehr.org/wiki/dashboard.action\" target=\"_blank\">Wiki</a></li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', 'HtmlModule', 0),
(6, '<h1>Nuestra comunidad</h1>\n<p>En esta p&aacute;gina encontrar&aacute; informaci&oacute;n acerca de quienes somos, qu&eacute; hacemos, cu&aacute;les son nuestros objetivos, cu&aacute;les son nuestras principales l&iacute;neas de acci&oacute;n, cu&aacute;l es nuestra misi&oacute;n, visi&oacute;n, valores y principios.</p>\n<h2>&iquest;Quienes somos?</h2>\n<p>openEHR en espa&ntilde;ol es una comunidad de estudiantes y profesionales provenientes de distintas &aacute;reas como la Inform&aacute;tica (investigadores, gestores, arquitectos, analistas, programadores, etc.) y la Medicina (m&eacute;dicos, enfermeros, t&eacute;cnicos, etc.), con un objetivo en com&uacute;n: mejorar la atenci&oacute;n sanitaria a trav&eacute;s de la aplicaci&oacute;n efectiva de Tecnolog&iacute;as de la Informaci&oacute;n y las Comunicaciones (TIC).</p>\n<p>Vemos necesaria la aplicaci&oacute;n de est&aacute;ndares complementarios en distintas &aacute;reas de los sistemas de informaci&oacute;n en salud, y creemos que el est&aacute;ndar openEHR conforma la base fundamental para el logro de este objetivo.</p>\n<p>Si bien nuestro foco est&aacute; en openEHR, otros est&aacute;ndares, patrones, buenas pr&aacute;cticas, t&eacute;cnicas, modelos, etc., ser&aacute;n parte de las tem&aacute;ticas a tratar por la comunidad, ya que no existe un solo est&aacute;ndar que plantee la soluci&oacute;n final a las problem&aacute;ticas de los sistemas de informaci&oacute;n en salud.</p>\n<h2>&iquest;Qu&eacute; hacemos?</h2>\n<p>Principalmente generamos y compartimos conocimiento sobre informatizaci&oacute;n en salud, aplicaci&oacute;n de est&aacute;ndares y buenas pr&aacute;cticas, concentr&aacute;ndonos en el est&aacute;ndar openEHR.&nbsp;Buscamos promover, formar, investigar, desarrollar y vincular a la industria, las instituciones sanitarias, la academia y al gobierno en el camino de la estandarizaci&oacute;n en salud.&nbsp;Buscamos crear nexos entre distintos actores del sistema sanitario, apoyando, coordinando y difundiendo proyectos de informatizaci&oacute;n y estandarizaci&oacute;n en salud.</p>\n<p>Somos una comunidad de promoci&oacute;n pero tambi&eacute;n de acci&oacute;n, trabajando para que el uso efectivo de la informaci&oacute;n en salud y la mejora de la calidad asistencial sea una realidad.</p>\n<p>Espec&iacute;ficamente, nuestro fin es promover, capacitar y difundir openEHR como est&aacute;ndar central y b&aacute;sico para la arquitectura de sistemas de informaci&oacute;n en salud, interoperables, flexibles, modificables a largo plazo y bajo costo, permitiendo que la informaci&oacute;n cl&iacute;nica acompa&ntilde;e al paciente durante toda su vida (longitudinalidad) y pueda ser compartida entre distintos actores del sistema sanitario (transversalidad).</p>\n<h3>En particular, buscamos:</h3>\n<ol>\n<li>Crear un espacio de intercambio y aprendizaje que no existe hasta el momento para profesionales de habla hispana.</li>\n<li>Aportar a la difusi&oacute;n de openEHR como est&aacute;ndar para los sistemas de informaci&oacute;n en salud, para que todos los actores del sistema sanitario est&eacute;n informados al respecto, desde los tomadores de decisi&oacute;n a nivel gubernamental, hasta los profesionales de la salud e inform&aacute;ticos que implementan dichos sistemas.</li>\n<li>Ser el pilar en la difusi&oacute;n, formaci&oacute;n, adopci&oacute;n e implementaci&oacute;n del est&aacute;ndar openEHR en los pa&iacute;ses de habla hispana.</li>\n</ol>\n<p>Ver objetivos estrat&eacute;gicos&nbsp;<a href=\\\"http://openehr.org.es/cms2/cms/displayPageRO?pageId=6\\\">aqu&iacute;</a>.</p>', 'HtmlModule', 0),
(7, '<a class=\\\"twitter-timeline\\\" href=\\\"https://twitter.com/search?q=from%3Aopenehr+OR+%22openehr%22+OR+%23openehr\\\" data-widget-id=\\\"346747573681393665\\\">openEHR en Twitter</a>\n<script type=\\\"text/javascript\\\">// <![CDATA[\n!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\\\'http\\\':\\\'https\\\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\\\"://platform.twitter.com/widgets.js\\\";fjs.parentNode.insertBefore(js,fjs);}}(document,\\\"script\\\",\\\"twitter-wjs\\\");\n// ]]></script>', 'HtmlModule', 0),
(8, '<p>&nbsp;</p>\n<p>En esta secci&oacute;n publicaresmos informaci&oacute;n relacionada con la estandarizaci&oacute;n aplicada a los sistemas de informaci&oacute;n en salud.<br />&nbsp;</p>\n<h2>Introduccion</h2>\n<p>Cuando hablamos de estandarizaci&oacute;n en los sistemas de informaci&oacute;n en salud, esto incluye a los sistemas informatizados o a los manuales basados en registros en papel o cualquier otro soporte no inform&aacute;tico.</p>\n<p>Los objetivos de la estandarizaci&oacute;n se pueden resumir en:</p>\n<ul>\n<li>Gesti&oacute;n eficiente de los sistemas, de sus componentes, y de la informaci&oacute;n que estos gestionan (generan, procesan, consumen, comunican).</li>\n<li>Interoperabilidad global entre distintos sistemas, incluso los manuales, sin importar las caracter&iacute;sticas de la instituci&oacute;n sanitaria, del equipo de salud, de los pacientes, u otras caracter&iacute;sticas culturales, de ubicaci&oacute;n geogr&aacute;fica, incluso del idioma. Sin estandarizar, la interoperabilidad global es practicamente imposible.</li>\n<li>Explotaci&oacute;n de la informaci&oacute;n disponible. La informaci&oacute;n es un activo que puede ser utilizada para fines no pensados en primera instancia, con el debido procesamiento permite seguir generando valor y calidad para todos actores del sistema sanitario, desde las instituciones, m&eacute;dicos, paciente, etc., hasta para quienes definen las pol&iacute;ticas a nivel gubernamental. Incluso se puede generar nuevo conocimiento a partir de la informaci&oacute;n disponible, por ejemplo detectando relaciones que antes pasaban desapercibidas. Sin estandarizar, la explotaci&oacute;n de la informaci&oacute;n para lograr un alto impacto tiene un costo que la hace inviable.</li>\n</ul>\n<div><br /><br /></div>\n<h2>La estandarizaci&oacute;n en salud abarca las siguientes &aacute;reas:&nbsp;</h2>\n<h3>Identificaci&oacute;n de actores y otras entidades del sistema sanitario:</h3>\n<p>La identificaci&oacute;n es el primer paso en la estandarizaci&oacute;n, sin identificar a los componentes de nuestro sistema sanitario no podremos hacer mucho en cuanto a la informatizaci&oacute;n del mismo. Los actores van desde las personas y sus roles (pacientes, m&eacute;dicos, enfermeros, t&eacute;cnicos, etc.), pasando por todos los insumos (como los medicamentos), hasta las instituciones sanitarias y otras organizaciones que son parte del sistema, como el Ministerio de Salud y sus diferentes &aacute;reas. Algunos ejemplos de entidades a identificar y/o clasificar son: personas, roles, creedenciales, lugares f&iacute;sicos, servicios, insumos, medicamentos, sistemas, ...<br />&nbsp;</p>\n<h3>Procesos:</h3>\n<p>Los procesos en salud tienen una gran complejidad y una muy pobre estandarizaci&oacute;n. Debemos comenzar con la identificaci&oacute;n de los distintos procesos \\\"macro\\\" asistenciales, para luego detectar micro-procesos, tambi&eacute;n conocidos como \\\"flujos de trabajo\\\". La estandarizaci&oacute;n de procesos es de vital importancia para la informatizaci&oacute;n en salud, debido a que una herramienta de software debe crearse para seguir determinado flujo de trabajo, para adaptarse a c&oacute;mo trabaja el usuario final (por ejemplo un m&eacute;dico), y no hacer que &eacute;ste adapte su proceso a la herramienta. Por otro lado, los procesos son vitales para la gesti&oacute;n y dan un contexto a todos los registros que se realizan (tanto en papel como informatizados), ya que el registro sanitario es una \\\"foto\\\" de un determinado proceso ejecutado por determinado rol sobre un determinado paciente. Algunos ejemplos de procesos a identificar y estandarizar son: proceso de atenci&oacute;n ambulatoria, proceso de atenci&oacute;n primaria, proceso de interconsulta, proceso de referencia/contrareferencia, proceso de indicaci&oacute;n de medicamentos, procesos de hospitalizaci&oacute;n, procesos administrativos (reserva de hora, pago de ticket, etc).<br />&nbsp;</p>\n<h3>Registros:</h3>\n<p>Los registros est&aacute;n contextualizados en los procesos, y sirven como documentaci&oacute;n de estos, ya que un registro contiene datos puntuales sobre la ejecuci&oacute;n de distintos procesos. Para la estandarizaci&oacute;n de registros es necesaria la definici&oacute;n de los distintos tipos de registros que se podr&aacute;n hacer en cada clase de proceso. Tambi&eacute;n es necesario especificar que rol ser&aacute; responsable del registro y otras informaciones de contexto como en qu&eacute; lugares ser&aacute; posible realizar el registro y bajo qu&eacute; condiciones. Un segundo nivel de an&aacute;lisis, especificaci&oacute;n y estandarizaci&oacute;n de los registros en salud corresponde a los conceptos que son parte del registro. openEHR permite modelar registros mediante TEMPLATES.<br />&nbsp;</p>\n<h3>Conceptos:</h3>\n<p>Los registros est&aacute;n conformados por dos grandes tipos de conceptos, los cl&iacute;nicos y los demogr&aacute;ficos. Los conceptos dan contexto a los campos que conforman el registro. La estandarizaci&oacute;n de conceptos es vital para la correcta definici&oacute;n de los registros, porque permite la evoluci&oacute;n del sistema en funci&oacute;n de estas definiciones, y tambi&eacute;n permite la interoperabilidad sem&aacute;ntica entre sistemas inform&aacute;ticos. Los conceptos definen estructuras de datos, las restricciones que estas deben cumplir, y adem&aacute;s informaci&oacute;n de contexto como el nombre del concepto, para que se debe usar, para que no. En openEHR un concepto es modelado utilizando ARQUETIPOS.<br />&nbsp;</p>\n<h3>Terminolog&iacute;a:</h3>\n<p>En el nivel m&iacute;nimo de la informaci&oacute;n, se pueden tener c&oacute;digos e identificadores, asociados a la informaci&oacute;n registrada, que permiten el procesamiento autom&aacute;tico de la informaci&oacute;n contenida en cada instancia de registro. Est&aacute;ndares como SNOMED CT se dedican a modelar la informaci&oacute;n a niveles muy detallados, mientras que las clasificacioens como CIE 9, CIE 10, CIAP-2, etc. permiten el an&aacute;lisis de la informaci&oacute;n con cierto nivel de agrecaci&oacute;n.<br />&nbsp;</p>\n<h3>Mensajer&iacute;a:</h3>\n<p>Es necesario estandarizar la forma en que distintos sistemas intercambian informaci&oacute;n, para esto es necesario definir formatos de intercambio comunes. Est&aacute;ndares como HL7 e ISO/CEN 13606 son buenos representantes de la estandarizaci&oacute;n a nivel de mensajer&iacute;a para le intercambio de informaci&oacute;n cl&iacute;nica.</p>\n<p>&nbsp;</p>', 'HtmlModule', 0),
(10, '<h3>A:</h3>\n<p>ACC<span style=\\\"font-size: x-small;\\\">&nbsp;(Organizations)</span>: American College of Cardiology<br />ACR<span style=\\\"font-size: x-small;\\\">&nbsp;(Organizations)</span>: American College of Radiology&nbsp;<br />ACSE<span style=\\\"font-size: x-small;\\\">&nbsp;(Organizations)</span>: Association Control Service Element<br /><a href=\\\"http://informatica-medica.blogspot.com/2009/11/primer-aproximacion-la-historia-clinica.html\\\" target=\\\"_blank\\\">ADT</a>: Admit, Dicharge and Transfer. Modelo del ciclo asistencial donde el paciente es Admitido, Dado de Alta o Transferido a otra unidad de cuidados o servicio asistencial.<br /><a href=\\\"http://www.astm.org/\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">ASTM&nbsp;</a>(Organizations): &nbsp;<span><strong><span>American Section of the International Association for Testing Materials,&nbsp;</span><span>Organismo de normalizaci&oacute;n de los Estados Unidos.</span></strong></span></p>\n<h3><a name=\\\"TOC-B:\\\"></a>B:</h3>\n<p>&nbsp;</p>\n<h3><a name=\\\"TOC-C:\\\"></a>C:</h3>\n<p>CMET (HL7): Common Message Type Element&nbsp;<br /><a href=\\\"http://en.wikipedia.org/wiki/Clinical_Document_Architecture\\\" rel=\\\"nofollow\\\">CDA&nbsp;</a>(HL7): Clinical Document Architecture<br /><a href=\\\"http://en.wikipedia.org/wiki/Continuity_of_Care_Document\\\" rel=\\\"nofollow\\\">CCD</a>&nbsp;(Healthcare Informatics, HL7, ASTM): Continuity of Care Document<br /><a href=\\\"http://en.wikipedia.org/wiki/Continuity_of_Care_Record\\\" rel=\\\"nofollow\\\">CCR&nbsp;</a>(Healthcare Informatics): Continuity of Care Record<br />CCHIT: Certification Commission for Healthcare IT<br />CDR: Clinical Data/Document Repository (Repositorio de Datos/Documentos Cl&iacute;nicos)<br /><a href=\\\"http://www.cen.eu/cen/pages/default.aspx\\\" target=\\\"_blank\\\">CEN</a>: Comit&eacute; Europeo de Normalizaci&oacute;n<br /><a href=\\\"http://es.wikipedia.org/wiki/Clasificaci%C3%B3n_Internacional_de_Atenci%C3%B3n_Primaria\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">CIAP</a>&nbsp;(Healthcare Informatics): Clasificaci&oacute;n Internacional de Atenci&oacute;n Primaria<br />CIE 9&nbsp;(Healthcare Informatics): Clasificaci&oacute;n Internacional de Enfermedades novena edici&oacute;n<br /><a href=\\\"http://es.wikipedia.org/wiki/Lista_de_c%C3%B3digos_CIE-10\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">CIE 10</a>&nbsp;(Healthcare Informatics): Clasificaci&oacute;n Internacional de Enfermedades d&eacute;cima edici&oacute;n<br />Communication Protocol: es la definici&oacute;n formal de los mensajes, su formato, sus reglas de transferencia (ej. el orden, respuestas esperadas, etc.), y restricciones que deben cumplir, para que dos o m&aacute;s dispositivos puedan intercambiar datos.<br />CIS: Clinical Information System<br />CT (Healthcare): Computed Tomography</p>\n<p>&nbsp;</p>\n<h3><a name=\\\"TOC-D:\\\"></a>D:</h3>\n<p><strong>Database (Informatics)</strong>: structured collection of records or data that is stored in a computer system.&nbsp;<br /><strong>DSTU (HL7)</strong>: Draft Standard Trial Use<br /><strong>D-MIM (HL7)</strong>: Domain Message Information Model<strong>&nbsp;<br /><a href=\\\"http://medical.nema.org/\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">DICOM&nbsp;</a>(Healthcare Informatics)</strong>: Digital Imaging and Communications in Medicine<br />&nbsp;</p>\n<h3><a name=\\\"TOC-E:\\\"></a>E:</h3>\n<p><strong>ECG (Healthcare)</strong>: Electrocardiograma<br /><strong>eMPI (Healthcare Informatics)</strong>: Enterprise MPI&nbsp;<br /><strong><a href=\\\"http://en.wikipedia.org/wiki/Electronic_health_record\\\" rel=\\\"nofollow\\\">EHR&nbsp;</a>(Healthcare Informatics)</strong>: Electronic Health Record<br />EMR: Electronic Medical Record<br /><strong><a href=\\\"http://en.wikipedia.org/wiki/Enterprise_service_bus\\\" rel=\\\"nofollow\\\">ESB&nbsp;</a>(SOA)</strong>: Enterprise Service Bus<br /><strong><a href=\\\"http://en.wikipedia.org/wiki/Electronic_Data_Interchange\\\" rel=\\\"nofollow\\\">EDI&nbsp;</a>(Interoperability)</strong>: Electronic Data Interchange<br /><strong><a href=\\\"http://en.wikipedia.org/wiki/EHRcom\\\" rel=\\\"nofollow\\\">EN13606</a>(Healthcare informatics, Standards)</strong>: European Standard is to define a rigorous and stable information architecture for communicating part or all of the Electronic Health Record (EHR) of a single subject of care (patient).<br /><strong>Epicrisis (Healthcare)</strong>: resumen de datos de un episodio de atenci&oacute;n, generalmente utilizado para derivaci&oacute;n de pacientes (informes entre m&eacute;dicos o informes de alta).</p>\n<h3><a name=\\\"TOC-F:\\\"></a>F:</h3>\n<p>&nbsp;</p>\n<h3><a name=\\\"TOC-G:\\\"></a>G:</h3>\n<p><a href=\\\"https://www.google.com/health%20\\\">Google Health</a>(Healthcare Informatics, PHR): sistema de administraci&oacute;n de informaci&oacute;n cl&iacute;nica personal desarrollado por google.<br /><a href=\\\"http://es.wikipedia.org/wiki/Grupos_relacionados_de_diagn%C3%B3stico\\\" rel=\\\"nofollow\\\">GRD&nbsp;</a>(Healthcare): Grupos Relacionados de Diagnostico.<br />&nbsp;</p>\n<h3><a name=\\\"TOC-H:\\\"></a>H:</h3>\n<p><span style=\\\"font-size: x-small;\\\"><a href=\\\"http://en.wikipedia.org/wiki/Health_care\\\" rel=\\\"nofollow\\\">Healthcare</a>: Health care is the prevention, treatment, and management of illness...<br />HIMSS (Organizations): Healthcare Information and Management System Society<br />HIE: Health Information Exchange<br /></span><a href=\\\"http://www.hl7.org/\\\" rel=\\\"nofollow\\\">HL7&nbsp;</a>(Healthcare Informatics): Health Level Seven, HL7 Standards is a US-based, ANSI-accredited health information standards development organisation. It develops specifications mainly for application-level messaging between health information systems, but also in other areas such as clinical documents and decision support.&nbsp;<br />HMD (HL7): Hierarchical Message Definition&nbsp;<br />HMO (Healthcare): Health Maintenance Organization<br /><a href=\\\"http://en.wikipedia.org/wiki/Healthcare_informatics\\\" rel=\\\"nofollow\\\">Healthcare Informatics</a>: intersection of&nbsp;<a title=\\\"Information science\\\" href=\\\"http://en.wikipedia.org/wiki/Information_science\\\" rel=\\\"nofollow\\\">information science</a>,&nbsp;<a title=\\\"Computer science\\\" href=\\\"http://en.wikipedia.org/wiki/Computer_science\\\" rel=\\\"nofollow\\\">computer science</a>, and&nbsp;<a title=\\\"Health care\\\" href=\\\"http://en.wikipedia.org/wiki/Health_care\\\" rel=\\\"nofollow\\\">health care</a>.<br /><a href=\\\"http://en.wikipedia.org/wiki/HIPAA\\\" rel=\\\"nofollow\\\">HIPAA</a>&nbsp;(Healthcare): Health Insurance Portability and Accountability Act.<br /><a href=\\\"http://en.wikipedia.org/wiki/HISA\\\" rel=\\\"nofollow\\\">HISA</a>(Healthcare Informatics): Health Informatics Service Architecture.<br />HIS (Healthcare Informatics): Hospital Information System.</p>\n<p>&nbsp;</p>\n<h3><a name=\\\"TOC-I:\\\"></a>I:</h3>\n<p>IEEE: Institue of Electrical and Electronics Engineers.<br />ITI (IHE): IT Infraestructure.<br />ITI TF (IHE): ITI Technical Framework.<br /><a href=\\\"http://www.ihe.net/\\\" rel=\\\"nofollow\\\">IHE</a>: Integrating the Healthcare Enterprise.<br /><a href=\\\"http://www.google.com.uy/search?q=implementable+technology+specification+hl7&amp;ie=utf-8&amp;oe=utf-8&amp;aq=t&amp;rls=org.mozilla:es-ES:official&amp;client=firefox-a\\\">ITS&nbsp;</a>(HL7): Implementable Technology Specification,&nbsp;<em>marca como debe ser la interoperabilidad HL7 entre sistemas.</em><br /><a href=\\\"http://en.wikipedia.org/wiki/Interoperability\\\" rel=\\\"nofollow\\\">Interoperability</a>: is a property referring to the ability of diverse systems and organizations to work together (inter-operate).<br />ICD (Healthcare Informatics, Vocabulary): International Classification of Diseases.<br />ICT (Informatics): Information and Communications Technology (Tecnolog&iacute;as de la Informaci&oacute;n y Comunicaci&oacute;n o TIC (es)).<br />ISO 18308 (Healthcare Informatics, Standards): est&aacute;ndar de especificaci&oacute;n t&eacute;cnica sobre los requerimientos para una arquitectura de sistema de Historia Cl&iacute;nica Electr&oacute;nica.<br />IMP: &Iacute;ndice Maestro de Personas/Pacientes (ver MPI).</p>\n<h3><a name=\\\"TOC-J:\\\"></a>J:</h3>\n<p><span>JSON (Data Format): JavaScript Object Notation.<strong><br /><br /></strong></span></p>\n<h3><a name=\\\"TOC-K:\\\"></a>K:</h3>\n<p><span><strong>&nbsp;</strong></span></p>\n<h3><a name=\\\"TOC-L:\\\"></a>L:</h3>\n<p>LDAP (Database): Lightweight Directory Access Protocol<br />LIS: Laboratory Information System<br />LOINC (Healthcare Informatics): Logical Observation Identifier Names and Codes</p>\n<h3><a name=\\\"TOC-M:\\\"></a>M:</h3>\n<p><a href=\\\"http://en.wikipedia.org/wiki/Master_Patient_Index\\\" rel=\\\"nofollow\\\">MPI&nbsp;</a>(Healthcare Informatics): Master Patient Index (IMP en espa&ntilde;ol)<br />MIF (Informatics): Model Interchange Format<br />MCCI (HL7): Message Control Infraestructure<br /><a href=\\\"http://www.mirthproject.org/index.php\\\" rel=\\\"nofollow\\\">Mirth&nbsp;</a>(ESB, HL7): Open Source Cross-Platform HL7 Intergface Engine.</p>\n<h3><a name=\\\"TOC-N:\\\"></a>N:</h3>\n<p>NEMA<span style=\\\"font-size: x-small;\\\">&nbsp;(Organizations)</span>: National Electrinal Manufacturers Association&nbsp;<br />NIU (Informatics): Network Interface Unit<br />NHIN: Nationwide Health Information Network</p>\n<h3><a name=\\\"TOC-O:\\\"></a>O:</h3>\n<p><a href=\\\"http://www.openehr.org/\\\" rel=\\\"nofollow\\\">OpenEHR&nbsp;</a>(Healthcare Informatics, Organization):&nbsp;<em><a title=\\\"Open standard\\\" href=\\\"http://en.wikipedia.org/wiki/Open_standard\\\" rel=\\\"nofollow\\\">open standard</a>&nbsp;that describes the management and storage, retreival and exchange of health data in&nbsp;<a title=\\\"Electronic health records\\\" href=\\\"http://en.wikipedia.org/wiki/Electronic_health_records\\\" rel=\\\"nofollow\\\">electronic health records</a>&nbsp;(EHRs)</em>.<br /><br /><a href=\\\"http://openmrs.org/wiki/OpenMRS\\\" rel=\\\"nofollow\\\">OpenMRS&nbsp;</a>(Healthcare Informatics): is a community-developed, open-source, enterprise&nbsp;<a title=\\\"w:Electronic_Medical_Record\\\" href=\\\"http://en.wikipedia.org/wiki/Electronic_Medical_Record\\\" rel=\\\"nofollow\\\">electronic medical record system</a>&nbsp;framework.<br />OSI (Informatics, Standards): Open Systems Interconnection</p>\n<h3><a name=\\\"TOC-P:\\\"></a>P:</h3>\n<p>PAS: Patient Adminsitration System<br />PACS (Healthcare Informatics): Picture Archiving and Communication System.<br />PDQ (IHE): Patient Demographic Query.<br />PHR: Personal Health Record<br />PIMS: Pharmacy Information Management System<br />PIX (IHE): Patient Identifier Cross-Reference.<br />PMS: Practice Manmagement System<br /><br /></p>\n<h3><a name=\\\"TOC-Q:\\\"></a>Q:</h3>\n<p>&nbsp;</p>\n<h3><a name=\\\"TOC-R:\\\"></a>R:</h3>\n<p>RadLex: Terminolog&iacute;a controlada para radiolog&iacute;a.<br />RHIO (Healthcare): Regional Heath Info Organization<br />RIM (HL7): Reference Information Model<br />R-MIM (HL7): Reduced Message Information Model<br />RIA (Web Application):&nbsp;<a href=\\\"http://en.wikipedia.org/wiki/Rich_Internet_application\\\" rel=\\\"nofollow\\\">Rich Internet Application</a><br />RIS (Healthcare Informatics): Radiology Information System<br />REST (Communication Protocols): Representational State Transfer (ver Web Service).</p>\n<h3><a name=\\\"TOC-S:\\\"></a>S:</h3>\n<p><a href=\\\"http://en.wikipedia.org/wiki/Service-oriented_architecture\\\" rel=\\\"nofollow\\\">SOA</a>: Service Oriented Architecture&nbsp;<br /><a href=\\\"http://en.wikipedia.org/wiki/Standard_%28technical%29\\\" rel=\\\"nofollow\\\">Standard</a>: A technical standard is an established norm or requirement. It is usually a formal document that establishes uniform engineering or technical criteria, methods, processes and practices.<br />SOAP (Communication Protocols): Simple Object Access Protocol (ver Web Service).<br /><a href=\\\"http://www.ihtsdo.org/snomed-ct/\\\" target=\\\"_blank\\\">SNOMED</a>: <strong>S</strong><span>ystematized&nbsp;</span><strong>No</strong><span>menclature of&nbsp;</span><strong>Med</strong><span>icine</span>&nbsp;</p>\n<h3><a name=\\\"TOC-T:\\\"></a>T:</h3>\n<p>TCP/IP (Informatics, Telecommunications): Transmission Control Protocol / Internet Protocol.<br /><a href=\\\"http://en.wikipedia.org/wiki/Telecommunication\\\" rel=\\\"nofollow\\\">Telecommunications</a>: assisted&nbsp;<a title=\\\"Transmission (telecommunications)\\\" href=\\\"http://en.wikipedia.org/wiki/Transmission_%28telecommunications%29\\\" rel=\\\"nofollow\\\">transmission</a>&nbsp;of&nbsp;<a title=\\\"Signal (electrical engineering)\\\" href=\\\"http://en.wikipedia.org/wiki/Signal_%28electrical_engineering%29\\\" rel=\\\"nofollow\\\">signals</a>&nbsp;over a distance for the purpose of&nbsp;<a title=\\\"Communication\\\" href=\\\"http://en.wikipedia.org/wiki/Communication\\\" rel=\\\"nofollow\\\">communication</a>.<br />&nbsp;</p>\n<h3><a name=\\\"TOC-U:\\\"></a>U:</h3>\n<p><strong><a href=\\\"http://en.wikipedia.org/wiki/Unified_Modeling_Language\\\" target=\\\"_blank\\\">UML</a></strong>: Unified Modeling Language</p>\n<h3><a name=\\\"TOC-V:\\\"></a>V:</h3>\n<p><span><strong>&nbsp;</strong></span></p>\n<h3><a name=\\\"TOC-W:\\\"></a>W:</h3>\n<a name=\\\"TOC-A:\\\"></a><br /><a href=\\\"http://en.wikipedia.org/wiki/Web_application\\\" rel=\\\"nofollow\\\">Web Application</a><a name=\\\"TOC-A:\\\"></a><span>:&nbsp;</span><a title=\\\"Application software\\\" href=\\\"http://en.wikipedia.org/wiki/Application_software\\\" rel=\\\"nofollow\\\">application</a><a name=\\\"TOC-A:\\\"></a><span>&nbsp;that is accessed via&nbsp;</span><a title=\\\"Web browser\\\" href=\\\"http://en.wikipedia.org/wiki/Web_browser\\\" rel=\\\"nofollow\\\">web browser</a><a name=\\\"TOC-A:\\\"></a><span>&nbsp;over a network such as the&nbsp;</span><a title=\\\"Internet\\\" href=\\\"http://en.wikipedia.org/wiki/Internet\\\" rel=\\\"nofollow\\\">Internet</a><a name=\\\"TOC-A:\\\"></a><span>&nbsp;or an&nbsp;</span><a title=\\\"Intranet\\\" href=\\\"http://en.wikipedia.org/wiki/Intranet\\\" rel=\\\"nofollow\\\">intranet</a><a name=\\\"TOC-A:\\\"></a><span>.<br /></span>WADO: Web Access to DICOM Persistent Objects.<br />Web Service (Communication Protocols): M&eacute;todo de comunicaci&oacute;n entre dos dispositivos utilizando la Web (Internet).<br />&nbsp;\n<h3><a name=\\\"TOC-X:\\\"></a>X:</h3>\n<p>XDS (IHE): Cross-Enterprise Document Sharing.<br />XML (Data Format): eXtensible Markup Language.<br />&nbsp;</p>\n<h3><a name=\\\"TOC-Y:\\\"></a>Y:</h3>\n<p>&nbsp;</p>\n<h3><a name=\\\"TOC-Z:\\\"></a>Z:</h3>\n<p>&nbsp;</p>', 'HtmlModule', 0),
(11, '<p>&nbsp;</p>\n<p>En esta secci&oacute;n publicaremos distintos trabajos de investigaci&oacute;n, desarrollo y opini&oacute;n, relacionados con openEHR.</p>\n<p>Para publicar un trabajo, primero debe seguir el formato establecido por la comunidad. <a href=\\\"http://openehr.org.es/cms2/cms/displayPageRO?pageId=13\\\">Aqu&iacute;</a> se puede encontrar la plantilla para las publicaciones.</p>\n<p>&nbsp;</p>', 'HtmlModule', 0),
(12, '<div style=\\\"background-color: #dff0d8; border: 1px solid #D6E9C6; color: #468847; padding: 8px 35px 8px 14px; text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5); -webkit-border-radius: 4px; border-radius: 4px;\\\">La informaci&oacute;n en esta p&aacute;gina es solo una referencia que ser&aacute; sometida a discusi&oacute;n por parte de los miembros de la comunidad.</div>\n<p>&nbsp;</p>\n<p>En esta p&aacute;gina se definir&aacute;n los criterios de aceptaci&oacute;n de miembros, sus caracter&iacute;sticas, responsabilidades y derechos.<br />&nbsp;</p>\n<h1>&iquest;Qui&eacute;nes pueden participar?</h1>\n<p>Todos los estudiantes o profesionales con inter&eacute;s en la estandarizaci&oacute;n de los sistemas de informaci&oacute;n en salud, y m&aacute;s espec&iacute;ficamente con inter&eacute;s en el est&aacute;ndar openEHR pueden ser miembros de la comunidad. Esto es independiente de la formaci&oacute;n y de la localizaci&oacute;n geogr&aacute;fica. Adem&aacute;s, aunque el idioma oficial de la comunidad es el espa&ntilde;ol, todos las personas ser&aacute;n bienvenidas cualquiera sea su lengua materna.</p>\n<p>Esto implementa el item \\\"inclusi&oacute;n\\\" de nuestro <a href=\\\"http://openehr.org.es/cms2/cms/displayPageRO?pageId=6\\\">manifiesto</a>.<br />&nbsp;</p>\n<h1>&iquest;C&oacute;mo participar?: tipos de miembros</h1>\n<p>Los miembros se clasifican en las siguientes categor&iacute;as:</p>\n<ul>\n<li>N&uacute;cleo: miembros activos involucrados en tareas de comunicaci&oacute;n, decisi&oacute;n, proyecci&oacute;n, ejecuci&oacute;n, evaluaci&oacute;n, generaci&oacute;n y difusi&oacute;n del conocimiento.</li>\n<li>Colaborador: miembros que aportan a la comunidad de forma espor&aacute;dica, participan de los intercambios en los foros, eventos y otras actividades.</li>\n<li>Explorador: miembro pasivo interesado en seguir el tema de la estandarizaci&oacute;n en sistemas de informaci&oacute;n en salud, la evoluci&oacute;n de la adopci&oacute;n de openEHR, los proyectos existentes, etc.</li>\n</ul>\n<div>Algunas reglas generales:</div>\n<div>\n<ul>\n<li>Los miembros del consejo directivo y los responsables de los grupos de trabajo DEBEN ser miembros del n&uacute;cleo, o colaboradores que cuenten con el abal del consejo.</li>\n<li>La actividad de los miembros en la comunidad ser&aacute; medida y valorada de forma acorde.</li>\n<li>Los miembros que deseen modificar su estatus, ser&aacute;n evaluados por el Consejo Directivo&nbsp;en cuanto a su actividad en la comunidad, y solo ser podr&aacute; modificar el tipo de usuario bas&aacute;ndose en los m&eacute;ritos del interesado.</li>\n</ul>\n</div>\n<div>Estas reglas buscan implementar el principio de meritocracia por el que se rige la comunidad, de forma de lograr los mejores resultados posibles, dando herramientas y reconocimiento a quienes realmente lo merecen.</div>', 'HtmlModule', 0);
INSERT INTO `cms_html_module` (`id`, `content`, `class`, `deleted`) VALUES
(13, '<div style=\\\"background-color: #dff0d8; border: 1px solid #D6E9C6; color: #468847; padding: 8px 35px 8px 14px; text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5); -webkit-border-radius: 4px; border-radius: 4px;\\\">La informaci&oacute;n en esta p&aacute;gina es solo una referencia que ser&aacute; sometida a discusi&oacute;n por parte de los miembros de la comunidad.</div>\n<p>&nbsp;</p>\n<p>Estos manuales y gu&iacute;as nos ayudan a organizar nuestras actividades, acciones y proyectos, aportan a la calidad de nuestros resultados y a mejorar la comunicaci&oacute;n entre los miembros de la comunidad y todos los actores del sistema de salud.</p>\n<p>&nbsp;</p>\n<h1>Difusi&oacute;n</h1>\n<h2>Blogs</h2>\n<p>Pr&oacute;ximamente...<br />&nbsp;</p>\n<h2>Redes sociales</h2>\n<p>Pr&oacute;ximamente...<br />&nbsp;</p>\n<h2>Otros medios</h2>\n<p>Pr&oacute;ximamente...</p>\n<p>&nbsp;</p>\n<h1>Comunicaci&oacute;n</h1>\n<h2>Foros</h2>\n<h3>Gu&iacute;a de uso de los foros:</h3>\n<p>Pr&oacute;ximamente...</p>\n<p>&nbsp;</p>\n<h3>Reglamento de uso de nuestros foros:</h3>\n<p><span style=\\\"color: navy;\\\"><strong>Tenemos algunas normas que en aras de una mejor convivencia y con el objeto de respetar una igualdad de derechos y deberes, todos debemos cumplir.&nbsp;</strong></span><br /><br /><span>Es nuestro inter&eacute;s promover la libertad de conocimiento y expresi&oacute;n, por lo que no censuraremos mensajes basados en las opiniones expresadas y publicadas en dichos mensajes, pero haremos cumplir las normas y pol&iacute;ticas descritas en nuestros foros.</span><br /><br /><strong>1. Normas generales&nbsp;</strong><br /><br /><strong>1.1</strong><span>&nbsp;El hecho de ignorar o desconocer estas normas y pol&iacute;ticas, no exime a ning&uacute;n usuario de su cumplimiento. Es obligaci&oacute;n de todos los usuarios leer y adherirse a las normas aqu&iacute; descritas y a las especificadas en cualquier otro foro, tema o categor&iacute;a.</span><br /><br /><strong>1.2</strong><span>&nbsp;Nos reservamos el derecho de mover, borrar, editar o cerrar temas o mensajes que incumplan las normas y pol&iacute;ticas establecidas aqu&iacute;.</span><br /><br /><strong>1.3</strong><span>&nbsp;El idioma de preferencia de nuestros foros es el espa&ntilde;ol (castellano), por lo que agradecemos el uso moderado de cualquier otro idioma.</span><br /><br /><strong>1.4</strong><span>&nbsp;Los usuarios s&oacute;lo podr&aacute;n tener una cuenta por persona, y cada cuenta podr&aacute; ser manejada por una persona &uacute;nicamente. Las cuentas adicionales podr&aacute;n ser suspendidas sin aviso previo o posterior al usuario.</span><br /><br /><strong>1.5</strong><span>&nbsp;El incumplimiento de las normas y pol&iacute;ticas, as&iacute; como cualquier ofensa, agresi&oacute;n o expresi&oacute;n de insulto dirigida a cualquier otro miembro, podr&aacute; resultar en la suspensi&oacute;n inmediata de su cuenta de usuario.</span><br /><br /><strong>2. Normas de los foros y categor&iacute;as&nbsp;</strong><br /><br /><span>Las siguientes normas aplican a todos los foros y categor&iacute;as:&nbsp;</span><br /><br /><strong>2.1</strong><span>&nbsp;A excepci&oacute;n del espacio de&nbsp;</span>Promociones<span>, no se permite la publicaci&oacute;n de productos, servicios, enlaces, contenidos o cualquier otro tipo de informaci&oacute;n que haga referencia a la empresa o sitio web con la que est&aacute;n relacionados directa o indirectamente, con clara intenci&oacute;n o prop&oacute;sito publicitario, compra/venta, comercial o de autopromoci&oacute;n. Esto incluye sugerir sus propios servicios y los servicios de asociados, clientes y empleadores.</span><br /><br /><strong>2.2</strong><span>&nbsp;Est&aacute; prohibido publicar enlaces (links o URL) que incluyan alg&uacute;n sistema de comisiones, afiliados, referidos o cualquier otro sistema del tipo pago por clic (pay per click), tanto en el cuerpo de los mensajes como en el espacio destinado a la firma de usuario.&nbsp;</span><br /><br /><strong>2.3</strong><span>&nbsp;Los usuarios no pueden publicar mensajes para insinuar o instruir a otro(s) miembro(s) para que revisen su cuenta de correo electr&oacute;nico, su buz&oacute;n de mensajes privados, o para indicarles de alguna manera que tienen un nuevo mensaje privado o de correo electr&oacute;nico, con el objeto de solicitar u ofrecer una respuesta con respecto al tema en cuesti&oacute;n. Tampoco est&aacute; permitido enviar publicidad u ofertas de servicios no solicitados a trav&eacute;s de mensajes privados y/o correo electr&oacute;nico a otros usuarios de nuestros foros.</span><br /><br /><strong>2.4</strong><span>&nbsp;No est&aacute; permitido iniciar dos o m&aacute;s temas con respecto al mismo t&oacute;pico o asunto, ni publicar dos o m&aacute;s mensajes cuyos contenidos coincidan dentro de un mismo tema en un mismo foro o en v&aacute;rios foros. Dichos temas o mensajes publicados podr&aacute;n ser eliminados o unidos sin aviso previo o posterior. Utiliza el buscador antes de publicar un nuevo tema.</span><br /><br /><strong>2.5</strong><span>&nbsp;Los usuarios no pueden publicar mensajes en nombre o representaci&oacute;n de usuarios suspendidos.&nbsp;</span><strong><br /></strong><br /><strong>2.6</strong><span>&nbsp;Los usuarios no pueden revivir o reactivar temas publicando informaci&oacute;n in&uacute;til o sin sentido, o llevando a cabo cualquier otra acci&oacute;n para deliberadamente mantener arriba en el &iacute;ndice del foro dicho tema o aumentar el contador de mensajes.</span><br /><br /><strong>2.7</strong><span>&nbsp;Los usuarios no pueden usar los temas o discusiones para promover, recomendar, alabar o desacreditar otros productos, servicios, empresas o sitios web, sin tener experiencia directa o de primera mano con esos productos, servicios, empresas o sitios web.</span><br /><br /><strong>2.8</strong><span>&nbsp;Los usuarios no pueden publicar, solicitar ni difundir informaci&oacute;n que promueva el plagio, la pirater&iacute;a, la divulgaci&oacute;n de n&uacute;meros de serie, crack o similares, o copias no autorizadas de material protegido por derechos de autor.</span><br /><br /><strong>2.9</strong><span>&nbsp;Los usuarios deben usar un lenguaje cort&eacute;s, respetuoso y gentil. Ning&uacute;n usuario puede publicar material o contenido que sea conocidamente falso, difamatorio, insultante, acosatorio, vulgar, hostil, obsceno, profano, de orientaci&oacute;n sexual, amenazante, racista o que fomente cualquier tipo de odio, ilegal en alg&uacute;n pa&iacute;s o regi&oacute;n, invasivo de la privacidad de alguna persona o que vulnere alguna ley o derechos de autor.</span></p>\n<p><strong>2.10</strong>&nbsp;Los administradores pueden llamarle la atenci&oacute;n o sugerirle reescribir un mensaje si se considera que viola alguna de estas reglas. No lo tome a mal, es para preservar la calidad de las discusiones y mantener un nivel profesional aceptable.</p>\n<p><strong>2.11</strong><span>&nbsp;Los usuarios no pueden publicar, solicitar ni difundir informaci&oacute;n que promueva la realizaci&oacute;n de ningun il&iacute;cito en su jurisdicci&oacute;n, incluyendo pero no limitado a: fraudes electr&oacute;nicos, SPAM, Phishing, Spoofing, Forgery y cualquier otro tipo de conducta que sea considerada un acto ilegal.</span><br /><br /><strong>3. Uso de las firmas de usuario</strong><br /><br /><strong>3.1</strong><span>&nbsp;La firma de usuario debe establecerse desde las preferencias del usuario y entre las principales restricciones, la firma solo podr&aacute; tener 200 caracteres, 4 l&iacute;neas y no podr&aacute;n aplicarse colores.&nbsp;</span><br /><br /><strong>3.2</strong><span>&nbsp;La firma de usuario no puede contener ofertas de productos o servicios, ni precios, planes o especificaciones comerciales, ni enlaces (links o URL) que incluyan alg&uacute;n sistema de comisiones, afiliados, referidos o cualquier otro sistema del tipo pago por clic (pay per click).</span><strong><br /></strong><br /><strong>3.3</strong><span>&nbsp;La firma podr&aacute; contener un m&aacute;ximo de 3 enlaces.</span><br /><strong><br /></strong><br /><span style=\\\"color: navy;\\\"><strong><em>El cumplimiento de las normas aqu&iacute; expuestas nos beneficia a todos. Gracias por vuestra cooperaci&oacute;n.&nbsp;</em></strong></span></p>\n<p>&nbsp;</p>\n<h2>Otros medios de comunicaci&oacute;n y difusi&oacute;n</h2>\n<p>Pr&oacute;ximamente ...</p>\n<p>&nbsp;</p>\n<h1>Materiales y publicaciones</h1>\n<h2>Copyright, Reproducci&oacute;n y Citas</h2>\n<h3>Acceso</h3>\n<p>Los materiales publicados en el sitio web de nuestra comunidad (openehr.org.es) son de acceso libre para usuarios registrados en nuestro portal, debidamente identificados como miembros de la comunidad. Esto incluye a las publicaciones, materiales generados por los grupos de trabajo, y otros materiales e insumos generados por otros miembros de la comunidad y publicados en nuestro portal.</p>\n<h3>Reproducci&oacute;n de material</h3>\n<p>Todo el material publicado en este sitio podr&aacute; ser referenciado y utilizado en cualquier &aacute;mbito siempre y cuando se cumplan estas dos condiciones:</p>\n<ul>\n<li>Se debe mencionar a los autores del material, en caso de ser el producto de individuos.</li>\n<li>En cualqueir caso, se debe incluir una referencia a nuestro portal web: \\\"Comunidad de openEHR en espa&ntilde;ol: http://openehr.org.es\\\"</li>\n<li>En cualquier caso, se debe incluid el logo de nuestra comunidad (ver logo <a href=\\\"http://openehr.org.es/cms2/cms/displayPageRO?pageId=13\\\" target=\\\"_blank\\\">aqu&iacute;</a>): incluyendo la palabra \\\"openEHR\\\" y nuestra paloma blanca.</li>\n</ul>\n<p>&nbsp;</p>\n<h1>Grupos</h1>\n<h2>Creaci&oacute;n de grupos</h2>\n<p>Para crear un grupo se debe completar &nbsp;el formulario de \\\"creaci&oacute;n de grupos\\\" (disponible proximamente). Por m&aacute;s informaci&oacute;n, <a href=\\\"http://openehr.org.es/cms2/cms/displayPageRO?pageId=7\\\">clic aqu&iacute;</a>.</p>\n<p>&nbsp;</p>\n<h1>Proyectos</h1>\n<h2>Propuesta de nuevo proyecto</h2>\n<p>En el futuro, los grupos podr&aacute;n proponer distintos proyectos. Aqu&iacute; se publicar&aacute; toda la informaci&oacute;n sobre la propuesta de proyectos.</p>\n<p>&nbsp;</p>', 'HtmlModule', 0),
(14, '<div style=\\\"background-color: #dff0d8; border: 1px solid #D6E9C6; color: #468847; padding: 8px 35px 8px 14px; text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5); -webkit-border-radius: 4px; border-radius: 4px;\\\">La informaci&oacute;n en esta p&aacute;gina es solo una referencia que ser&aacute; sometida a discusi&oacute;n por parte de los miembros de la comunidad.</div>\n<p>&nbsp;</p>\n<p>El consejo directivo estar&aacute; formado por profesionales que se hayan destacado en la promoci&oacute;n, investigaci&oacute;n, capacitaci&oacute;n, desarrollo, o adopci&oacute;n del est&aacute;ndar openEHR. Su elecci&oacute;n est&aacute; basada en sus m&eacute;ritos, no es un consejo pol&iacute;tico, es un consejo de organizaci&oacute;n, coordinaci&oacute;n y acci&oacute;n.<br />&nbsp;</p>\n<p><strong>Conformaci&oacute;n:</strong></p>\n<p>El objetivo del consejo es lograr representatividad de todos los pa&iacute;ses de habla hispana y otros pa&iacute;ses asociados que tengan compartan los objetivos de nuestra comunidad.</p>\n<p>Actualmente este consejo est&aacute; en v&iacute;as de conformaci&oacute;n.</p>\n<p><strong>Responsabilidades:</strong></p>\n<p>El consejo directivo es responsable de organizar y coordinar las acciones de la comunidad, de forma de cumplir con los objetivos, verificar que los recursos diponibles se utilizan de forma eficiente para lograr esos objetivos, haciendo foco y priorizando&nbsp;actividades y proyectos para seguir el camino de acci&oacute;n planificado. Aprueba la creaci&oacute;n de grupos de trabajo y de proyectos, coordina actividades entre grupos de trabajo (interna) y con otras organizaciones (externa).Tambi&eacute;n es responsable de verificar el avance de los proyectos y el trabajo de los grupos, y asegurar la calidad de todos los contenidos del portal de la comunidad, proyectos, y actividades.</p>', 'HtmlModule', 0),
(15, '<div style=\\\"background-color: #dff0d8; border: 1px solid #D6E9C6; color: #468847; padding: 8px 35px 8px 14px; text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5); -webkit-border-radius: 4px; border-radius: 4px;\\\">La informaci&oacute;n en esta p&aacute;gina es solo una referencia que ser&aacute; sometida a discusi&oacute;n por parte de los miembros de la comunidad.</div>\n<p>&nbsp;</p>\n<p>Los grupos de trabajo son responsables de plantear, planificar, coordinar, ejecutar y reportar avances y resultados de proyectos en distintas &aacute;reas, como pueden ser:</p>\n<ul>\n<li>Modelado</li>\n<li>Estandarizaci&oacute;n</li>\n<li>Software</li>\n<li>Capacitaci&oacute;n</li>\n<li>otras &aacute;reas</li>\n</ul>\n<h1><br />Estructura interna:</h1>\n<div>Los grupos tendr&aacute;n un responsable encargado de coordinar las actividades y generar reportes de avances y resultados obtenidos. Estos reportes ser&aacute;n &uacute;tiles para evaluar la actividad del grupo por el resto de la comunidad, y para que quienes puedan estar interesados en la tem&aacute;tica puedan ser parte del grupo, sabiendo en qu&eacute; se ha trabajando hasta el momento.</div>\n<div>El responsable del grupo ser&aacute; un miembro del n&uacute;cleo o un colaborador abalado por el Consejo Directivo. (<a href=\\\"http://openehr.org.es/cms2/cms/displayPage?pageId=11\\\">ver tipos de miembros</a>).</div>\n<div>Los miembros de los grupos deben ser de \\\"n&uacute;cleo\\\" o \\\"colaboradores\\\". Los miembros \\\"exloradores\\\" podr&aacute;n formar parte del grupo, previo abal del responsable del mismo.<br />&nbsp;</div>\n<h1><strong>Objetivos:</strong></h1>\n<div>Los grupos de trabajo son una forma de organizar y ejecutar proyectos en distintas &aacute;reas tem&aacute;ticas, y sirven como nexo entre profesionales de diversos perfiles, con intereses similares, y que est&aacute;n dispersos geogr&aacute;ficamente.</div>\n<div>Los grupos tambi&eacute;n buscan ser nexos entre la academia, la industria, las instituciones asistenciales, el gobierno y la sociedad en general, donde diversos actores se unen para lograr resultados concretos en &aacute;reas estrat&eacute;gicas, como pueden ser:</div>\n<div>\n<ul>\n<li>Salud poblacional</li>\n<li>Seguimiento de cr&oacute;nicos</li>\n<li>Integraci&oacute;n de sistemas</li>\n<li>Evaluaci&oacute;n de est&aacute;ndares</li>\n<li>Desarrollo de prototipos</li>\n<li>Telemedicina</li>\n<li>entre otras &aacute;reas</li>\n</ul>\n</div>\n<h2><br /><strong>Creaci&oacute;n de un grupo de trabajo:</strong></h2>\n<div><strong>&nbsp;</strong></div>\n<div>Cualquier miembro de la comunidad puede plantear la creaci&oacute;n un grupo de trabajo ante la comisi&oacute;n directiva de la comunidad. Para esto debe completarse el <span style=\\\"background-color: #ffff00;\\\">\\\"formulario de solicitud de creaci&oacute;n de grupo de trabajo\\\"<span style=\\\"background-color: #ffffff;\\\">, planteando el &aacute;rea de trabajo, el objetivo del grupo, su conformaci&oacute;n inicial, su responsable, una plan de trabajo inical, y otras informaciones &uacute;tiles para poder evaluar su creaci&oacute;n</span></span>.<br />&nbsp;</div>\n<h2><strong>Formar parte del grupo:</strong></h2>\n<div>Pr&oacute;ximamente...<br />&nbsp;</div>\n<h2><strong>Plantear un proyecto:</strong></h2>\n<div>Pr&oacute;ximamente...<br />&nbsp;</div>\n<h2><strong>Ejecutar un proyecto:</strong></h2>\n<div>Pr&oacute;ximamente...<br />&nbsp;</div>\n<h2><strong>Reportes de estado y resultados:</strong></h2>\n<div>Pr&oacute;ximamente...<br />&nbsp;</div>\n<h2><strong>Finalizaci&oacute;n de un proyecto:</strong></h2>\n<div>Pr&oacute;ximamente...<br />&nbsp;</div>\n<h2><strong>Hibernaci&oacute;n y cierre de un grupo:</strong></h2>\n<div>Cuando los integrantes de un grupo no tienen tiempo suficiente para dedicarle a las actividades del mismo, el grupo puede entrar en estado de hibernaci&oacute;n. En este estado, la comunidad no esperar&aacute; reportes del grupo, pero el grupo no est&aacute; cerrado a&uacute;n.</div>\n<div>En el per&iacute;odo de hibernaci&oacute;n, otros miembros podr&aacute;n solicitar la responsabilidad del grupo para continuar con sus actividades. Estas solicitudes ser&aacute;n evaluadas por el Consejo Directivo con la participaci&oacute;n del responsable actual.</div>\n<div>Una vez transcurrido un tiempo prudencial de hibernaci&oacute;n sin haber solicitudes de responsabilidad por otros miembros de la comunidad, el grupo ser&aacute; cerrado. Cerrar un grupo ser&aacute; una acci&oacute;n autom&aacute;tica luego de un per&iacute;odo de tiempo estipulado, y se notificar&aacute; al actual reponsable del grupo del cambio de estado del mismo.</div>\n<div>Todo el trabajo del grupo hasta el momento seguir&aacute; accesible a los dem&aacute;s miembros de la comunidad.</div>\n<div>En cualquier momento, un miembro de la comunidad puede solicitar la reapertura del grupo. Este miembro puede ser el &uacute;ltimo responsable del grupo u otro miembro. En el caso que no sea el &uacute;ltimo responsable del grupo, la asignaci&oacute;n de responsabilidad ser&aacute; hecha por el Consejo Directivo sin consultar al responsable anterior.</div>', 'HtmlModule', 0),
(16, '<p><br />Esta p&aacute;gina contiene informaci&oacute;n general sobre nuestra planificaci&oacute;n estrat&eacute;gica, organizaci&oacute;n, &aacute;reas de trabajo, y financiaci&oacute;n.</p>\n<div style=\\\"background-color: #dff0d8; border: 1px solid #D6E9C6; color: #468847; padding: 8px 35px 8px 14px; text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5); -webkit-border-radius: 4px; border-radius: 4px;\\\">La informaci&oacute;n en esta p&aacute;gina es solo una referencia que ser&aacute; sometida a discusi&oacute;n por parte de los miembros de la comunidad.</div>\n<p>&nbsp;</p>\n<h1>Plan estrat&eacute;gico</h1>\n<p>El plan estrat&eacute;gico de la comunidad brinda un marco general a todas nuestras actividades, ayud&aacute;ndonos a organizar nuestras acciones teniendo en cuenta objetivos claros y fomentando un uso acertado y eficiente de los recursos disponibles, buscando resultados concretos a corto y mediano plazo en todas nuestras l&iacute;neas de acci&oacute;n.<br />&nbsp;</p>\n<h2>Objetivos</h2>\n<p>Nuestro objetivo es aportar desde distintas &aacute;reas profesionales a la informatizaci&oacute;n exitosa en el sector sanitario, buscando un uso razonable de los recursos disponibles, a la vez que se busca mejorar la calidad de atenci&oacute;n al paciente y la comunicaci&oacute;n entre el equipo de salud. Estamos convencidos de que estos objetivos no se pueden lograr sin informatizaci&oacute;n, y que el camino hacia la informatizaci&oacute;n debe estar guiado por est&aacute;ndares y buenas pr&aacute;cticas.</p>\n<p>Como comunidad, estaremos avocados a difundir esos est&aacute;ndares y buenas pr&aacute;cticas, enfoc&aacute;ndonos en openEHR. Adem&aacute;s buscaremos coordinar acciones en conjunto para compartir buenas pr&aacute;cticas y factores de &eacute;xito, y aprender de las experiencias de los compa&ntilde;eros (buenas y malas).</p>\n<p><strong>En este sentido, planteamos cuatro objetivos centrales:</strong></p>\n<ul>\n<li><strong>Promoci&oacute;n</strong>:&nbsp;de la aplicaci&oacute;n de las Tecnolog&iacute;as de la Informaci&oacute;n y Comunicaci&oacute;n en el &aacute;rea de la salud, y del uso de est&aacute;ndares en Inform&aacute;tica M&eacute;dica enfoc&aacute;ndonos en el est&aacute;ndar openEHR.</li>\n<li><strong>Vinculaci&oacute;n</strong>: entre profesionales con distintas formaciones pero con intereses compartidos, tanto en aplicaci&oacute;n de TIC en salud como de est&aacute;ndares, con openEHR como foco principal. Y vinculaci&oacute;n entre distintos actores del sistema sanitario: proveedores, instituciones m&eacute;dicas, academia, gobierno y sociedad.</li>\n<li><strong>Educaci&oacute;n</strong>: promover y brindar instancias de capacitaci&oacute;n en distintas &aacute;reas de la informatizaci&oacute;n en salud y aplicaci&oacute;n de est&aacute;ndares, centr&aacute;ndonos en openEHR. La generaci&oacute;n y difusi&oacute;n del conocimiento es un &aacute;rea esencial en este punto.</li>\n<li><strong>Coordinaci&oacute;n</strong>: de estrategias, planes y proyectos, permitiendo mantener l&iacute;neas de implementaci&oacute;n similares entre distintos pa&iacute;ses y regiones, promoviendo y aplicando est&aacute;ndares y buenas pr&aacute;cticas.</li>\n</ul>\n<p>Estos objetivos centrales se plasmar&aacute;n en el \\\"plan de acci&oacute;n\\\" de la comunidad.<br />&nbsp;</p>\n<h2>An&aacute;lisis de la situaci&oacute;n actual</h2>\n<p><strong>An&aacute;lisis general:</strong></p>\n<ul>\n<li>Problemas en la construcci&oacute;n y mantenimiento de sistemas de informaci&oacute;n en salud</li>\n<ul>\n<li>Altos costos</li>\n<li>Falta de recursos</li>\n<li>Falta de compromiso</li>\n<li>Problemas en la comunicaci&oacute;n y visibilidad</li>\n<li>Inform&aacute;ticos gestionando conocimiento cl&iacute;nico</li>\n<li>Dependencia tecnol&oacute;gica</li>\n<li>Falta de estandarizaci&oacute;n</li>\n<li>Falta de planificaci&oacute;n a largo plazo</li>\n</ul>\n<li>Problemas en la adopci&oacute;n de sistemas de informaci&oacute;n en salud</li>\n<ul>\n<li>Miedo al cambio y problemas culturales</li>\n<li>Falta de conocimiento de pros y contras</li>\n<li>Problemas de comunicaci&oacute;n</li>\n<li>Experiencias pasadas negativas</li>\n<li>No aplicaci&oacute;n de la herramienta correcta al problema espec&iacute;fico</li>\n<li>No consideraci&oacute;n de requisitos de los usuarios finales</li>\n<li>Consideraci&oacute;n de requisitos de gesti&oacute;n por sobre los de los usuarios finales</li>\n<li>Falta de participaci&oacute;n de los interesados (usuarios finales, gestores, financiadores, tomadores de decisi&oacute;n) en el proceso de desarrollo/adaptaci&oacute;n de las herramientas</li>\n</ul>\n</ul>\n<p>Los principales problemas en el desarrollo de herramientas inform&aacute;ticas para la salud, de su efectiva adopci&oacute;n y de su mantenimiento a largo plazo NO SON PROBLEMAS T&Eacute;CNICOS, son principalemente&nbsp;problemas culturales, psico-sociales y de comunicaci&oacute;n entre las PERSONAS.<br />&nbsp;</p>\n<p><strong>An&aacute;lisis particular en cuanto a openEHR:</strong></p>\n<ul>\n<li>Problemas de adopci&oacute;n:</li>\n<ul>\n<li>Es un est&aacute;ndar desconocido (como muchos otros) por las empresas proveedoras de software en salud, por las instituciones m&eacute;dicas, por el gobierno y dem&aacute;s actores del sistema sanitario.</li>\n<li>Bajo nivel de implementaci&oacute;n en herramientas comerciales (en Iberoam&eacute;rica), aunque tiene un nivel mayor (aunque menor de lo deseable) en investigaci&oacute;n y desarrollo por parte de la academia.</li>\n<li>Las especificaciones y materiales est&aacute;n en idioma ingl&eacute;s, lo que dificulta la comprensi&oacute;n.</li>\n</ul>\n<li>Problemas de identidad:</li>\n<ul>\n<li>Es frecuente que se hable de openEHR como un sistema, mientras openEHR es un est&aacute;ndar.</li>\n<li>Es frecuente que se lo compare con HL7, cu&aacute;ndo son est&aacute;ndares complementarios para resolver distintos problemas.</li>\n</ul>\n</ul>\n<p>&nbsp;</p>\n<h1>Prop&oacute;sito de la comunidad</h1>\n<h2>Misi&oacute;n</h2>\n<p>La misi&oacute;n de esta comunidad es la investigaci&oacute;n, difusi&oacute;n, capacitaci&oacute;n y ejecuci&oacute;n de proyectos de aplicaci&oacute;n del est&aacute;ndar openEHR y de otros est&aacute;ndares complementarios en el &aacute;rea de la Inform&aacute;tica M&eacute;dica, m&aacute;s espec&iacute;ficamente en lo que tiene que ver con el &aacute;rea cl&iacute;nica y la Historia Cl&iacute;nica Electr&oacute;nica. Buscando entender los problemas de nuestra regi&oacute;n, y proponer soluciones acordes.<br />&nbsp;</p>\n<h2>Visi&oacute;n</h2>\n<p>Cubrir el vac&iacute;o que existe en los pa&iacute;ses hispano-parlantes en cuanto a la difusi&oacute;n, promoci&oacute;n y aplicaci&oacute;n de est&aacute;ndares para mejorar y permitir el acceso global a informaci&oacute;n sanitaria, de forma eficiente, en el lugar y momento que esta se requiera.<br />En este sentido, la comunidad nuclear&aacute; a profesionales de diversas &aacute;reas que compartan este objetivo general, que est&eacute;n dispuestos a adquirir y compartir los conocimientos necesarios para efectivizar este objetivo en resultados espec&iacute;ficos, para el beneficio de nuestra sociedad toda.<br />Esta comunidad se convertir&aacute; en referente en el &aacute;rea de los Sistemas de Informaci&oacute;n en Salud, y apoyar&aacute; en la viabilizaci&oacute;n de proyectos concretos en pa&iacute;ses de Iberoam&eacute;rica entre otros. Adem&aacute;s servir&aacute; como nexo entre la academia, los proveedores, los consumidores, el gobierno y con otras comunidades o asociaciones de Inform&aacute;tica M&eacute;dica y Est&aacute;ndares.<br />&nbsp;</p>\n<h2>Valores y principios</h2>\n<p><strong>Trabajo</strong>: Nos guiamos por la acci&oacute;n para conseguir un resultado concreto, y el en proceso adquirimos conocimientos, cualidades y t&eacute;cnicas que nos hacen mejores seres humanos. El trabajo en equipo es fundamental para lograr nuestros objetivos, y el v&iacute;nculo con diversos profesionales nos sensibiliza ante las necesidades de los dem&aacute;s y nos hace aportar de mejor manera a la sociedad.</p>\n<p><strong>Integridad</strong>: Obramos con rectitud y apego a nuestros principios y valores.</p>\n<p><strong>Austeridad</strong>: Contamos con recursos muy limitados para obrar, por lo que ser&aacute;n utilizados de forma eficaz, priorizando el cumplimiento con los objetivos centrales de nuestra comunidad.</p>\n<p><strong>Respeto</strong>: Daremos consideraci&oacute;n a todas las opiniones, sin desmerecer ninguna, conservando la integridad en todo momento tanto dentro como fuera de la comunidad.</p>\n<p><strong>Liderazgo</strong>:&nbsp;Primero pondremos en pr&aacute;ctica nuestras ideas y despu&eacute;s predicaremos a los dem&aacute;s con lo que ya hemos realizado (predicar con el ejemplo).</p>\n<p><strong>Compromiso</strong>: Mostramos inter&eacute;s, damos prioridad y participamos activamente en las acciones que ayuden a cumplir con las necesidades de nuestros miembros y de los actores del sistema sanitario.</p>\n<p><strong>Excelencia</strong>: Todos los productos creados por nuestra comunidad ser&aacute;n evaluados para cumplir con los requerimientos de calidad para servir de la mejor manera a las necesidades de nuestros miembros y de los actores del sistema sanitario, y para mostrar la seriedad del trabajo de nuestra comunidad.<br />&nbsp;</p>\n<h2>L&iacute;neas de acci&oacute;n</h2>\n<p>Las l&iacute;neas de acci&oacute;n enmarcan todas las actividades de la comunidad, las cuales ser&aacute;n debidamente planificadas seg&uacute;n un plan de acci&oacute;n:</p>\n<ul>\n<li>Definici&oacute;n de identidad</li>\n<li>Difusi&oacute;n</li>\n<li>Capacitaci&oacute;n</li>\n<li>Investigaci&oacute;n</li>\n<li>Desarrollo</li>\n<li>Especificaci&oacute;n</li>\n<li>Asesor&iacute;a</li>\n<li>Vinculaci&oacute;n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Objetivos espec&iacute;ficos</strong></p>\n<p>Dentro de estas l&iacute;neas de acci&oacute;n debemos analizar problemas, dise&ntilde;ar soluciones y ejecutar actividades para cumplir con objetivos concretos, por ejemplo algunos problemas actuales que debemos afrontar son:</p>\n<ul>\n<li>Falta de conocimiento de openEHR por parte de los tomadores de decisi&oacute;n, de los proveedores de software y de las instituciones sanitarias. (problema de difusi&oacute;n)</li>\n<li>Esto genera un problema de adopci&oacute;n de openEHR, tanto por desconocimiento como por falta de ejemplos concretos de su aplicaci&oacute;n, de las ventajas de aplicarlo, y de confusi&oacute;n con otros est&aacute;ndares que en realidad son complementarios. (problema de adopci&oacute;n)</li>\n<li>Falta de recursos humanos capaces de asesorar en la aplicaci&oacute;n de openEHR o de implementarlo en prototipos o proyectos concretos. (problema de capacitaci&oacute;n y formaci&oacute;n)</li>\n<li>Falta de una organizaci&oacute;n que de respuesta a estos problemas y que lleve la bandera de openEHR en los pa&iacute;ses de habla hispana. (problema de identidad)</li>\n<li>Falta de herramientas, y de personas comprometidas que las desarrollen, que faciliten la adopci&oacute;n del est&aacute;ndar. (problemas de capacitaci&oacute;n y financiaci&oacute;n)</li>\n<li>Falta de adaptaci&oacute;n y desarrollo de est&aacute;ndares complementarios para la estandarizaci&oacute;n completa y homog&eacute;nea de los sistemas de informaci&oacute;n en salud.&nbsp;(problemas de capacitaci&oacute;n, financiaci&oacute;n, compromiso de autoridades y organizaciones)</li>\n</ul>\n<p>Dados estos problemas, debemos delinear metas concretas y acciones para alcanzar los objetivos de la comunidad. Por ejemplo, para los problemas de formaci&oacute;n plantear&iacute;amos cursos, talleres, tutoriales, charlas, etc. sobre el est&aacute;ndar. Para los problemas de difusi&oacute;n y adopci&oacute;n, podr&iacute;amos plantear proyectos de investigaci&oacute;n y desarrollo en nuestras universidades, y presentar los resultados en distintos congresos de Inform&aacute;tica M&eacute;dica en nuestros pa&iacute;ses. Tambi&eacute;n para la difusi&oacute;n, buscar publicar en revistas de inform&aacute;tica, salud e inform&aacute;tica en salud, adem&aacute;s de usar todo el aparato virtual de las redes sociales, los blogs y portales web relacionados con la tem&aacute;tica. Para esto es necesario generar contenidos que sean atractivos a quienes no conocen openEHR. Estos contenidos pueden ser art&iacute;culos, presentaciones, videos, etc.<br />&nbsp;</p>\n<h2>Mapa del plan de nuestra comunidad</h2>\n<p>&nbsp;</p>\n<div id=\\\"flashcontent\\\" style=\\\"height: 200px;\\\" onmouseover=\\\"giveFocus();\\\">Flash plugin or Javascript are turned off. Activate both and reload to view the mindmap</div>\n<p>\n<script type=\\\"text/javascript\\\" src=\\\"http://openehr.org.es/mindmap/flashobject.js\\\"></script>\n<script type=\\\"text/javascript\\\">// <![CDATA[\n(function(){\n		// for allowing using http://.....?mindmap.mm mode\n		function getMap(map){\n		  var result=map;\n		  var loc=document.location+\\\'\\\';\n		  if(loc.indexOf(\\\".mm\\\")>0 && loc.indexOf(\\\"?\\\")>0){\n			result=loc.substring(loc.indexOf(\\\"?\\\")+1);\n		  }\n		  return result;\n		}\n		var fo = new FlashObject(\\\"/mindmap/visorFreemind.swf\\\", \\\"visorFreeMind\\\", \\\"100%\\\", \\\"100%\\\", 6, \\\"#9999ff\\\");\n		fo.addParam(\\\"quality\\\", \\\"high\\\");\n		fo.addParam(\\\"bgcolor\\\", \\\"#ffffff\\\");\n		fo.addVariable(\\\"openUrl\\\", \\\"_blank\\\");\n		fo.addVariable(\\\"startCollapsedToLevel\\\",\\\"2\\\");\n		fo.addVariable(\\\"maxNodeWidth\\\",\\\"200\\\");\n		//\n		fo.addVariable(\\\"mainNodeShape\\\",\\\"elipse\\\");\n		fo.addVariable(\\\"justMap\\\",\\\"false\\\");\n		fo.addVariable(\\\"initLoadFile\\\",getMap(\\\"/mindmap/openEHR_en_espanol.mm\\\"));\n		fo.addVariable(\\\"defaultToolTipWordWrap\\\",200);\n		fo.addVariable(\\\"offsetX\\\",\\\"middle\\\");\n		fo.addVariable(\\\"offsetY\\\",\\\"middle\\\");\n		fo.addVariable(\\\"buttonsPos\\\",\\\"top\\\");\n		fo.addVariable(\\\"min_alpha_buttons\\\",20);\n		fo.addVariable(\\\"max_alpha_buttons\\\",100);\n		fo.addVariable(\\\"scaleTooltips\\\",\\\"false\\\");\n		\n		fo.write(\\\"flashcontent\\\");\n})(this);\n// ]]></script>\n<script type=\\\"text/javascript\\\" language=\\\"javascript\\\">// <![CDATA[\nfunction giveFocus() \n    { \n      document.visorFreeMind.focus();  \n    }\n// ]]></script>\n</p>\n<p>&nbsp;</p>\n<h2>Etapas del plan: plan de acci&oacute;n</h2>\n<p>La primer etapa de la comunidad estar&aacute; dirigida a formar la identidad de la misma y a su organizaci&oacute;n interna, de modo de coordinar las acciones que se tomar&aacute;n en el futuro. Esta ser&aacute; una etapa de discusi&oacute;n y decisi&oacute;n, m&aacute;s que de acci&oacute;n. Definiremos en qu&eacute; &aacute;reas trabajar, con cu&aacute;les herramientas, definiremos la estructura de la comunidad y generaremos materiales que puedan servir de introducci&oacute;n para futuros miembros y de organizaci&oacute;n interna para los miembros actuales.</p>\n<p>Una segunda etapa ser&aacute; la de planificar la ejecuci&oacute;n de las &aacute;reas de trabajo acordadas en la etapa previa. Cada una de estas actividades estar&aacute; enmarcada en una de las l&iacute;neas de acci&oacute;n del plan estrat&eacute;gico de la comunidad.</p>\n<p>En una tercera etapa se buscar&aacute; generar v&iacute;nculos s&oacute;lidos con distintos actores del sistema de salud, ya sea por convenio, como con participaci&oacute;n en las actividades de la comunidad. Lo que buscamos es proponer ideas, definir l&iacute;neas de acci&oacute;n y ayudar a que puedan implementarse, buscando la adopci&oacute;n de openEHR de forma amplia, y en colaboraci&oacute;n con otras sociedades o comunidades, y en complementa con los est&aacute;ndares disponibles. Tambi&eacute;n se buscar&aacute; vinculaci&oacute;n entre los actores, por ejemplo mediante una bolsa de trabajo, buscando fomentar la investigaci&oacute;n y desarrollo de sistemas de informaci&oacute;n en salud basados en openEHR.</p>\n<p>&nbsp;</p>\n<h1>Financiaci&oacute;n</h1>\n<p>En este momento no tenemos del todo claro qu&eacute; recursos necesitaremos para funcionar correctamente como comunidad ni c&oacute;mo obtenerlos, lo que si sabemos es que en el futuro la financiaci&oacute;n ser&aacute; lo que permita a la comunidad trabajar y aportar en distintas &aacute;reas de la Inform&aacute;tica M&eacute;dica.<br /><br /><strong>&iquest;Porqu&eacute; no cobrar una membres&iacute;a?</strong><br /><br />Esta comunidad no est&aacute; orientada a tener una membres&iacute;a paga como otras organizaciones, debemos buscar mecanismos de financiaci&oacute;n que nos permitan realizar nuestras tareas y proyectos sin problemas.<br /><br />Con esto buscamos sortear el problema de otras organizaciones que mientras sus miembros pagan la membres&iacute;a no obtienen nada de valor a cambio, solo el t&iacute;tulo de miembro. Nosotros, por el contrario, buscamos realizar actividades que agreguen valor a la vida profesional de cada uno de nuestros miembros. En este sentido, buscaremos organizar actividades pagas que realmente les interesen y agreguen valor, y parte de lo recaudado ser&aacute; reinvertido en la comunidad, por ejemplo en organizar m&aacute;s actividades (libres y pagas).<br /><br />Con esto buscamos un enfoque sustentable a largo plazo para la comunidad, y formaci&oacute;n constante para nuestros miembros.<br /><br /><strong>&Aacute;reas que necesitan financiaci&oacute;n</strong><br /><br />En un principio las &aacute;reas que necesitan financiaci&oacute;n son las de infraestructura y administraci&oacute;n del portal y dem&aacute;s herramientas web de la comunidad. Actualmente, la financiaci&oacute;n inicial para estas &aacute;reas surgi&oacute; del aporte voluntario de un porcentaje de los pagos recibidos por el dictado del <a href=\\\"http://achisa.org/index.php?option=com_content&amp;view=article&amp;id=116:openehr2&amp;catid=38:actividades\\\" target=\\\"_blank\\\">curso de openEHR en espa&ntilde;ol</a>.<br />En el futuro se seguir&aacute; apuntando a que un porcentaje del financiamiento que necesitamos para funcionar provenga de &eacute;ste y otros cursos que surjan desde y para la comunidad. Tambi&eacute;n se buscar&aacute;n medios complementarios de financiamiento.<br />El trabajo de poblar inicialmente el portal de la comunidad con contenido ha sido trabajo donado por <a href=\\\"http://www.linkedin.com/in/pablopazosgutierrez\\\" target=\\\"_blank\\\">Pablo Pazos</a>. La donaci&oacute;n de tiempo de trabajo es otra forma de financiar la comunidad.<br /><br />Otras &aacute;reas que podr&aacute;n necesitar financiamiento en el futuro son las de:</p>\n<ul>\n<li>desarrollo de software</li>\n<li>licenciamiento de software</li>\n<li>dise&ntilde;o gr&aacute;fico y web</li>\n<li>elaboraci&oacute;n de materiales</li>\n<li>impresi&oacute;n de materiales</li>\n<li>env&iacute;o de materiales impresos por correo</li>\n<li>organizaci&oacute;n de eventos presenciales</li>\n<li>y otros.</li>\n</ul>\n<p>En el futuro seguramente habr&aacute;n m&aacute;s &aacute;reas que necesiten financiaci&oacute;n para poder desarrollarse correctamente.<br /><br /><strong>Formas de financiamiento</strong><br /><br />Algunas formas de financiaci&oacute;n pueden ser:</p>\n<ul>\n<li>Cursos</li>\n<li>Materiales (ebooks, whitepapers, gu&iacute;as, manuales)</li>\n<li>Donaciones (dinero, horas de trabajo)</li>\n<li>Auspiciantes en el portal</li>\n<li>Merchandising (tazas, remeras, gorros)</li>\n<li>Eventos</li>\n<li>y otros</li>\n</ul>', 'HtmlModule', 0),
(18, '<p>Aqu&iacute; se publicar&aacute;n recursos &uacute;tiles para mejorar la comunicaci&oacute;n de la comunidad con el resto de los actores del sistema sanitario, y definir nuestra identidad como comunidad profesional.<br />&nbsp;</p>\n<h1>Logos y colores</h1>\n<p>Las siguientes im&aacute;genes son los logotipos e isotipos oficiales de la comunidad de openEHR en espa&ntilde;ol. Los mismos podr&aacute;n ser utilizados en documentos, trabajos, presentaciones, proyectos y otras formas de doucmentaci&oacute;n escrita que representen formalmente a la comunidad. <span style=\\\"text-decoration: underline;\\\">Tambi&eacute;n podr&aacute;n ser utilizadas por terceros con previa autorizaci&oacute;n del Consejo Directivo</span>.</p>\n<p>Colores oficiales:</p>\n<table border=\\\"1\\\" cellspacing=\\\"0\\\" cellpadding=\\\"5\\\">\n<tbody>\n<tr><th>&nbsp;</th><th>color</th><th>hexadecimal</th><th>RGB</th></tr>\n<tr>\n<td>fondo</td>\n<td>azul</td>\n<td>#23337E</td>\n<td>35, 51, 126</td>\n</tr>\n<tr>\n<td>frente</td>\n<td>blanco</td>\n<td>#FFFFFF</td>\n<td>255, 255, 255</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo_big.png\\\" border=\\\"0\\\" /></p>\n<p><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo_mid.png\\\" border=\\\"0\\\" /></p>\n<p><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo.png\\\" border=\\\"0\\\" /></p>\n<p><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></p>\n<p><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/openehr-paloma-big.png\\\" border=\\\"0\\\" /></p>\n<p><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/pidgeon.png\\\" border=\\\"0\\\" /></p>\n<p>&nbsp;</p>\n<h1>Redes sociales</h1>\n<p>Twitter:<br /> <a class=\\\"twitter-follow-button\\\" href=\\\"https://twitter.com/openehr_org_es\\\" data-show-count=\\\"false\\\" data-lang=\\\"es\\\" data-size=\\\"large\\\">Seguir a @openehr_org_es</a>\n<script type=\\\"text/javascript\\\">// <![CDATA[\n!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0];if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=\\\"//platform.twitter.com/widgets.js\\\";fjs.parentNode.insertBefore(js,fjs);}}(document,\\\"script\\\",\\\"twitter-wjs\\\");\n// ]]></script>\n</p>\n<p>LinkedIn:<br /> <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></p>\n<p>Facebook:<br /> <a href=\\\"http://www.facebook.com/openEHR\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></p>\n<p>&nbsp;</p>\n<h1>Reglas, manuales y gu&iacute;as</h1>\n<p>En <a href=\\\"http://openehr.org.es/cms2/cms/displayPage?pageId=10\\\">esta p&aacute;gina</a> se publicar&aacute;n las gu&iacute;as de uso de los medios de difusi&oacute;n como redes sociales, foros y otros, adem&aacute;s de manuales y reglamentos que deben cumplirse para las comunicaciones oficiales de la comunidad.</p>\n<p>&nbsp;</p>', 'HtmlModule', 0),
(21, '<h2><strong id=\"internal-source-marker_0.26890715560875833\">Denominaci&oacute;n:</strong></h2>\n<p>openEHR en espa&ntilde;ol es una comunidad de profesionales y estudiantes con el inter&eacute;s com&uacute;n en la aplicaci&oacute;n de las Tecnolog&iacute;as de la Informaci&oacute;n y Comunicaci&oacute;n en el &aacute;rea de la salud, y del uso de est&aacute;ndares en Inform&aacute;tica M&eacute;dica enfoc&aacute;ndonos en el est&aacute;ndar openEHR.</p>\n<h2><strong id=\"internal-source-marker_0.26890715560875833\">Prop&oacute;sito:</strong></h2>\n<p>Esta comunidad se centrar&aacute; en la mejora de los sistemas de informaci&oacute;n en salud, a trav&eacute;s de la aplicaci&oacute;n de est&aacute;ndares, centr&aacute;ndose en la capacitaci&oacute;n, aplicaci&oacute;n y difusi&oacute;n de openEHR. Sus miembros ser&aacute;n profesionales de todas las &aacute;reas de la inform&aacute;tica y la atenci&oacute;n sanitaria, adem&aacute;s de estudiantes de estas &aacute;reas. Profesionales de otras &aacute;reas tambi&eacute;n podr&aacute;n formar parte de la comunidad.</p>\n<h2><strong id=\"internal-source-marker_0.26890715560875833\">Consejo directivo:</strong></h2>\n<p>El consejo directivo est&aacute; formado por profesionales que se han destacado en la promoci&oacute;n, investigaci&oacute;n, capacitaci&oacute;n, desarrollo, o adopci&oacute;n del est&aacute;ndar openEHR. Su elecci&oacute;n est&aacute; basada en sus m&eacute;ritos, no es un consejo pol&iacute;tico, es un consejo de organizaci&oacute;n, coordinaci&oacute;n y acci&oacute;n. Estar&aacute; conformado por una cantidad de miembros a definir, buscando representatividad de todos los pa&iacute;ses de habla hispana.</p>\n<h2><strong>Membres&iacute;a:</strong></h2>\n<p>Cualquier persona puede ser miembro de la comunidad. Las membres&iacute;as se clasifican en tipos, cada uno de &eacute;stos con deberes, derechos y reconocimientos diferentes. La modificaci&oacute;n del tipo de membres&iacute;a debe ser aprobada por el Consejo Directivo.&nbsp;<a href=\"http://openehr.org.es/cms2/cms/displayPageRO?pageId=11\">Clic aqu&iacute; por m&aacute;s informaci&oacute;n</a>.</p>\n<h2><strong id=\"internal-source-marker_0.26890715560875833\">Inclusi&oacute;n:<br /></strong></h2>\n<p>Esta comunidad ser&aacute; inclusiva en todos sus aspectos, aunque apunte a un p&uacute;blico de habla hispana, los colegas de pa&iacute;ses no hispano-parlantes podr&aacute;n participar de la comunidad. Del mismo modo que no se restringe el acceso discriminando por el idioma, tampoco se discriminar&aacute; seg&uacute;n raza, sexo, religi&oacute;n o cualquier otro factor.</p>\n<h2>Colaboraci&oacute;n:</h2>\n<p>Si bien esta comunidad est&aacute; centrada en la investigaci&oacute;n, desarrollo y difusi&oacute;n de openEHR como est&aacute;ndar para dise&ntilde;ar sistemas interoperables de Historia Cl&iacute;nica Electr&oacute;nica, se fomentar&aacute; la colaboraci&oacute;n con otras comunidades que se centren en est&aacute;ndares complementarios como CEN/ISO 13606, HL7, DICOM, ASTM CCR, etc.</p>\n<h2>Representaci&oacute;n local:</h2>\n<p>Esta comunidad nuclea a profesionales de habla hispana de distintos pa&iacute;ses, y en el caso de que un pa&iacute;s requiera crear una representaci&oacute;n local de openEHR, esta comunidad servir&aacute; como base de lanzamiento de dichas comunidades locales y apoyar&aacute; en los aspectos que sean necesarios como capacitaci&oacute;n, coordinaci&oacute;n de proyectos, asesor&iacute;a, elaboraci&oacute;n de materiales, etc.</p>', 'HtmlModule', 0),
(22, '<p>&nbsp;</p>\n<p>Nuestra comunidad est&aacute; compuesta por un <strong>Consejo Directivo</strong> (CD), cuyos integrantes son <strong>miembros del N&uacute;cleo</strong> de la comunidad (N). El CD es responsable de la direcci&oacute;n estrat&eacute;gica, organizaci&oacute;n y coordinaci&oacute;n de la comunidad en pos de alcanzar sus objetivos.</p>\n<p>La comunidad est&aacute; compuesta por <strong>miembros individuales</strong> y por <strong>Grupos de Trabajo</strong> (G). Los miembros individuales pueden ser: de <strong>N&uacute;cleo (N)</strong>, <strong>Colaboradores (C)</strong> o <strong>Exploradores (E)</strong>.</p>\n<p>Los Grupos de Trabajo tienen como responsable a un miembro de N&uacute;cleo, o a un Colaborador abalado por el CD. Los integrantes de los Grupos de trabajo pueden ser miembros de N&uacute;cleo, Colaboradores o Exploradores. El responsable del grupo es quien organiza y coordina el funcionamiento interno de cada Grupo de Trabajo.</p>\n<p>En el siguiente diagrama se muestra la estructura general de nuestra comunidad:</p>\n<p align=\\\"center\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/openehr_es_estructura.png\\\" border=\\\"0\\\" alt=\\\"Estructura de la comunidad\\\" /></p>', 'HtmlModule', 0);
INSERT INTO `cms_html_module` (`id`, `content`, `class`, `deleted`) VALUES
(23, '<h1>Hoja de hechos</h1>\n<p>En esta secci&oacute;n se incluyen informaciones puntuales sobre openEHR que facilitan su comprensi&oacute;n y difusi&oacute;n.<br />&nbsp;</p>\n<h2><strong>&iquest;Qu&eacute; es openEHR?</strong></h2>\n<ul>\n<li>openEHR es un est&aacute;ndar abierto: generado, mantenido, probado, validado y accesible por una comunidad internacional de profesionales, tanto del &aacute;rea m&eacute;dica como del &aacute;rea inform&aacute;tica.<br />&nbsp;</li>\n<li>openEHR es un est&aacute;ndar, formado por especificaciones formales.<br />&nbsp;</li>\n<li>openEHR especifica una arquitectura para sistemas de informaci&oacute;n en salud.<br />&nbsp;</li>\n<li>La arquitectura propuesta por openEHR tiene en consideraci&oacute;n aspectos de estandarizaci&oacute;n de la informaci&oacute;n, del conocimiento, de los componentes del sistema, y de los servicios provistos por dichos componentes.<br />&nbsp;</li>\n<li>openEHR propone crear sistemas normalizados, flexibles a nuevos requerimientos, facilmente modificables, econ&oacute;micamente viables a largo plazo, durables en el tiempo.<br />&nbsp;</li>\n<li>openEHR permite la independencia de tecnolog&iacute;as y proveedores, pudiendo ser implementado, y actualmente lo es, en diversas tecnolog&iacute;as.<br />&nbsp;</li>\n<li>openEHR busca la longitudinalidad de la informaci&oacute;n cl&iacute;nica (que acompa&ntilde;e al paciente durante toda su vida) y la transversalidad entre distintos actores del sistema sanitario (informaci&oacute;n estandarizada capaz de ser compartida para evitar la fragmentaci&oacute;n del registro cl&iacute;nico).<br />&nbsp;</li>\n<li>openEHR propone la Historia Cl&iacute;nica Electr&oacute;nica virtual, capaz de permitir el acceso homog&eacute;neo a toda la informaci&oacute;n cl&iacute;nica de cualquier paciente, de forma independiente a la instituci&oacute;n sanitaria, hospital, cl&iacute;nica, etc. donde se haya generado dicha informaci&oacute;n.<br />&nbsp;</li>\n<li>openEHR propone mejorar el proceso de desarrollo de los sistemas de informaci&oacute;n en salud, orient&aacute;ndolo a la gesti&oacute;n del conocimiento cl&iacute;nicos por parte de expertos del dominio (no inform&aacute;ticos).</li>\n</ul>\n<p>&nbsp;</p>\n<h2><strong>&iquest;Qu&eacute; NO es openEHR?</strong></h2>\n<ul>\n<li>openEHR NO es un sistema/software, es un est&aacute;ndar, un conjunto de especificaciones y gu&iacute;as que sirven para construir sistemas de forma estandarizada.<br />&nbsp;</li>\n<li>openEHR NO es un est&aacute;ndar para mensajer&iacute;a de datos cl&iacute;nicos entre sistemas inform&aacute;ticos.<br />&nbsp;</li>\n<li>openEHR NO es comparable con HL7, son est&aacute;ndares complementarios que resuelven problemas distintos.</li>\n</ul>\n<p>&nbsp;</p>\n<!-- lecturas recomendadas -->\n<h2>Lecturas recomendadas:</h2>\n<div id=\\\"lecturas_recomendadas\\\">\n<p><a href=\\\"http://informatica-medica.blogspot.com/2010/10/openehr-el-estandar-abierto-para.html\\\" target=\\\"_blank\\\">Introducci&oacute;n a openEHR</a> (espa&ntilde;ol)</p>\n<p><a href=\\\"http://www.openehr.org:8888/es-cl/201-OE.html\\\" target=\\\"_blank\\\">Plataforma computacional de salud openEHR</a> (espa&ntilde;ol)</p>\n<p><a href=\\\"http://www.sbis.org.br/cbis11/arquivos/947.pdf\\\" target=\\\"_blank\\\">Construcci&oacute;n de aplicaciones en salud basadas en arquetipos openEHR</a> (portugues)</p>\n<p><a href=\\\"http://omowizard.wordpress.com/2010/01/11/standardized-data-driven-ehrs/\\\" target=\\\"_blank\\\">e-Salud basada en datos estandarizados</a> (ingles)</p>\n<p><a href=\\\"http://omowizard.wordpress.com/2012/01/15/clinical-knowledge-repository-requirements/\\\" target=\\\"_blank\\\">Requerimientos para un repositorio de conocimiento cl&iacute;nico</a> (ingles)</p>\n<p><a href=\\\"http://omowizard.wordpress.com/2011/02/18/anatomy-of-an-archetype/\\\" target=\\\"_blank\\\">Anatom&iacute;a de un arquetipo</a> (ingles)</p>\n<p><a href=\\\"http://omowizard.wordpress.com/2012/03/12/preserving-health-data-integrity/\\\" target=\\\"_blank\\\">Preservando la integridad de datos en salud</a> (ingles)</p>\n<p><a href=\\\"http://omowizard.wordpress.com/2011/06/01/modelling-pregnancy-2/\\\" target=\\\"_blank\\\">Modelando el registro del embarazo</a> (ingles)</p>\n<p><a href=\\\"http://1schrodingerscat0.wordpress.com/2010/05/21/why-dont-emrs-solve-the-ehr-problem/\\\" target=\\\"_blank\\\">&iquest;Porqu&eacute; los registros cl&iacute;nicos electr&oacute;nicos no resuelven el problema de la historia cl&iacute;nica electr&oacute;nica?</a> (ingles)</p>\n<p><a href=\\\"http://geekdoctor.blogspot.com/2011/02/detailed-clinical-models.html\\\" target=\\\"_blank\\\">Modelos cl&iacute;nicos detallados</a> (ingles)</p>\n<p><a href=\\\"http://wolandscat.net/2011/06/08/dcms-can-they-look-good-and-be-computable/\\\" target=\\\"_blank\\\">Modelos cl&iacute;nicos detallados: &iquest;pueden verse bien y ser computables?</a> (ingles)</p>\n<p><a href=\\\"http://frectal.com/book/healthcare-change-the-way-forward/healthcare-openehr%E2%80%99s-potential-to-handle-complexity-diversity/\\\" target=\\\"_blank\\\">El potencial de openEHR en manejar la complejidad y diversidad en salud</a> (ingles)</p>\n<p><a href=\\\"http://www.healthintersections.com.au/?p=820\\\" target=\\\"_blank\\\">Buenas especificaciones de intercambio: interoperabilidad vs. intraoperabilidad</a> (ingles)</p>\n<p>&nbsp;</p>\n</div>\n<script type=\\\"text/javascript\\\">// <![CDATA[\n;( function() {\n\n  // Quiero todos los P dentro de lecturas recomendadas\n  //$(\\\'p:contains(\\\"ingles\\\")\\\', $(\\\'#lecturas_recomendadas\\\')).css(\\\'border\\\', \\\'1px solid red\\\');\n\n  var ps = $(\\\'p:contains(\\\"ingles\\\")\\\', $(\\\'#lecturas_recomendadas\\\'));\n  var as = $(\\\'a\\\', ps);\n\n  as.each(function(i, a) {\n    //console.log(a.href);\n\n    $(ps[i]).append(\\\' (<a href=\\\"http://translate.google.com/translate?hl=en&sl=en&tl=es&u=\\\'+ encodeURI(a.href) +\\\'\\\" target=\\\"_blank\\\">traducir</a>)\\\');\n  });\n\n  ps = $(\\\'p:contains(\\\"portugues\\\")\\\', $(\\\'#lecturas_recomendadas\\\'));\n  as = $(\\\'a\\\', ps);\n  as.each(function(i, a) {\n\n    $(ps[i]).append(\\\' (<a href=\\\"http://translate.google.com/translate?hl=pt&sl=pt&tl=es&u=\\\'+ encodeURI(a.href) +\\\'\\\" target=\\\"_blank\\\">traducir</a>)\\\');\n  });\n\n})();\n// ]]></script>\n<!-- lecturas recomendadas -->\n<h2>Otros recursos recomendados:</h2>\n<div align=\\\"center\\\">\n<div id=\\\"__ss_10331974\\\" style=\\\"width: 425px;\\\"><strong style=\\\"display: block; margin: 12px 0 4px;\\\"><a title=\\\"Introducci&oacute;n a openEHR en espa&ntilde;ol\\\" href=\\\"http://www.slideshare.net/pablitox/introduccin-a-openehr-en-espaol\\\" target=\\\"_blank\\\">Introducci&oacute;n a openEHR en espa&ntilde;ol</a></strong> <iframe src=\\\"http://www.slideshare.net/slideshow/embed_code/10331974\\\" frameborder=\\\"0\\\" marginwidth=\\\"0\\\" marginheight=\\\"0\\\" scrolling=\\\"no\\\" width=\\\"425\\\" height=\\\"355\\\"></iframe>\n<div style=\\\"padding: 5px 0 12px;\\\">View more <a href=\\\"http://www.slideshare.net/thecroaker/death-by-powerpoint\\\" target=\\\"_blank\\\">PowerPoint</a> from <a href=\\\"http://www.slideshare.net/pablitox\\\" target=\\\"_blank\\\">Pablo Pazos</a></div>\n</div>\n</div>', 'HtmlModule', 0),
(24, '<ul>\n<li><a href=\\\"http://translate.google.com/translate?hl=es&amp;sl=es&amp;tl=en&amp;u=http://openehr.org.es\\\">Translate to english</a></li>\n<li><a href=\\\"http://translate.google.com/translate?hl=es&amp;sl=es&amp;tl=pt&amp;u=http://openehr.org.es\\\">Tradu&ccedil;&atilde;o para portugu&ecirc;s</a></li>\n<li><a href=\\\"http://translate.google.com/translate?hl=es&amp;sl=es&amp;tl=it&amp;u=http://openehr.org.es\\\">Traduzione al italiano</a></li>\n</ul>\n<!--\n<script type=\\\"text/javascript\\\" src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/bootstrap.min.js\\\"></script>\n<script type=\\\"text/javascript\\\" src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/bootstrap-dropdown.js\\\"></script>\n<div class=\\\"btn-group\\\"><button class=\\\"btn\\\">Action</button> <button class=\\\"btn dropdown-toggle\\\" data-toggle=\\\"dropdown\\\"><span class=\\\"caret\\\"></span></button>\n<ul class=\\\"dropdown-menu\\\">\n<li><a href=\\\"#\\\">Action</a></li>\n<li><a href=\\\"#\\\">Another action</a></li>\n<li><a href=\\\"#\\\">Something else here</a></li>\n<li><a href=\\\"#\\\">Separated link</a></li>\n</ul>\n</div>\n<script type=\\\"text/javascript\\\">// <![CDATA[\n  $(document).ready(function () {\n     $(\\\'.btn-group\\\').dropdown();\n  });\n// ]]></script>\n\n-->', 'HtmlModule', 0),
