(30, '<table style=\\\"width: 100%;\\\" border=\\\"1\\\" cellspacing=\\\"0\\\" cellpadding=\\\"5\\\"><caption>Eventos para 2013<br /><br /></caption>\n<thead>\n<tr><th><span>Fecha</span></th><th>Lugar</th><th>Evento</th><th>Informaci&oacute;n</th></tr>\n</thead>\n<tbody>\n<tr>\n<td style=\\\"text-align: center;\\\"><span>8 de Abril - 10 de Junio de 2014</span></td>\n<td><span><span><strong>Online</strong>: Adobe Connect (gentileza del Hospital Italiano de Buenos Aires)</span></span></td>\n<td>\n<p><strong>Curso de openEHR en espa&ntilde;ol&nbsp;</strong>4ta edici&oacute;n</p>\n</td>\n<td>Proximamente...</td>\n</tr>\n<tr>\n<td style=\\\"text-align: center;\\\"><span>4 y 5 de Diciembre de 2013</span></td>\n<td><span><span><strong>Hospital Italiano</strong> de Buenos Aires,&nbsp;<span>Per&oacute;n 4190 - (C1181ACH) CABA, Argentina</span></span></span></td>\n<td><strong>Talleres de openEHR</strong> en las&nbsp;<span>Jornadas de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires</span></td>\n<td><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_seccion.php&amp;id_seccion=15473\\\">http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_seccion.php&amp;id_seccion=15473</a></td>\n</tr>\n<tr>\n<td style=\\\"text-align: center;\\\"><span>8 de Agosto 2013</span></td>\n<td><span><span>Auditorio <strong>Federaci&oacute;n M&eacute;dica de Buenos Aires</strong> (FEMEBA) Av. Belgrano 1225, Buenos Aires, Argentina</span></span></td>\n<td>Historia Cl&iacute;nica Electr&oacute;nica - Experiencias sobre Estandarizaci&oacute;n y Certificaci&oacute;n</td>\n<td>Introducci&oacute;n y taller de openEHR, entre otros temas.</td>\n</tr>\n<tr>\n<td style=\\\"text-align: center;\\\"><span>18 - 20 de Septiembre 2013</span></td>\n<td><span><span><strong>Facultad de Matem&aacute;tica, Astronom&iacute;a y F&iacute;sica</strong> de la Universidad Nacional de C&oacute;rdoba,&nbsp;</span>C&oacute;rdoba, Argentina</span></td>\n<td>Congreso Argentino de Inform&aacute;tica en Salud (CAIS2013)</td>\n<td><a href=\\\"http://www.cais.org.ar/\\\" target=\\\"_blank\\\">http://www.cais.org.ar/</a></td>\n</tr>\n<tr>\n<td style=\\\"text-align: center;\\\">Mayo 2013</td>\n<td>Online</td>\n<td>Curso de openEHR en espa&ntilde;ol, 3era ed.</td>\n<td><a href=\\\"http://informatica-medica.blogspot.com/2013/05/curso-de-openehr-3era-edicion.html\\\">http://informatica-medica.blogspot.com/2013/05/curso-de-openehr-3era-edicion.html</a></td>\n</tr>\n<tr>\n<td style=\\\"text-align: center;\\\">19 de Abril 2013</td>\n<td>Webinar Online desde el Hospital Italiano de Buenos Aires, Buenos Aires, Argentina</td>\n<td>Presentaci&oacute;n de openEHR para cl&iacute;nicos</td>\n<td><a href=\\\"http://www.hospitalitaliano.org.ar/archivos/noticias_archivos/11/Ateneosnews/11_wabr13.html\\\" target=\\\"_blank\\\">M&aacute;s Informaci&oacute;n</a></td>\n</tr>\n</tbody>\n</table>\n<p><br />Si desea publicar un evento relacionado con openEHR o con temas relacionados, por favor escriba a pablo@openehr.org.es</p>', 'HtmlModule', 0);
