INSERT INTO `cms_news_module_news` (`id`, `title`, `text`, `link`, `creationDate`, `class`, `deleted`) VALUES
(1, 'Estrenando portal', '<p>Con este portal comenzamos un nuevo viaje en busca de una atenci&oacute;n sanitaria de calidad y para todos.</p>\n<p>Vamos de la mano, juntos, adelante, para que la Historia Cl&iacute;nica Electr&oacute;nica sea una realidad en todos los pa&iacute;ses de Iberoam&eacute;rica, sea cual sea la ubicaci&oacute;n geogr&aacute;fica, y el estado socio-econ&oacute;mico de las persoas.</p>\n<p>Es un camino largo, pero si lo recorremos juntos se har&aacute; m&aacute;s leve. Nuestro lema: \\\"<em>trabajando juntos por una mejor salud para todos</em>\\\".</p>', '', '2012-03-11 03:13:18', 'News', 0),
(2, 'Curso de openEHR en espaÃ±ol: inscripciones abiertas', '<span>El objetivo es introducir los principales conceptos del est&aacute;ndar openEHR para el desarrollo de sistemas de informaci&oacute;n en salud, sobre todo de lo que es Historia Cl&iacute;nica Electr&oacute;nica, de forma estandarizada, interoperable, de bajo costo y durable a largo plazo (factores no menores en tiempos de crisis).</span><br /><br /><span>En complemento a los temas te&oacute;ricos incluimos pruebas de herramientas y trabajos pr&aacute;cticos, para que puedan aplicar en sus proyectos y/o instituciones sanitarias.</span>', 'http://informatica-medica.blogspot.com/2012/03/curso-de-openehr-en-espanol.html', '2012-03-19 22:35:15', 'News', 0),
(3, 'Charla: Construyendo la comunidad de openEHR en espaÃ±ol', '<span>El pr&oacute;ximo 13 de junio 2012, ACHISA los invita a participar de la charla informativa virtual \\\"</span><strong><em>Construyendo una comunidad de openEHR en espa&ntilde;ol\\\"</em></strong><span>, abierta a todos los interesados.</span>', 'http://informatica-medica.blogspot.com/2012/06/charla-construyendo-la-comunidad-de.html', '2012-06-06 19:45:50', 'News', 0),
(4, 'PrÃ³xima ediciÃ³n del curso de openEHR en espaÃ±ol', 'Abrimos la lista de espera para la pr&oacute;xima edici&oacute;n del curso, haz clic en \\\"ver m&aacute;s\\\" e ingresa tus datos. Te contactaremos cuando se abran las inscripciones.', 'http://openehr.org.es/curso', '2012-06-18 20:38:29', 'News', 0),
(5, 'Llamado a editores de contenido clÃ­nico', 'Es una excelente oportunidad para que profesionales o estudiantes de la salud de nuestra regi&oacute;n se acerquen al modelado cl&iacute;nico, aprendan nuevas metodolog&iacute;as y dominen las herramientas. <a title=\\\"listas de correo de openEHR\\\" href=\\\"http://www.openehr.org/community/mailinglists.html\\\" target=\\\"_blank\\\">Aqu&iacute;</a> se pueden suscribir a la lista y contestar a la propuesta.', 'http://lists.openehr.org/pipermail/openehr-clinical_lists.openehr.org/2012-July/002608.html', '2012-07-09 15:41:04', 'News', 0),
(6, 'Nuevo openEHR ADL Workbench', 'Se ha liberado una nueva versi&oacute;n beta del ADL Workbench que pueden descargar <a href=\\\"http://www.openehr.org/svn/ref_impl_eiffel/TRUNK/apps/adl_workbench/doc/web/index.html\\\" target=\\\"_blank\\\">aqu&iacute;</a>, tambi&eacute;n se han incluido video-tutoriales en youtube que pueden ver <a href=\\\"http://www.youtube.com/watch?v=Jhnbamg7bAA\\\" target=\\\"_blank\\\">aqu&iacute;</a>.', 'http://www.openehr.org/svn/ref_impl_eiffel/TRUNK/apps/adl_workbench/doc/web/index.html', '2012-08-06 14:26:50', 'News', 0),
(7, 'Todo un dÃ­a de talleres de openEHR', 'El d&iacute;a jueves 30 de agosto tendremos una jornada de talleres de openEHR en el CAIS 2012.', 'http://www.cais.org.ar/?q=node/17', '2012-08-24 23:53:29', 'News', 0),
(8, 'openEHR en Jornadas Universitarias HIBA 2012', 'El jueves 29 de noviembre en las Jornadas Universitarias del Hospital Italiano de Buenos Aires, tendremos una mesa redonda organizada por HL7 Argentina. El tema: openEHR y HL7, est&aacute;ndares complementarios.', 'http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=noticias_subcategoria.php&id_categoria=105&id_subcategoria=86', '2012-11-09 02:27:48', 'News', 0),
(9, 'Nuevo sitio de openEHR', '<span>openEHR Foundation, como parte de su estrategia de difusi&oacute;n, ha relanzado su portal web:&nbsp;</span><a href=\\\"http://www.openehr.org/\\\" rel=\\\"nofollow nofollow\\\" target=\\\"_blank\\\">www.openehr.org</a><br /><br /><span>Buscamos colaboradores para ayudarnos a traducir contenidos y recursos del sitio a espa&ntilde;ol y a coordinar con los contenido</span><span class=\\\"text_exposed_show\\\">s del sitio de la comunidad en espa&ntilde;ol&nbsp;<a href=\\\"http://www.facebook.com/l.php?u=http%3A%2F%2Fwww.openehr.org.es&amp;h=EAQHymiDo&amp;s=1\\\" rel=\\\"nofollow nofollow\\\" target=\\\"_blank\\\">www.openehr.org.es</a></span>', 'http://www.facebook.com/openEHR', '2012-12-28 14:18:53', 'News', 0),
(10, 'Guideline Definition Language (GDL)', '<span>Nueva especificaci&oacute;n openEHR&nbsp;</span><span>Guideline Definition Language (GDL) disponible online.</span>', 'http://www.openehr.org/news_events/releases/20130311', '2013-03-22 02:29:07', 'News', 0),
(11, 'Charla de openEHR para mÃ©dicos', '<span>Viernes 19 de Abril, 14 horas, desde el Hospital Italiano de Buenos Aires, con acceso online.<br /><br /><strong>Objetivos<br /></strong><br /><span>Lograr una comprensi&oacute;n cabal de la plataforma inform&aacute;tica para salud que propone openEHR, de las especificaciones del est&aacute;ndar (modelo de informaci&oacute;n, modelo de arquetipos, modelo de plantillas), del proceso de gesti&oacute;n del conocimiento (definici&oacute;n y gesti&oacute;n de conceptos cl&iacute;nicos utilizando arquetipos), de c&oacute;mo se vinculan los arquetipos con distintas terminolog&iacute;as est&aacute;ndar y servicios terminol&oacute;gicos, y de las herramientas disponibles para trabajar con openEHR desde el punto de vista cl&iacute;nico</span><br /></span>', 'http://www.hospitalitaliano.org.ar/archivos/noticias_archivos/11/Ateneosnews/11_wabr13.html', '2013-04-17 17:23:10', 'News', 0),
(12, 'Congreso Argentino de InformÃ¡tica en Salud 2013', '<span>Por cuarto a&ntilde;o consecutivo, el CAIS se realiza en el seno de las 42&deg; Jornadas Argentinas de Inform&aacute;tica (JAIIO),&nbsp;</span><strong>C&oacute;rdoba entre los d&iacute;as 18 y 20 de septiembre del 2013.</strong>', 'http://informatica-medica.blogspot.com/2013/04/congreso-argentino-de-informatica-en.html', '2013-04-25 21:25:58', 'News', 0),
(13, 'Curso de openEHR en espaÃ±ol 3era ed.', 'Objetivos, modalidad, temas, cronograma y dem&aacute;s, todo en el link.', 'http://informatica-medica.blogspot.com/2013/05/curso-de-openehr-3era-edicion.html', '2013-05-21 02:16:32', 'News', 0),
(14, 'EHRServer: repositorio clÃ­nico openEHR', '<span>Hicimos una demostraci&oacute;n de un servidor cl&iacute;nico openEHR, mostrando la facilidad de uso y sus posibles aplicaciones, les presento a EHRServer.</span>\n<div>&nbsp;</div>\n<div>Es un proyecto open source que busca posicionarse como repositorio cl&iacute;nico, comenzando con documentos cl&iacute;nicos openEHR, luego iremos por HL7 CDA y CEN/ISO 13606.</div>\n<div>&nbsp;</div>\n<div>Aqu&iacute; les dejo la charla:&nbsp;<a href=\\\"http://www.youtube.com/watch?v=08vAk15utss&amp;feature=youtu.be\\\" rel=\\\"nofollow\\\" target=\\\"welcomeMsg\\\">http://www.youtube.com/watch?v=08vAk15utss&amp;feature=youtu.be</a></div>\n<div>&nbsp;</div>\n<div>El evento:&nbsp;<a href=\\\"https://plus.google.com/u/0/events/cnjq4f1q9u5ccd22htmpf822kh4\\\" rel=\\\"nofollow\\\" target=\\\"welcomeMsg\\\">https://plus.google.com/u/0/events/cnjq4f1q9u5ccd22htmpf822kh4</a></div>', '', '2013-09-21 02:52:41', 'News', 0),
(15, 'Talleres de openEHR en Buenos Aires', 'Talleres de openEHR en las Jornadas de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires<br /><br />\n<div>\n<div><strong>Mi&eacute;rcoles 4 de diciembre: Taller de Modelado Cl&iacute;nico con openEHR</strong><br /><strong>Jueves 5 de diciembre: Taller de Implementaci&oacute;n de openEHR</strong></div>\n</div>\n<div><span>&nbsp;</span></div>\n<div>\n<div>1. Taller de Modelado Cl&iacute;nico openEHR</div>\n<div>\n<ul>\n<li>Introducci&oacute;n a openEHR</li>\n<li>An&aacute;lisis y clasificaci&oacute;n de registros cl&iacute;nicos existentes</li>\n<li>B&uacute;squeda de conceptos cl&iacute;nicos en el Clinical Knowledge Manager (CKM)</li>\n<li>Modelado de conceptos cl&iacute;nicos con Arquetipos utilizando el Archetype Editor</li>\n<li>Vinculaci&oacute;n con terminolog&iacute;as cl&iacute;nicas</li>\n<li>Modelado de registros cl&iacute;nicos con Templates openEHR utilizando el Template Designer</li>\n</ul>\n</div>\n<div>&nbsp;</div>\n<div>2. Taller de Implementaci&oacute;n de openEHR</div>\n<div>\n<ul>\n<li>Introducci&oacute;n a la implementaci&oacute;n de openEHR en herramientas de software concretas</li>\n<li>EHRGen: registro cl&iacute;nico electr&oacute;nico openEHR</li>\n<li>EHRServer: servidor compartido de registros cl&iacute;nicos openEHR</li>\n<li>Conceptos sobre utilizaci&oacute;n de informaci&oacute;n cl&iacute;nica estandarizada con openEHR (CDS, Clinical Dashboards, Analytics, Business Intelligence, etc.)</li>\n</ul>\n</div>\n</div>', 'http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_seccion.php&id_seccion=15473', '2013-11-20 02:15:42', 'News', 0),
(16, 'Congreso INFOLAC 2014', '<span>Este a&ntilde;o el congreso ser&aacute; en Montevideo, Uruguay. Los invito a preparar sus trabajos sobre openEHR para presentar en el congreso, y quedamos a disposici&oacute;n para ayudar, aportar o revisar trabajos.</span><br /><br /><span>Desde la comunidad, nos interesa poder presentar trabajos relacionados con openEHR en distintas &aacute;reas: implementaci&oacute;n de sistemas, uso de arquetipos, almacenamiento de datos openEHR, an&aacute;lisis de datos openEHR, comunicaci&oacute;n de datos openEHR, integraci&oacute;n de sistemas usando openEHR y otros temas relacionados.</span>', 'http://www.infolac2014.org', '2014-01-27 00:08:46', 'News', 0),
(17, 'Estamos traduciendo el sitio oficial de openEHR', 'Pronto estar&aacute; 100% disponible en espa&ntilde;ol. Este es otro esfuerzo de nuestra comunidad, esperamos que puedan aprovecharlo.', 'http://www-test.openehr.org/es/home', '2014-03-12 00:44:33', 'News', 0),
