(29, 'Curso de ImplementaciÃ³n de Sistemas de InformaciÃ³n en Salud con el estÃ¡ndar openEHR', '<span style=\\\"font-family: inherit;\\\"><span style=\\\"font-family: inherit;\\\"><strong>Curso Profesional + openEHR Hack Day</strong><br /><br />Del 5 al 9 de&nbsp;<span style=\\\"font-family: inherit;\\\" data-blogger-escaped-style=\\\"font-family: inherit;\\\"><span style=\\\"font-family: inherit;\\\" data-blogger-escaped-style=\\\"font-family: inherit;\\\"><span style=\\\"font-family: inherit;\\\">Septiembre</span></span></span> de 2016 - Santiago, Chile - Presencial<br /><br /><span style=\\\"font-family: inherit;\\\">Se brindar&aacute;n 4 d&iacute;as de curso super-intensivo, con orientaci&oacute;n pr&aacute;ctica, y un openEHR <span style=\\\"font-family: inherit;\\\">H</span>ack <span style=\\\"font-family: inherit;\\\">D</span>ay (taller de implementaci&oacute;n donde crearemos aplicaciones cl&iacute;nicas usando openEHR y herramientas de c&oacute;digo abierto). Este es el primer curso de openEHR enfocado 100% en la implementaci&oacute;n.</span><br /></span></span>', 'http://informatica-medica.blogspot.com.uy/2016/07/primer-curso-presencial-de.html', '2016-07-31 00:28:34', 'News', 0),
