(31, 'Curso de DiseÃ±o e ImplementaciÃ³n de Bases de Datos ClÃ­nicas con openEHR', 'Abrimos las inscripciones al Curso de Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR 3era ed,<br /><br />Para empresas y desarrolladores de sistemas de informaci&oacute;n en salud que busquen crear o mejorar sus repositorios cl&iacute;nicos, para lograr sistemas escalables, interoperables y basados en est&aacute;ndares internacionales.', 'http://informatica-medica.blogspot.com.uy/2017/03/diseno-e-implementacion-de-bases-de.html', '2017-03-18 13:30:04', 'News', 0),
