(36, 'Workshop de Interoperabilidad con Mirth Connect', '<span>Esta semana cierran las inscripciones al Workshop de Interoperabilidad con Mirth Connect: &iexcl;no te quedes afuera!</span><br /><br /><span>Inscr&iacute;bete a la nueva edici&oacute;n del Workshop de Interoperabilidad con Mirth Connect y HL7 de ACHISA y CaboLabs. Actualizado a la &uacute;ltima versi&oacute;n de Mirth Connect (3.5.2). Es 100% online y pr&aacute;ctico, los cupos son limitados.</span><br /><br /><span>Se recibir&aacute;n inscripciones hasta el 13 de Mayo de 2018.</span><br /><br /><span>Consultas: </span><a href=\"mailto:info@cabolabs.com\" rel=\"nofollow\" target=\"_blank\">info@cabolabs.com</a>', 'https://www.achisa.cl/2018/05/08/workshop-de-interoperabilidad-con-mirth-connect-y-hl7-5a-ed/', '2018-05-08 02:12:44', 'News', 0),
(37, 'Workshop de DiseÃ±o e ImplementaciÃ³n de Documentos ClÃ­nicos HL7 CDA', 'Del 28 de Mayo al 17 de Junio de 2018. Organizan ACHISA y CaboLabs.<br /><br />Abrimos las inscripciones a la cuarta edici&oacute;n online del Workshop de dise&ntilde;o e implementaci&oacute;n de documentos cl&iacute;nicos HL7 CDA. Se recibir&aacute;n inscripciones hasta el 27 de Mayo de 2018.', 'https://www.achisa.cl/2018/05/16/workshop-de-diseno-e-implementacion-de-documentos-clinicos-hl7-cda-4a-ed/', '2018-05-16 20:06:54', 'News', 0),
(38, 'Nuevos cursos y workshops de informÃ¡tica en salud', 'Pr&oacute;ximamente abriremos nuevas ediciones de nuestros cursos y workshops de inform&aacute;tica en salud, est&aacute;ndares e interoperabilidad. Para recibir notificaciones de cada curso, reg&iacute;strate en nuestras listas de espera.', 'https://www.cabolabs.com/es/educacion', '2018-07-13 02:24:23', 'News', 0),
(39, 'Curso de Modelado de InformaciÃ³n ClÃ­nica con Arquetipos y Plantillas openEHR 1a ed.', 'Del 13 de Agosto al 9 de Septiembre de 2018. Abrimos las inscripciones a la primera edici&oacute;n online del Curso de Modelado de Informaci&oacute;n Cl&iacute;nica con Arquetipos openEHR. Se recibir&aacute;n inscripciones hasta el 12 de Agosto de 2018.', 'http://informatica-medica.blogspot.com/2018/07/curso-de-modelado-de-informacion-clinica.html', '2018-07-16 03:14:20', 'News', 0),
(40, 'Workshop de Interoperabilidad con Mirth Connect y HL7 6a ed.', '<span style=\"background-color: transparent; color: black; font-family: \'calibri\'; font-size: 11pt; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;\">El objetivo del workshop es ganar experiencia r&aacute;pidamente en el uso del motor de integraci&oacute;n Mirth Connect en distintos escenario de interoperabilidad de informaci&oacute;n en salud, incluyendo casos de intercambio de datos con est&aacute;ndares HL7v2.x, HL7 CDA, DICOM y openEHR.</span>', 'http://informatica-medica.blogspot.com/2018/07/workshop-de-interoperabilidad-con-mirth.html', '2018-07-22 04:04:09', 'News', 0),
(41, 'Importancia del modelado de informaciÃ³n clÃ­nica', 'El modelado de informaci&oacute;n cl&iacute;nica es una tarea central en cualquier proyecto de Inform&aacute;tica en Salud. Este proceso es necesario para determinar qu&eacute; informaci&oacute;n ser&aacute; gestionada por los sistemas, y c&oacute;mo esta informaci&oacute;n ser&aacute; almacenada, procesada, visualizada, utilizada, compartida, e integrada, en una arquitectura de sistemas hospitalarios.', 'http://informatica-medica.blogspot.com/2018/07/modelado-de-informacion-clinica.html', '2018-07-28 19:45:17', 'News', 0),
(42, 'Curso de Interoperabilidad entre Sistemas de InformaciÃ³n en Salud - INSCRIPCIONES ABIERTAS', '<h3>Objetivos del curso</h3>\n<ul>\n<li>Conocer protocolos de comunicaci&oacute;n (TCP, MLLP, HTTP, SOAP), formatos de mensajes (JSON, XML, HL7 v2.x) y est&aacute;ndares (HL7, DICOM, openEHR).</li>\n<li>Aprender a utilizar las herramientas y tecnolog&iacute;as de implementaci&oacute;n (HAPI, PACS DCM4CHEE, EHRServer).</li>\n<li>Adquirir conocimientos pr&aacute;cticos en comunicaci&oacute;n de datos cl&iacute;nicos e integraci&oacute;n de sistemas en ambientes sanitarios.</li>\n</ul>', 'http://informatica-medica.blogspot.com/2018/09/curso-de-interoperabilidad-entre.html', '2018-09-21 02:40:42', 'News', 0),
(43, 'IV Curso DiseÃ±o e ImplementaciÃ³n de Bases de Datos ClÃ­nicas con openEHR', 'Desde el <strong>26 de Noviembre de 2018</strong> al <strong>6 de Enero de 2019</strong> (6 semanas)<br /><br />\n<h3>Objetivos del curso</h3>\n<ul>\n<li>Conocer los requerimientos particulares de las bases de datos cl&iacute;nicas.</li>\n<li>Conocer el est&aacute;ndar openEHR para Historias Cl&iacute;nicas Electr&oacute;nicas, desde el punto de vista de implementaci&oacute;n de repositorios de informaci&oacute;n cl&iacute;nica.</li>\n<li>Conocer distintas t&eacute;cnicas y tecnolog&iacute;as de implementaci&oacute;n de bases de datos.</li>\n<li>Experimentar con los conceptos vistos en clase para el dise&ntilde;o e implementaci&oacute;n de una base de datos cl&iacute;nica.</li>\n</ul>', 'http://informatica-medica.blogspot.com/2018/10/iv-curso-diseno-e-implementacion-de.html', '2018-10-29 03:26:42', 'News', 0);
