INSERT INTO `cms_notifs_newsletter` (`id`, `name`, `content`, `createdOn`, `class`, `deleted`) VALUES
(1, 'Primer prueba', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>&nbsp;Bolet&iacute;n de la comunidad</h1>\r\n<p>Estimados,</p>\r\n<p>Esta es una prueba para verificar que los boletines se est&aacute;n creando y enviando correctamente.</p>\r\n<p>Tambi&eacute;n para consultarles si pueden acceder correctamente al foro de la comunidad con su usuario y clave: <a href=\\\"http://openehr.org.es/foro\\\" target=\\\"_blank\\\">http://openehr.org.es/foro</a></p>\r\n<p>&nbsp;</p>\r\n<p>Por favor verifica si tienes acceso, y sino tienes acceso, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es</a></p>\r\n<p>&nbsp;</p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2012-04-27 18:17:34', 'NewsLetter', 0),
(2, 'InvitaciÃ³n a la comunidad', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Bolet&iacute;n de la comunidad 1</h1>\r\n<p>Estimados,</p>\r\n<p>Este es el primer bolet&iacute;n oficial de nuestra comunidad. Tiene el objetivo de invitarlos a participar en la comunidad, y comunicar el estado actual y los pr&oacute;ximos pasos que daremos.<br /><br /><strong>Resumen de temas:</strong></p>\r\n<ol>\r\n<li><a href=\\\"#tema1\\\">Invitaci&oacute;n a la charla \\\"Construyendo la comunidad de openEHR en espa&ntilde;ol\\\"</a></li>\r\n<li><a href=\\\"#tema2\\\">&iquest;C&oacute;mo participar en la comunidad?</a></li>\r\n<li><a href=\\\"#tema3\\\">Estructura y objetivos</a></li>\r\n<li><a href=\\\"#tema4\\\">Pr&oacute;ximos pasos</a></li>\r\n</ol><a name=\\\"tema1\\\"></a><br />\r\n<h2>1. Invitaci&oacute;n a la charla \\\"Construyendo la comunidad de openEHR en espa&ntilde;ol\\\"</h2>\r\n<div align=\\\"center\\\"><a style=\\\"border: 0;\\\" href=\\\"http://achisa.org/index.php?view=article&amp;catid=39:achisanews&amp;id=124:charla-interactiva-construyendo-la-comunidad-openehr-en-espanol\\\" target=\\\"_blank\\\"><img src=\\\"http://www.openehr.org.es/newsletter/openEHR_ES_banner.gif\\\" border=\\\"0\\\" /></a></div>\r\n<br />\r\n<p>El pr&oacute;ximo 13 de junio 2012, ACHISA los invita a participar de la charla informativa virtual \\\"<strong><em>Construyendo una comunidad de openEHR en espa&ntilde;ol\\\"</em></strong>, abierta a todos los interesados.</p>\r\n<p>Esta primera charla virtual es para informar sobre openEHR y formalizar la comunidad&nbsp;openEHR en espa&ntilde;ol.</p>\r\n<p>La charla est&aacute; dirigida&nbsp;a todos los actores de la salud&nbsp;que&nbsp;est&eacute;n<strong>&nbsp;</strong>interesados en la informatizaci&oacute;n del &aacute;rea cl&iacute;nica: prestadores de servicios de salud, asociaciones cient&iacute;ficas, universidades, entidades de gobierno, proveedores de soluciones y sistemas en salud, profesionales y estudiantes tanto inform&aacute;ticos como cl&iacute;nicos y de otras &aacute;reas.</p>\r\n<div>Agenda de la charla:</div>\r\n<div>\r\n<ul>\r\n<li>&iquest;Qu&eacute; es openEHR? (el est&aacute;ndar y la fundaci&oacute;n)</li>\r\n<li>&iquest;Por qu&eacute; openEHR en espa&ntilde;ol?</li>\r\n<li>Comunidad openEHR en espa&ntilde;ol: estructura, objetivos, l&iacute;neas de acci&oacute;n</li>\r\n<li>&iquest;C&oacute;mo participar y contribuir?</li>\r\n<li>Espacio para preguntas</li>\r\n</ul>\r\n<br />\r\n<div>Relatores:&nbsp;<strong>Pablo Pazos, Jaime de los Hoyos, Maurizio Mattoli</strong></div>\r\n<div>Coordinaci&oacute;n:&nbsp;<strong>Asociaci&oacute;n Chilena de Inform&aacute;tica en Salud (ACHISA)</strong></div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>D&iacute;a y hora</strong>:&nbsp;<strong>mi&eacute;rcoles 13 de junio a las 18:30 de Chile</strong>&nbsp;(GMT-4) (nota: misma hora de la clase del curso de openEHR en espa&ntilde;ol).&nbsp;<a title=\\\"Fecha y horario en otros paises\\\" href=\\\"http://www.timeanddate.com/worldclock/fixedtime.html?msg=Charla%3A+Construyendo+la+comunidad+de+openEHR+en+espa%C3%B1ol&amp;iso=20120613T1830&amp;p1=232\\\" target=\\\"_blank\\\">Para ver a qu&eacute; horario corresponde en su pa&iacute;s o ciudad clic aqu&iacute;</a>.</div>\r\n</div>\r\n<div><br /><strong>Acceso a la sala virtual:</strong>&nbsp;<a title=\\\"Link a la charla OpenEHR 13 de junio 2012\\\" href=\\\"http://www.gvowebcast.com/conference,achisa\\\" target=\\\"_blank\\\">Link para participar a la Charla:</a>&nbsp;(<a href=\\\"http://www.gvowebcast.com/conference,achisa\\\" target=\\\"_blank\\\">http://www.gvowebcast.com/conference,achisa</a>) (ingresar 15 minutos antes del horario de la charla)</div>\r\n<br /> <a name=\\\"tema2\\\"></a><br />\r\n<h2>2. &iquest;C&oacute;mo participar en la comunidad?</h2>\r\nSi est&aacute; leyendo este bolet&iacute;n, seguramente est&eacute; registrado en el portal de la comunidad (<a href=\\\"http://openehr.org.es\\\">http://openehr.org.es</a>), ese es el primer paso para participar!<br /><br />El segundo paso es ponerse en contacto en nuestras redes sociales. Como parte de nuestra estrategia de comunicaci&oacute;n social, en este momento contamos con un grupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li>LinkedIn: red para v&iacute;nculos profesionales</li>\r\n<li>Facebook: comunicaci&oacute;n con entusiastas de openEHR en toda Iberoam&eacute;rica</li>\r\n<li>Twitter: noticias m&aacute;s importantes, links interesantes</li>\r\n</ul>\r\nTodos quienes tengan usuario del portal, pueden ingresar a nuestro foro, donde tambi&eacute;n pueden aportar, preguntar y compartir:&nbsp;<a href=\\\"http://openehr.org.es/foro\\\" target=\\\"_blank\\\">http://openehr.org.es/foro</a><br /><br /><br /><strong>La comunidad la hacemos entre todos: &iexcl;s&iacute;guenos, comparte, participa!</strong><br /><br /><br />Adem&aacute;s le animamos a que invite a sus colegas, compa&ntilde;eros y amigos que est&eacute;n interesados en la Inform&aacute;tica M&eacute;dica a participar en nuestra comunidad. En esta p&aacute;gina pueden encontrar informaci&oacute;n &uacute;til sobre nuestros objetivos y c&oacute;mo participar:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/bienvenidos\\\">http://openehr.org.es/cms2/display/bienvenidos</a><br /><br /> <a name=\\\"tema3\\\"></a><br />\r\n<h2>3. Estructura y objetivos</h2>\r\nEn este momento nos encontramos en un momento de definici&oacute;n y necesitamos de tu ayuda para hacerlo de la mejor manera. En nuestro portal puedes encontrar informaci&oacute;n acerca de lo que buscamos hacer y c&oacute;mo. Pero es de vital importancia saber tu opini&oacute;n. Para dicho fin, hemos instalado un sistema de comentarios en las p&aacute;ginas llamado Disqus, que te permite comentar sobre el contenido de la p&aacute;gina para opinar, realizar cr&iacute;ticas constructivas, sugerencias, etc. para poder mejorarlo.<br /><br />En la parte inferior de todas las p&aacute;ginas del portal de la comunidad (<a href=\\\"http://openehr.org.es/\\\">http://openehr.org.es</a>) puedes encontrar el &aacute;rea de comentarios de Disqus.<br /><br />Te animamos a visitar el portal de la comunidad, por ejemplo en <a href=\\\"http://openehr.org.es/cms2/display/nuestra_comunidad\\\" target=\\\"_blank\\\">esta p&aacute;gina</a> encontrar&aacute;s una definici&oacute;n de la comunidad, una propuesta de estructura y nuestro manifiesto. Nos gustar&iacute;a saber tu opini&oacute;n: &iexcl;participa!<br /><br /> <a name=\\\"tema4\\\"></a><br />\r\n<h2>4. Pr&oacute;ximos pasos</h2>\r\nComo comunidad buscamos aportar en &aacute;reas como la difusi&oacute;n y capacitaci&oacute;n acerca del est&aacute;ndar openEHR, vinculando industria, prestadores, gobierno y academia. Buscaremos los caminos para llegar a aplicaciones concretas de openEHR, aportando a la investigaci&oacute;n y al desarrollo de proyectos en distintas &aacute;reas, como el desarrollo de software para la asistencia sanitaria y el modelado de conocimiento cl&iacute;nico.<br /><br />Algunas ideas para implementar en un futuro cercano son:<br />\r\n<ul>\r\n<li>Creaci&oacute;n de grupos de trabajo:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/grupos_de_trabajo\\\">http://openehr.org.es/cms2/display/grupos_de_trabajo</a></li>\r\n<li>Actividades de difusi&oacute;n:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/comunicacion_y_difusion\\\">http://openehr.org.es/cms2/display/comunicacion_y_difusion</a></li>\r\n<li>Creaci&oacute;n de materiales y recursos en espa&ntilde;ol:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/manuales_y_guias\\\">http://openehr.org.es/cms2/display/manuales_y_guias</a></li>\r\n<li>Creaci&oacute;n de una bolsa de trabajo centrada en proyectos que implementen openEHR: fomentando el v&iacute;nculo entre la industria y la academia</li>\r\n</ul>\r\n<br />&iexcl;Hasta el pr&oacute;ximo bolet&iacute;n!<br />\r\n<p>Ante cualquier duda o problema, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2012-06-06 01:12:47', 'NewsLetter', 0),
(3, 'Pedido de comentarios de la propuesta', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Bolet&iacute;n de la comunidad 2</h1>\r\n<p>Estimados,</p>\r\n<p>Este es el primer bolet&iacute;n oficial de nuestra comunidad. Tiene el objetivo de invitarlos a participar en la comunidad, y comunicar el estado actual y los pr&oacute;ximos pasos que daremos.<br /><br /><strong>Resumen de temas:</strong></p>\r\n<ol>\r\n<li><a href=\\\"#tema1\\\">Define tu comunidad: tu aporte importa</a></li>\r\n<li><a href=\\\"#tema2\\\">Participa de nuestro foro y redes sociales</a></li>\r\n<li><a href=\\\"#tema3\\\">Completa tu perfil</a></li>\r\n<li><a href=\\\"#tema4\\\">Pr&oacute;ximos pasos</a></li>\r\n</ol><br /><a name=\\\"tema1\\\"></a>\r\n<h2>1. Define tu comunidad: tu aporte importa</h2>\r\n<div style=\\\"background-color: #23337e;\\\" align=\\\"center\\\"><a href=\\\"http://openehr.org.es/openEHR%20en%20espa%C3%B1ol%20-%20propuesta%20inicial.pdf\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/images/openEHR_propuestas_para_la_comunidad.png\\\" border=\\\"0\\\" /></a></div>\r\n<br />\r\n<p>Haz tus comentarios, sugerencias y aportes en nuestro foro:&nbsp;<a href=\\\"http://openehr.org.es/foro/viewforum.php?id=15\\\">http://openehr.org.es/foro/viewforum.php?id=15<br /><br /></a>Tambi&eacute;n puedes comentar en las p&aacute;ginas del portal de la comunidad: cada p&aacute;gina tiene un &aacute;rea de comentarios en la parte inferior.</p>\r\n<br /> <a name=\\\"tema2\\\"></a>\r\n<h2>2. Participa en nuestro foro y redes sociales</h2>\r\nLa comunidad tiene un nuevo foro el cual est&aacute; dividido en foros por temas:&nbsp;<a href=\\\"http://openehr.org.es/foro/\\\" target=\\\"_blank\\\">http://openehr.org.es/foro</a><br /><br />Este es el espacio para hacer preguntas, comentarios, compartir materiales, vincularse con otros profesionales, etc. Es un espacio abierto para todo tipo de intercambio, y como tal debemos mantener cierto orden. <a href=\\\"http://openehr.org.es/foro/misc.php?action=rules\\\" target=\\\"_blank\\\">Esta</a> es una lista preliminar de reglas para poder utilizar el foro de la mejor manera, lo m&aacute;s importante es crear nuevas conversaciones bajo el tema correcto.<br /><br />Como parte de nuestra estrategia de comunicaci&oacute;n social, en este momento contamos con un grupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>. Con&eacute;ctate, comparte, participa.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li>LinkedIn: red para v&iacute;nculos profesionales</li>\r\n<li>Facebook: comunicaci&oacute;n con entusiastas de openEHR en toda Iberoam&eacute;rica</li>\r\n<li>Twitter: noticias m&aacute;s importantes, links interesantes</li>\r\n</ul>\r\n<br />Te animamos a que invite a tus colegas, compa&ntilde;eros y amigos a participar en nuestra comunidad:&nbsp;<a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><span style=\\\"text-decoration: underline;\\\">tu comunidad</span></a>. En esta p&aacute;gina pueden encontrar informaci&oacute;n &uacute;til sobre nuestros objetivos y c&oacute;mo participar:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/bienvenidos\\\">http://openehr.org.es/cms2/display/bienvenidos</a><br /><br /> <a name=\\\"tema3\\\"></a>\r\n<h2>3. Completa tu perfil</h2>\r\n<strong>Tu foto de perfil</strong><br /><br />El portal de la comunidad utiliza el servicio de <a href=\\\"http://es.gravatar.com/\\\" target=\\\"_blank\\\">Gravatar</a> para mostrar las fotos de perfil. Si deseas que tu foto aparezca en tu perfile como se muestra en la imagen, reg&iacute;strate en <a href=\\\"http://es.gravatar.com/\\\" target=\\\"_blank\\\">Gravatar</a> (hay un video explicativo en su sitio web), y autom&aacute;ticamente tu foto de perfile aparecer&aacute; en el portal de nuestra comunidad. Aqu&iacute; a un <a href=\\\"http://www.youtube.com/watch?v=A8rpvWVMFwQ\\\" target=\\\"_blank\\\">video explicativo en espa&ntilde;ol</a>.<br /><br />\r\n<div align=\\\"center\\\"><img src=\\\"http://openehr.org.es/apps/cms2/images/newsletter2/completa%20tu%20perfil%20-%20gravatar.png\\\" border=\\\"0\\\" title=\\\"Imagen de perfil\\\" width=\\\"705\\\" height=\\\"203\\\" /></div>\r\n<br /><strong>Tu informaci&oacute;n de perfil</strong><br /><br />Completa tu informaci&oacute;n de perfil ingresando al portal de la comunidad con tu usuario y clave. Luego haz clic en tu nombre como lo muestra en la siguiente imagen. En la ventana que aparece haz clic en \\\"Modificar perfil\\\", y en la nueva ventana puedes editar y completar tus datos.<br /><br />\r\n<div align=\\\"center\\\"><img src=\\\"http://openehr.org.es/apps/cms2/images/newsletter2/completa%20tu%20perfil%20-%20agrega%20informacion.png\\\" border=\\\"0\\\" alt=\\\"Completa tu informacion de perfil\\\" title=\\\"Completa tu informacion de perfil\\\" width=\\\"355\\\" height=\\\"120\\\" /></div>\r\n<br /><br />Es recomendable mantener el perfil actualizado as&iacute; otros miembros de la comunidad pueden conocerte mejor y contactarte. Aqu&iacute; puedes agregar tus datos y redes sociales.<br /><br /> <a name=\\\"tema4\\\"></a>\r\n<h2>4. Pr&oacute;ximos pasos</h2>\r\nComo comunidad buscamos aportar en &aacute;reas como la difusi&oacute;n y capacitaci&oacute;n acerca del est&aacute;ndar openEHR, vinculando industria, prestadores, gobierno y academia. Buscaremos los caminos para llegar a aplicaciones concretas de openEHR, aportando a la investigaci&oacute;n y al desarrollo de proyectos en distintas &aacute;reas, como el desarrollo de software para la asistencia sanitaria y el modelado de conocimiento cl&iacute;nico.<br /><br />Algunas ideas para implementar en un futuro cercano son:<br />\r\n<ul>\r\n<li>Creaci&oacute;n de grupos de trabajo:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/grupos_de_trabajo\\\">http://openehr.org.es/cms2/display/grupos_de_trabajo</a></li>\r\n<li>Actividades de difusi&oacute;n:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/comunicacion_y_difusion\\\">http://openehr.org.es/cms2/display/comunicacion_y_difusion</a></li>\r\n<li>Creaci&oacute;n de materiales y recursos en espa&ntilde;ol:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/manuales_y_guias\\\">http://openehr.org.es/cms2/display/manuales_y_guias</a></li>\r\n<li>Creaci&oacute;n de una bolsa de trabajo centrada en proyectos que implementen openEHR: fomentando el v&iacute;nculo entre la industria y la academia</li>\r\n</ul>\r\n<br />&iexcl;Hasta el pr&oacute;ximo bolet&iacute;n!<br />\r\n<p>Ante cualquier duda o problema, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es<br /></a><br /><br />Atte.<br />Ing. Pablo Pazos<br />Coordinador de la comunidad de openEHR en espa&ntilde;ol<br /><a href=\\\"http://informatica-medica.blogspot.com/\\\">http://informatica-medica.blogspot.com/</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2012-07-05 13:50:15', 'NewsLetter', 0),
(4, 'openEHR en el CAIS 2012', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Comunicado especial</h1>\r\n<p><span>Estimad@s,</span></p>\r\n<div>&nbsp;</div>\r\n<div>Los molesto para informarles sobre las actividades sobre openEHR que vamos a tener en el CAIS 2012.</div>\r\n<div>&nbsp;</div>\r\n<div><span style=\\\"text-decoration: underline;\\\">Para participar en las reuniones abiertas sobre la comunidad de openEHR en espa&ntilde;ol</span>, env&iacute;enme correo previamente para coordinar donde nos encontramos. Durante todo el congreso estar&eacute; disponible para contestar cualquier duda. sobre las actividades. Por favor difundan entre sus contactos.<br clear=\\\"all\\\" />\r\n<div>&nbsp;</div>\r\n<div><span style=\\\"text-decoration: underline;\\\">Mi&eacute;rcoles 29 de agosto:</span></div>\r\n<div><ol>\r\n<li><strong>09:45 Sala 2</strong>: presentaci&oacute;n de trabajo&nbsp;\\\"EHRGen: Generador de Sistemas Normalizados de Historia Cl&iacute;nica Electr&oacute;nica Basados en openEHR\\\".</li>\r\n<li><strong>14:00-15:00 Sala a definir</strong>: comunidad de openEHR en espa&ntilde;ol. Reuni&oacute;n abierta I para coordinar actividades de la comunidad (temas varios).</li>\r\n</ol></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\\\"text-decoration: underline;\\\">Jueves 30 de agosto</span>: jornada de workshops openEHR</div>\r\n<div><ol>\r\n<li><strong>09:00 - 11:00 Sala 1</strong>: el modelo de informaci&oacute;n de openEHR</li>\r\n<li><strong>11:15 - 13:00 Sala 1</strong>: utilizaci&oacute;n de arquetipos openEHR en sistemas de informaci&oacute;n en salud (traer notebook)</li>\r\n<li><strong>14:00 - 16:00&nbsp;Sala 1</strong>: terminolog&iacute;as cl&iacute;nicas en openEHR</li>\r\n<li><strong>16:30 - 17:30&nbsp;Sala 1</strong>: presente y futuro de openEHR</li>\r\n</ol></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\\\"text-decoration: underline;\\\">Viernes 31 de agosto:</span></div>\r\n<div><ol>\r\n<li><strong>10:00 - 11:00 Sala a definir</strong>: comunidad de openEHR en espa&ntilde;ol. Reuni&oacute;n abierta II para coordinar actividades de la comunidad (temas varios).</li>\r\n</ol></div>\r\n<div>&nbsp;</div>\r\n<div>Links &uacute;tiles:</div>\r\n<div><ol>\r\n<li><a href=\\\"http://openehr.org.es/cms2/display/openehr\\\" target=\\\"_blank\\\">&iquest;Qu&eacute; es openEHR?</a></li>\r\n<li><a href=\\\"http://www.cais.org.ar/?q=node/17\\\" target=\\\"_blank\\\">Programa del congreso</a></li>\r\n</ol></div>\r\n<div>&nbsp;</div>\r\n<div>Quedo a su disposici&oacute;n. Si me necesitan, estar&eacute; desde el lunes 27 en La Plata.<br /><br />Ing. Pablo Pazos Guti&eacute;rrez<br />Coordinado de la comunidad de openEHR en espa&ntilde;ol<br /><a href=\\\"http://tinyurl.com/pablopazos\\\" target=\\\"_blank\\\">tinyurl.com/pablopazos</a></div>\r\n</div>\r\n<p>Ante cualquier duda o problema, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2012-08-25 21:28:57', 'NewsLetter', 0),
(5, 'openEHR en Jornadas Universitarias del Hospital Italiano de Buenos Aires 2012', '<div class=\\\"flash\\\">\r\n<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Novedades</h1>\r\n<p>Estimados,</p>\r\n<p>Les escribo para comunicarles que la pr&oacute;xima semana estaremos participando de las Jornadas Universitarias del Hostpital Italiano de Buenos Aires. Aprovecho la oportunidad para recordarles que completen los datos en su perfil de la comunidad para ayudar a saber quienes somos y de donde, y tambi&eacute;n para informar de nuestras redes sociales y formas de intercambio a los nuevos miembros de la comunidad.</p>\r\n<a name=\\\"tema1\\\"></a><br />\r\n<h2>1. openEHR en las Jornadas Universitarias del Hospital Italiano de Buenos Aires</h2>\r\n<div style=\\\"text-align: left;\\\" align=\\\"center\\\">Los pr&oacute;ximos 28, 29 y 30 de noviembre de 2012, ser&aacute;n las Jornadas del HIBA, cita anual de reconocidos expertos en Inform&aacute;tica M&eacute;dica y Est&aacute;ndarares que es totalmente gratuita, e incluye acceso v&iacute;a web. <a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_seccion.php&amp;id_seccion=13266\\\" target=\\\"_blank\\\">Aqu&iacute; puedes encontrar mayor informaci&oacute;n</a>.<br /><br />El d&iacute;a jueves 29 de noviembre, habr&aacute; una mesa redonda de HL7 Argentina donde hablaremos de las capacidades de colaboraci&oacute;n entre ambos est&aacute;ndares: openEHR y HL7. <a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_curso.php&amp;id_curso=13164#.UK59V4dQaDE\\\" target=\\\"_blank\\\">Aqu&iacute; puedes encontrar m&aacute;s informaci&oacute;n</a>.<br /><br />Los amigos de HL7 Argentina me han invitado a dicha mesa, donde presentar&eacute; qu&eacute; es openEHR y para que sirve como introducci&oacute;n al intercambio sobre c&oacute;mo pueden colaborar estos dos est&aacute;ndares. La presentaci&oacute;n de mi charla quedar&aacute; disponible en el portal de openEHR en espa&ntilde;ol.</div>\r\n<br /> <a name=\\\"tema2\\\"></a><br />\r\n<h2>2. &iquest;C&oacute;mo participar en la comunidad?</h2>\r\nSi est&aacute; leyendo este bolet&iacute;n, seguramente est&eacute; registrado en el portal de la comunidad (<a href=\\\"http://openehr.org.es\\\">http://openehr.org.es</a>), ese es el primer paso para participar!<br /><br />El segundo paso es ponerse en contacto en nuestras redes sociales. Como parte de nuestra estrategia de comunicaci&oacute;n social, en este momento contamos con un grupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li>LinkedIn: red para v&iacute;nculos profesionales</li>\r\n<li>Facebook: comunicaci&oacute;n con entusiastas de openEHR en toda Iberoam&eacute;rica</li>\r\n<li>Twitter: noticias m&aacute;s importantes, links interesantes</li>\r\n</ul>\r\nTodos quienes tengan usuario del portal, pueden ingresar a nuestro foro, donde tambi&eacute;n pueden aportar, preguntar y compartir:&nbsp;<a href=\\\"http://openehr.org.es/foro\\\" target=\\\"_blank\\\">http://openehr.org.es/foro</a><br /><br /><br /><strong>La comunidad la hacemos entre todos: &iexcl;s&iacute;guenos, comparte, participa!</strong><br /><br /><br />Adem&aacute;s le animamos a que invite a sus colegas, compa&ntilde;eros y amigos que est&eacute;n interesados en la Inform&aacute;tica M&eacute;dica a participar en nuestra comunidad. En esta p&aacute;gina pueden encontrar informaci&oacute;n &uacute;til sobre nuestros objetivos y c&oacute;mo participar:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/bienvenidos\\\">http://openehr.org.es/cms2/display/bienvenidos</a><br /><br /><br /><br />&iexcl;Hasta la pr&oacute;xima!<br />\r\n<p><span>Atte.</span><br /><span>Ing. Pablo Pazos<br /></span><a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es</a><br /><span>Coordinador de la comunidad de openEHR en espa&ntilde;ol</span><br /><a href=\\\"http://informatica-medica.blogspot.com/\\\">http://informatica-medica.blogspot.com/</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>', '2012-11-22 17:18:56', 'NewsLetter', 0),
