bril 2013</span></td>\r\n</tr>\r\n<tr>\r\n<td><span>El est&aacute;ndar openEHR, herramientas disponibles para trabajar desde el punto de vista cl&iacute;nico.</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id=\\\"header_bottom\\\" style=\\\"width: 635px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/header_bottom.png\\\" border=\\\"0\\\" alt=\\\"Borde\\\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id=\\\"picture\\\" style=\\\"width: 635px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\" bgcolor=\\\"#ffffff\\\">\r\n<tbody>\r\n<tr>\r\n<td width=\\\"61\\\"><img src=\\\"http://2.bp.blogspot.com/_jS3wcH3mkBM/TUECoygv8YI/AAAAAAAAExY/nOf4nYVX9Nw/s200/pab+2009+SUEIIDISS+cara.jpeg\\\" border=\\\"0\\\" alt=\\\"Orador\\\" align=\\\"right\\\" /></td>\r\n<td width=\\\"283\\\">\r\n<table id=\\\"picture_contenedor\\\" style=\\\"width: 245px; height: 85px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"5\\\" bgcolor=\\\"#eeefef\\\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table id=\\\"picture_info\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td><span><strong>19 DE ABRIL DE 2013</strong></span><br /><span><strong>2 PM</strong></span>&nbsp;<span>Horario de Buenos Aires, Argentina</span></td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\\\"#505052\\\"><span>ING. PABLO PAZOS<br /><small>CaboLabs, Uruguay</small><br /></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n<td align=\\\"center\\\" width=\\\"171\\\">\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\\\"http://www.google.com/calendar/event?action=TEMPLATE&amp;text=Webinar%20-%20Abril%202013%20El%20est%C3%A1ndar%20openEHR%2C%20Herramientas%20disponibles%20para%20trabajar%20desde%20el%20punto%20de%20vista%20cl%C3%ADnico.&amp;dates=20130419T170000Z/20130419T200000Z&amp;details=Webinar%20-%20Abril%202013%0A%0AEl%20est%C3%A1ndar%20openEHR%2C%20Herramientas%20disponibles%20para%20trabajar%20desde%20el%20punto%20de%20vista%20cl%C3%ADnico.%0A%0A19%20DE%20ABRIL%20DE%202012%20-2%20PM%20Horario%20de%20Buenos%20Aires%2C%20Argentina%0AING.%20PABLO%20PAZOS.%20CaboLabs%2C%20Uruguay%0A%0Ahttp%3A%2F%2Fwww.hospitalitaliano.org.ar%2Finfomed%2Findex.php%3Fcontenido%3Dver_webinar.php%26id_curso%3D14173&amp;location=Aula%20Virtual%20HIBA&amp;trp=false&amp;sprop=%20http%3A%2F%2Fwww.hospitalitaliano.org.ar%2Finfomed&amp;sprop=name:%20http%3A%2F%2Fwww.hospitalitaliano.org.ar%2Finfomed\\\"><span><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/button_1.png\\\" border=\\\"0\\\" alt=\\\"Aregar a Google Calendar\\\" /></span></a></td>\r\n</tr>\r\n<tr>\r\n<td><a href=\\\"http://www.timeanddate.com/worldclock/fixedtime.html?msg=Webinar+-+Abril+2013+%22El+est%C3%A1ndar+openEHR%2C+Herramientas+disponibles+..%22&amp;iso=20130419T14&amp;p1=51&amp;ah=2\\\" target=\\\"_blank\\\"><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/button_2.png\\\" border=\\\"0\\\" alt=\\\"Ver horarios globales\\\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id=\\\"picture_bottom\\\" style=\\\"width: 635px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/picture_bottom.png\\\" border=\\\"0\\\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id=\\\"contenido\\\" style=\\\"width: 635px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\" bgcolor=\\\"#ffffff\\\">\r\n<tbody>\r\n<tr>\r\n<td width=\\\"376\\\">\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td><span>Introducci&oacute;n</span></td>\r\n</tr>\r\n<tr>\r\n<td><span>En general los proyectos de informatizaci&oacute;n de los registros cl&iacute;nicos son largos y costosos, tambi&eacute;n son altamente dependientes de la tecnolog&iacute;a, y los est&aacute;ndares disponibles pocas veces son implementados. Adem&aacute;s existen problemas de comunicaci&oacute;n entre los distintos profesionales que participan de cada proyecto, fomentando errores y malos entendidos que repercuten negativamente en la calidad de la soluci&oacute;n final. El est&aacute;ndar openEHR surge como una soluci&oacute;n parcial a varios de estos problemas, fomentando el uso de est&aacute;ndares complementarios como HL7 y SNOMED, entre otros, para lograr una soluci&oacute;n integral.<br /></span></td>\r\n</tr>\r\n<tr>\r\n<td><br /><span>Objetivos</span></td>\r\n</tr>\r\n<tr>\r\n<td><span>Lograr una comprensi&oacute;n cabal de la plataforma inform&aacute;tica para salud que propone openEHR, de las especificaciones del est&aacute;ndar (modelo de informaci&oacute;n, modelo de arquetipos, modelo de plantillas), del proceso de gesti&oacute;n del conocimiento (definici&oacute;n y gesti&oacute;n de conceptos cl&iacute;nicos utilizando arquetipos), de c&oacute;mo se vinculan los arquetipos con distintas terminolog&iacute;as est&aacute;ndar y servicios terminol&oacute;gicos, y de las herramientas disponibles para trabajar con openEHR desde el punto de vista cl&iacute;nico.<br /><br /></span></td>\r\n</tr>\r\n<tr>\r\n<td><br /><span>P&uacute;blico objetivo</span></td>\r\n</tr>\r\n<tr>\r\n<td><span>Esta presentaci&oacute;n est&aacute; especialmente dirigida a profesionales del &aacute;rea cl&iacute;nica y de gesti&oacute;n (personal m&eacute;dico, de enfermer&iacute;a, t&eacute;cnicos, licenciados, entre otros). Tambi&eacute;n ser&aacute; aprovechable por profesionales del &aacute;rea inform&aacute;tica (arquitectos de sistemas, integradores de sistemas, especialistas en BI, analistas, gestores de proyectos).<br /><br /></span></td>\r\n</tr>\r\n<tr>\r\n<td><span><br />Sobre el Orador</span><br /><span></span></td>\r\n</tr>\r\n<tr>\r\n<td><span><span>Ing. Pablo Pazos Guti&eacute;rrez</span><br />Director @<a href=\\\"http://cabolabs.com/es/home\\\" target=\\\"_blank\\\">CaboLabs: Consultor&iacute;a en Inform&aacute;tica M&eacute;dica y Est&aacute;ndares</a><br />Technical Lead &amp; Software Architect @ Tarmac IT, USA<br />Docente @ ACHISA: Curso de openEHR en espa&ntilde;ol<br />Coordinador @ Comunidad de openEHR en espa&ntilde;ol<br />Miembro calificado @ openEHR: programa de localizaci&oacute;n Am&eacute;rica Latina<br />Ingeniero en Computaci&oacute;n, Universidad de la Rep&uacute;blica (UdelaR), Uruguay<br /><br /></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n<td width=\\\"259\\\">\r\n<table style=\\\"width: 230px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table style=\\\"width: 230px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td align=\\\"center\\\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td align=\\\"center\\\"><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_webinar.php&amp;id_curso=14173\\\" target=\\\"_blank\\\"><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/button_3.png\\\" border=\\\"0\\\" alt=\\\"Acceder al Webinar\\\" align=\\\"top\\\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td><br /><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=webinars.php\\\" target=\\\"_blank\\\"><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/historial.png\\\" border=\\\"0\\\" alt=\\\"Historial de webinars\\\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\\\"width: 230px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"10\\\" bgcolor=\\\"#cccccc\\\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table style=\\\"width: 203px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/ultimos_webinars.png\\\" border=\\\"0\\\" alt=\\\"Ultimos webinars\\\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\\\"width: 203px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"10\\\" align=\\\"center\\\" bgcolor=\\\"#ffffff\\\">\r\n<tbody>\r\n<tr>\r\n<td><span><strong>Webinars&nbsp; 2012</strong></span><br /><span></span></td>\r\n</tr>\r\n<tr>\r\n<td><span><span><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_webinar.php&amp;id_curso=13186\\\" target=\\\"_blank\\\"><strong>Arquitectura est&aacute;ndar para el intercambio y la utilizaci&oacute;n de documentos cl&iacute;nicos electr&oacute;nicos en el sistema de salud</strong></a></span></span></td>\r\n</tr>\r\n<tr>\r\n<td><span><span><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_webinar.php&amp;id_curso=13185\\\" target=\\\"_blank\\\"><strong>Herramientas ling&uuml;&iacute;sticas y b&uacute;squeda de texto libre en el Hospital Italiano de Buenos Aires</strong></a></span></span></td>\r\n</tr>\r\n<tr>\r\n<td><span><span><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_webinar.php&amp;id_curso=13184\\\" target=\\\"_blank\\\"><strong>Integrando datos de equipos m&eacute;dicos a una Historia Cl&iacute;nica Electr&oacute;nica</strong></a></span></span></td>\r\n</tr>\r\n<tr>\r\n<td><span><a href=\\\"http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_webinar.php&amp;id_curso=13182\\\" target=\\\"_blank\\\"><strong>Documentaci&oacute;n de alergias medicamentosas: implicancias actuales y futuros desaf&iacute;os</strong></a></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\\\"http://www.google.com.ar/\\\" target=\\\"_blank\\\"><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/ultimos_webinars_bottom.png\\\" border=\\\"0\\\" alt=\\\"Borde\\\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id=\\\"picture_bottom\\\" style=\\\"width: 635px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\\\"http://campus.hospitalitaliano.org.ar/file.php/1/html/2012/Webinars/1/Imagenes/picture_bottom.png\\\" border=\\\"0\\\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\\\"width: 635px; height: 30px;\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\" bgcolor=\\\"#505052\\\">\r\n<tbody>\r\n<tr>\r\n<td valign=\\\"top\\\" width=\\\"350\\\"><span><strong>Contacto<br /></strong></span><span><strong>Nuestra ubicaci&oacute;n</strong><br /><span>Per&oacute;n 4190 - (C1181ACH) CABA, Argentina</span><br /><strong>Nuestros tel&eacute;fonos</strong><br /><span>+54-11-4959-0200 (l&iacute;nea rotativa)</span></span></td>\r\n<td valign=\\\"top\\\" width=\\\"350\\\"><span><span><strong><br /><br /></strong></span><strong><strong>Secretar&iacute;a Acad&eacute;mica</strong><br /><span>Mara Onzari Men&eacute;ndez (interno 9657)</span><br /><a href=\\\"mailto:mara.onzari@hospitalitaliano.org.ar\\\">mara.onzari@hospitalitaliano.org.ar</a><br /><br /></strong></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- borde azul --></td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2013-04-18 12:00:27', 'NewsLetter', 0);
