(7, 'CAIS 2013 Fecha Extendida para PresentaciÃ³n de Trabajos', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Comunicado especial</h1>\r\n<div>\r\n<h3 class=\\\"post-title entry-title\\\">Congreso Argentino de Inform&aacute;tica en Salud 2013: extensi&oacute;n de plazos para presentaci&oacute;n de trabajos</h3>\r\n<div class=\\\"post-body entry-content\\\"><br />Por cuarto a&ntilde;o consecutivo, el CAIS se realiza en el seno de las 42&deg; Jornadas Argentinas de Inform&aacute;tica (JAIIO),&nbsp;<strong>C&oacute;rdoba entre los d&iacute;as 18 y 20 de septiembre del 2013.</strong><br /><br />Se invita a la presentaci&oacute;n de trabajos cient&iacute;ficos enmarcados en la tem&aacute;tica tradicional del CAIS, &ldquo;Inform&aacute;tica y Salud&rdquo;. Como es habitual, se estimula el env&iacute;o de trabajos vinculados a las &aacute;reas<br />tem&aacute;ticas tradicionales de nuestro Congreso:<br /><br />\r\n<ul>\r\n<li>Salud y Gesti&oacute;n Cl&iacute;nica</li>\r\n<li>Registros M&eacute;dicos</li>\r\n<li>Sistemas de Informaci&oacute;n en Salud</li>\r\n<li>Inform&aacute;tica en Salud y Multimedia</li>\r\n<li>Soporte a la toma de decisiones</li>\r\n<li>Representaci&oacute;n y administraci&oacute;n del conocimiento en salud</li>\r\n<li>Educaci&oacute;n en Inform&aacute;tica en Salud</li>\r\n<li>Inform&aacute;tica centrada en el paciente</li>\r\n<li>Bioinform&aacute;tica</li>\r\n<li>Est&aacute;ndares, Interoperabilidad y Regulaciones</li>\r\n<li>Inform&aacute;tica en Enfermer&iacute;a</li>\r\n<li>Im&aacute;genes M&eacute;dicas.</li>\r\n</ul>\r\n<br /><br />La plantilla de presentaci&oacute;n la podr&aacute; encontrar en nuestro sitio. Los trabajos pueden estar escritos en espa&ntilde;ol, portugu&eacute;s o ingl&eacute;s.<br /><br />Mas informaci&oacute;n en&nbsp;<a href=\\\"http://www.cais.org.ar/\\\" target=\\\"_blank\\\">www.cais.org.ar</a>&nbsp;o a trav&eacute;s el mail&nbsp;<a href=\\\"mailto:cais@42jaiio.org.ar\\\">cais@42jaiio.org.ar</a><br /><br /><strong>Fechas importantes</strong><br /><strong><br /></strong>Fecha l&iacute;mite para la recepci&oacute;n de trabajos:&nbsp;<strong>15 de mayo de 2013 (fecha extendida)</strong><br />Notificaci&oacute;n a los autores: 1 de julio de 2013<br />Fecha l&iacute;mite para la presentaci&oacute;n definitiva de trabajos (camera ready): 8 de julio de 2013<br />Inicio de las 42 JAIIO: 16 de septiembre de 2013<br />Cierre de las 42 JAIIO: 20 de septiembre de 2013<br /><br /></div>\r\n</div>\r\n<div><hr width=\\\"90%\\\" size=\\\"1\\\" noshade=\\\"noshade\\\" /><br />Ing. Pablo Pazos Guti&eacute;rrez<br />Coordinado de la comunidad de openEHR en espa&ntilde;ol<br /><a href=\\\"http://tinyurl.com/pablopazos\\\" target=\\\"_blank\\\">tinyurl.com/pablopazos<br /><br /></a></div>\r\n<p>Ante cualquier duda o problema, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2013-04-25 21:54:39', 'NewsLetter', 0),
(8, 'Curso de openEHR en espaÃ±ol 3era ediciÃ³n', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<p>Estimados,</p>\r\n<p>Este es el primer bolet&iacute;n oficial de nuestra comunidad. Tiene el objetivo de invitarlos a participar en la comunidad, y comunicar el estado actual y los pr&oacute;ximos pasos que daremos.<br /><br /><strong>Resumen de temas:</strong></p>\r\n<ol>\r\n<li><a href=\\\"#tema1\\\">Curso de openEHR en espa&ntilde;ol 3era edici&oacute;n</a></li>\r\n<li><a href=\\\"#tema2\\\">Participa en nuestro foro y redes sociales</a></li>\r\n<li><a href=\\\"#tema3\\\">Completa tu perfil</a></li>\r\n</ol><a name=\\\"tema1\\\"></a><br />\r\n<h2>1. Curso de openEHR en espa&ntilde;ol: Inscripciones abiertas</h2>\r\n<p><strong>Desde el 28 de Mayo hasta el 16 de Julio 2013</strong><br /><br /> <a href=\\\"http://informatica-medica.blogspot.com/2013/05/curso-de-openehr-3era-edicion.html\\\" target=\\\"_blank\\\">M&aacute;s informaci&oacute;n</a><br /><br /></p>\r\n<div align=\\\"center\\\"><iframe src=\\\"http://www.youtube.com/embed/EB5Vg1yHAYU\\\" frameborder=\\\"0\\\" width=\\\"480\\\" height=\\\"360\\\"></iframe></div>\r\n<p><br /> <strong>Objetivos del curso</strong><br /><br /> Conocer el est&aacute;ndar openEHR Aprender a utilizar las herramientas gratuitas para su aplicaci&oacute;n Aprender a modelar Arquetipos y a implementarlos en sistemas de informaci&oacute;n<br /><br /><strong>Destinatarios</strong><br /><br /> Estudiantes y profesionales inform&acute;ticos, profesionales y t&eacute;cnicos de la salud (m&eacute;dicos, enfermeras, tecn&oacute;logos m&eacute;dicos, tecn&oacute;logos bio-inform&aacute;ticos u otros) con inter&eacute;s en los sistemas de informaci&oacute;n estandarizados en salud.<br /><br /> Personas que participan o est&aacute;n a cargo de proyectos de informatizaci&oacute;n en salud, sobre todo del &aacute;rea cl&iacute;nica, y tengan inter&eacute;s por crear sistemas de informaci&oacute;n en salud con un enfoque estandarizado con visi&oacute;n a futuro.<br /><br /> <strong>Modalidad</strong><br /><br /> On-line/a la distancia; sesiones on-line en tiempo real v&iacute;a Adobe Connect (*) + actividades y evaluaciones v&iacute;a campus virtual ACHISA. (*) Gentileza HIBA - Hospital Italiano de Buenos Aires.<br /><br /> <strong>Clases</strong><br /><br /> Una clase on-line semanal cada martes de la duraci&oacute;n de 1,5 hrs. con inicio a las 18:30 (GMT -4); total 8 clases/sesiones (desde el 28 de mayo 2013 hasta el 16 de julio 2013).</p>\r\n<br /> <a name=\\\"tema2\\\"></a><br />\r\n<h2>2. Participa en nuestro foro y redes sociales</h2>\r\nSi est&aacute; leyendo este bolet&iacute;n, seguramente est&eacute; registrado en el portal de la comunidad (<a href=\\\"http://openehr.org.es\\\">http://openehr.org.es</a>), ese es el primer paso para participar!<br /><br />El segundo paso es ponerse en contacto en nuestras redes sociales. Como parte de nuestra estrategia de comunicaci&oacute;n social, en este momento contamos con un grupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li>LinkedIn: red para v&iacute;nculos profesionales</li>\r\n<li>Facebook: comunicaci&oacute;n con entusiastas de openEHR en toda Iberoam&eacute;rica</li>\r\n<li>Twitter: noticias m&aacute;s importantes, links interesantes</li>\r\n</ul>\r\nTodos quienes tengan usuario del portal, pueden ingresar a nuestro foro, donde tambi&eacute;n pueden aportar, preguntar y compartir:&nbsp;<a href=\\\"http://openehr.org.es/foro\\\" target=\\\"_blank\\\">http://openehr.org.es/foro</a><br /><br /><br /><strong>La comunidad la hacemos entre todos: &iexcl;s&iacute;guenos, comparte, participa!</strong><br /><br /><br />Adem&aacute;s le animamos a que invite a sus colegas, compa&ntilde;eros y amigos que est&eacute;n interesados en la Inform&aacute;tica M&eacute;dica a participar en nuestra comunidad. En esta p&aacute;gina pueden encontrar informaci&oacute;n &uacute;til sobre nuestros objetivos y c&oacute;mo participar:&nbsp;<a href=\\\"http://openehr.org.es/cms2/display/bienvenidos\\\">http://openehr.org.es/cms2/display/bienvenidos</a><br /><br /> <a name=\\\"tema3\\\"></a><br />\r\n<h2>3. Completa tu perfil</h2>\r\n<strong>Tu foto de perfil</strong><br /><br />El portal de la comunidad utiliza el servicio de <a href=\\\"http://es.gravatar.com/\\\" target=\\\"_blank\\\">Gravatar</a> para mostrar las fotos de perfil. Si deseas que tu foto aparezca en tu perfile como se muestra en la imagen, reg&iacute;strate en <a href=\\\"http://es.gravatar.com/\\\" target=\\\"_blank\\\">Gravatar</a> (hay un video explicativo en su sitio web), y autom&aacute;ticamente tu foto de perfile aparecer&aacute; en el portal de nuestra comunidad. Aqu&iacute; a un <a href=\\\"http://www.youtube.com/watch?v=A8rpvWVMFwQ\\\" target=\\\"_blank\\\">video explicativo en espa&ntilde;ol</a>.<br /><br />\r\n<div align=\\\"center\\\"><img src=\\\"http://openehr.org.es/apps/cms2/images/newsletter2/completa%20tu%20perfil%20-%20gravatar.png\\\" border=\\\"0\\\" title=\\\"Imagen de perfil\\\" width=\\\"705\\\" height=\\\"203\\\" /></div>\r\n<br /><strong>Tu informaci&oacute;n de perfil</strong><br /><br />Completa tu informaci&oacute;n de perfil ingresando al portal de la comunidad con tu usuario y clave. Luego haz clic en tu nombre como lo muestra en la siguiente imagen. En la ventana que aparece haz clic en \\\"Modificar perfil\\\", y en la nueva ventana puedes editar y completar tus datos.<br /><br />\r\n<div align=\\\"center\\\"><img src=\\\"http://openehr.org.es/apps/cms2/images/newsletter2/completa%20tu%20perfil%20-%20agrega%20informacion.png\\\" border=\\\"0\\\" alt=\\\"Completa tu informacion de perfil\\\" title=\\\"Completa tu informacion de perfil\\\" width=\\\"355\\\" height=\\\"120\\\" /></div>\r\n<br /><br />Es recomendable mantener el perfil actualizado as&iacute; otros miembros de la comunidad pueden conocerte mejor y contactarte. Aqu&iacute; puedes agregar tus datos y redes sociales.<br /><br /> <br />&iexcl;Hasta el pr&oacute;ximo bolet&iacute;n!<br />\r\n<p>Ante cualquier duda o problema, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2013-05-20 22:39:05', 'NewsLetter', 0),
(9, 'Anuncio Curso openEHR 2014', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Lanzamiento de la edici&oacute;n 2014 del Curso de openEHR en espa&ntilde;ol</h2>\r\n<p>Informaci&oacute;n de <a href=\\\"http://achisa.org/index.php/nov/int/176-curso-openehr-en-espanol-4ta-edicion\\\" target=\\\"_blank\\\">inscripci&oacute;n al curso</a></p>\r\n<p><a href=\\\"http://www.achisa.org/images/stories/Brochure_curso_openEHR_4ta_edicion-ok.pdf\\\" target=\\\"_blank\\\">Programa del curso</a></p>\r\n<p>Les agradecemos darle toda la difusi&oacute;n posible al curso entre sus colegas y amigos. Recuerden que parte de los ingresos por concepto de inscripciones se destinan a mantener el sitio y redes sociales de la comunidad de openEHR en espa&ntilde;ol!</p>\r\n<p>&nbsp;</p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2014-03-19 12:50:58', 'NewsLetter', 0),
(10, 'ExtensiÃ³n plazo Curso 2014', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Extenci&oacute;n del plazo de inscripci&oacute;n para el Curso de openEHR en espa&ntilde;ol 2014</h2>\r\n<p>Para que nadie se quede afuera: extendemos el plazo de inscripci&oacute;n al Primer Curso Online de openEHR (en espa&ntilde;ol, 4ta ed.)<br /><br />Nueva fecha l&iacute;mite: lunes 21 de Abril de 2014<br /><br />Informaci&oacute;n y Programa: <a href=\\\"http://informatica-medica.blogspot.com/2014/03/curso-de-openehr-en-espanol-2014.html\\\" target=\\\"_blank\\\">http://informatica-medica.blogspot.com/2014/03/curso-de-openehr-en-espanol-2014.html</a><br /><br />#openEHR #ACHISA #HIBA2014 #CaboLabs</p>\r\n<p><a href=\\\"http://www.achisa.org/images/stories/Brochure_curso_openEHR_4ta_edicion-ok.pdf\\\" target=\\\"_blank\\\">Programa del curso</a></p>\r\n<p>Les agradecemos darle toda la difusi&oacute;n posible al curso entre sus colegas y amigos. Recuerden que parte de los ingresos por concepto de inscripciones se destinan a mantener el sitio y redes sociales de la comunidad de openEHR en espa&ntilde;ol!</p>\r\n<p>&nbsp;</p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2014-04-10 00:26:47', 'NewsLetter', 0),
(11, 'Anuncio Curso Libre 2014', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Lanzamiento de la modalidad libre del Curso de openEHR en espa&ntilde;ol</h2>\r\n<p>Les dejo la noticia de este nuevo curso de openEHR que puede interesarles: ahora el primer curso online de openEHR en una nueva modalidad...</p>\r\n<p><a href=\\\"http://achisa.org/index.php/nov/int/181-hacia-la-historia-clinica-electronica-estandar-e-interoperable\\\" target=\\\"_blank\\\">http://achisa.org/index.php/nov/int/181-hacia-la-historia-clinica-electronica-estandar-e-interoperable</a></p>\r\n<h3>Para los que no lo conocen:</h3>\r\n<p>openEHR es un est&aacute;ndar abierto para el desarrollo de sistemas de informaci&oacute;n en salud, estandarizados, interoperables y mantenibles a largo plazo.</p>\r\nM&aacute;s info:\r\n<ul>\r\n<li><a href=\\\"http://informatica-medica.blogspot.com/2010/10/openehr-el-estandar-abierto-para.html\\\" target=\\\"_blank\\\">http://informatica-medica.blogspot.com/2010/10/openehr-el-estandar-abierto-para.html</a></li>\r\n<li><a href=\\\"http://openehr.org.es/cms2/display/openehr\\\" target=\\\"_blank\\\">http://openehr.org.es/cms2/display/openehr</a></li>\r\n</ul>\r\n<h3>Sobre el docente:</h3>\r\n<ul>\r\n<ul>\r\n<li>Miembro de la comunidad de openEHR desde 2006</li>\r\n<li>Miembro calificado del comit&eacute; de localizaci&oacute;n de openEHR</li>\r\n<li>Creador del primer curso online de openEHR</li>\r\n<li>Creador de software que implementa openEHR y otros est&aacute;ndares como HL7</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\n<ul>\r\n<ul>Grupo en</ul>\r\n</ul>\r\n<a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>\r\n<ul>\r\n<ul>, una p&aacute;gina en</ul>\r\n</ul>\r\n<a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>\r\n<ul>\r\n<ul>, y una cuenta en</ul>\r\n</ul>\r\n<a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>\r\n<ul>\r\n<ul>.</ul>\r\n</ul>\r\n<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2014-09-29 00:12:22', 'NewsLetter', 0),
(12, 'Elecciones', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>&nbsp;Anuncio de la comunidad</h1>\r\n<p>Estimados, la Fundaci&oacute;n Internacional openEHR se est&aacute; reestructurando y en el proceso va a llamar a elecciones para la directiva.</p>\r\n<p>Si desean ser miembros de la Fundaci&oacute;n openEHR, lo que les da derecho de poder nominar candidatos para la directiva y votar, pueden registrarse aqu&iacute; como miembros individuales: <a href=\\\"http://members.openehr.org/join-us\\\" target=\\\"_blank\\\">http://members.openehr.org/join-us</a></p>\r\n<p>Aqu&iacute; pueden nominar personas para ser parte de la directiva de openEHR Foundation: <a href=\\\"http://members.openehr.org/event-1790725\\\" target=\\\"_blank\\\">http://members.openehr.org/event-1790725</a></p>\r\n<br />\r\n<p><strong>Importante: las nominaciones terminan el 28 de Diciembre de 2014.</strong></p>\r\n<br />\r\n<p>Este es el mensaje original enviado por la directiva actual: <a href=\\\"http://lists.openehr.org/pipermail/openehr-announce_lists.openehr.org/2014-November/000197.html\\\" target=\\\"_blank\\\">http://lists.openehr.org/pipermail/openehr-announce_lists.openehr.org/2014-November/000197.html</a></p>\r\n<p>&iexcl;Los esperamos en la votaci&oacute;n!</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2014-11-04 16:13:55', 'NewsLetter', 0),
(13, 'Curso Bases de Datos Clinicas', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Anuncio de la comunidad</h1>\r\n<p>Estimados, recuerden que este mi&eacute;rcoles comenzamos el nuevo curso online de Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR: <a href=\\\"http://achisa.org/index.php/nov/int/183-curso-de-diseno-e-implementacion-de-bases-de-datos-clinicas-con-openehr-edicion-2014-modalidad-sincronica\\\" target=\\\"_blank\\\">http://achisa.org/index.php/nov/int/183-curso-de-diseno-e-implementacion-de-bases-de-datos-clinicas-con-openehr-edicion-2014-modalidad-sincronica</a></p>\r\n<p>Las inscripciones est&aacute; abiertas: <a href=\\\"https://docs.google.com/spreadsheet/viewform?formkey=dHhWYW9RRFVfak9EeDFpUWlOcFFHV2c6MA\\\" target=\\\"_blank\\\">https://docs.google.com/spreadsheet/viewform?formkey=dHhWYW9RRFVfak9EeDFpUWlOcFFHV2c6MA</a></p>\r\n<p>Programa del curso: <a href=\\\"http://www.achisa.org/images/stories/Programa_openehr-db_2014.pdf\\\" target=\\\"_blank\\\">http://www.achisa.org/images/stories/Programa_openehr-db_2014.pdf</a></p>\r\n<p>&iexcl;Los esperamos!</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2014-11-17 12:10:34', 'NewsLetter', 0),
(14, 'Newsletter de fin de aÃ±o 2014', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de noticias de la comunidad</h1>\r\n<h2>Elecciones en la Fundaci&oacute;n openEHR</h2>\r\n<p dir=\\\"ltr\\\">La Fundaci&oacute;n es la encargada de mantener las especificaciones de openEHR y proveer herramientas de uso gratuito. En este momento se ha llamado a elecciones para la directiva de la Fundaci&oacute;n. Para poder proponer un candidato a la directiva deben crearse una membres&iacute;a aqu&iacute;: <a href=\\\"http://members.openehr.org\\\">http://members.openehr.org</a>. Una vez que tengan la membres&iacute;a, podr&aacute;n proponer un candidato aqu&iacute;: <a href=\\\"http://members.openehr.org/page-7745\\\">http://members.openehr.org/page-7745</a></p>\r\n<p dir=\\\"ltr\\\">Tengan en cuenta que el plazo para proponer un candidato es el 31 de Enero de 2015.</p>\r\n<h2>MedInfo 2015</h2>\r\n<p dir=\\\"ltr\\\">Estamos preparando tutoriales y talleres sobre openEHR para el MedInfo 2015: <a href=\\\"http://www.medinfo2015.org\\\">http://www.medinfo2015.org</a></p>\r\n<p dir=\\\"ltr\\\">Para los que no lo conocen, MedInfo es uno de los congresos m&aacute;s importantes de Inform&aacute;tica en Salud del mundo, y el a&ntilde;o que viene se realiza en Brasil. Por esto hay que aprovechar que lo tenemos cerca, y adem&aacute;s hay un descuento en la entrada para los colegas latinoamericanos hasta el 15 de enero de 2015. Aprovechen!</p>\r\n<h2>Saludos de fin de a&ntilde;o</h2>\r\n<p dir=\\\"ltr\\\">Este a&ntilde;o nos despide muy activos. Estuvimos focalizados en capacitaci&oacute;n en openEHR, a tal punto que dimos 3 cursos en 2014 (una cifra record! que demuestra que el inter&eacute;s en openEHR est&aacute; creciendo): el curso de introducci&oacute;n a openEHR en espa&ntilde;ol (modalidad normal y modalidad libre), y el nuevo curso de dise&ntilde;o e implementaci&oacute;n de bases de datos cl&iacute;nicas con openEHR.</p>\r\n<p dir=\\\"ltr\\\">Para 2015 nuestro plan es mejorar el portal web de la comunidad con m&aacute;s informaci&oacute;n y para hacerlo m&aacute;s interactivo, y adem&aacute;s buscaremos promover el intercambio sobre openEHR en espa&ntilde;ol en nuestro foro y redes sociales. Adem&aacute;s estamos en proceso de traducir el portal de openEHR a espa&ntilde;ol.</p>\r\n<p dir=\\\"ltr\\\">Les deseamos lo mejor a todos y &iexcl;que el a&ntilde;o que viene los encuentre con buena salud y muchos proyectos!</p>\r\n<p dir=\\\"ltr\\\">Un fuerte abrazo,<br /> Ing. Pablo Pazos Guti&eacute;rrez<br /> openEHR en espa&ntilde;ol</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2014-12-23 14:45:55', 'NewsLetter', 0),
(15, 'Lista de espera curso ISIS', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Nuevo curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud</h1>\r\n<p>Abrimos la lista de espera para el curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud donde veremos HL7, DICOM y openEHR, tecnolog&iacute;as, protocolos, formatos de mensajes y terminolog&iacute;as.</p>\r\n<p><a href=\\\"http://goo.gl/forms/LaCiwWaOJK\\\">Lista de espera</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2015-02-25 03:40:58', 'NewsLetter', 0),
(16, 'Curso interoperabilidad 2015 - inscripciones', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Nuevo curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud</h1>\r\n<p>Abrimos las inscripciones al nuevo curso de <strong>Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud</strong> donde veremos HL7, DICOM y openEHR, tecnolog&iacute;as, protocolos, formatos de mensajes y terminolog&iacute;as.</p>\r\n<p><a href=\\\"http://achisa.org/index.php/nov/int/184-interoperabilidad-2015\\\">Aqu&iacute; puede encontrar toda la informaci&oacute;n del curso y el formulario de inscripci&oacute;n</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2015-03-06 15:00:49', 'NewsLetter', 0),
(17, 'Curso openEHR 2015 6ta ed.', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Lanzamiento de la 6ta. edici&oacute;n del Curso de openEHR en espa&ntilde;ol</h2>\r\n<p>Informaci&oacute;n de <a href=\\\"http://informatica-medica.blogspot.com/2015/05/curso-de-openehr-6ta-edicion.html\\\" target=\\\"_blank\\\">inscripci&oacute;n al curso</a></p>\r\n<p><a href=\\\"http://cabolabs.com/capacitacion/2015_Brochure_curso_openEHR_6ta_ed.pdf\\\" target=\\\"_blank\\\">Programa del curso</a></p>\r\n<p>Les agradecemos darle toda la difusi&oacute;n posible al curso entre sus colegas y amigos. Recuerden que parte de los ingresos por concepto de inscripciones se destinan a mantener el sitio y redes sociales de la comunidad de openEHR en espa&ntilde;ol!<br /><br /><a href=\\\"http://achisa.org/openehr\\\" target=\\\"_blank\\\">Formulario de inscripci&oacute;n</a></p>\r\n<p>&nbsp;</p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2015-05-16 23:48:14', 'NewsLetter', 0),
(18, 'openEHR en MEDINFO', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>MEDINFO 2015: Tutorial de Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR</h2>\r\n<div>En agosto es el congreso internacional de Inform&aacute;tica en Salud MEDINFO 2015 en San Pablo, Brasil. Vamos a estar ah&iacute; brindando distintas charlas y talleres.</div>\r\n<div>&nbsp;</div>\r\n<div>Quer&iacute;a invitarlos a participar en este tutorial pre-congreso. Por m&aacute;s informaci&oacute;n:&nbsp;<a href=\\\"http://www.cabolabs.com/capacitacion/medinfo2015_tutorial_bases_de_datos_cilnicas.pdf\\\" target=\\\"_blank\\\"><span>http://www.cabolabs.com/capacitacion/medinfo2015_tutorial_bases_de_datos_cilnicas.pdf</span></a></div>\r\n<div>&nbsp;</div>\r\n<div>Aqu&iacute; pueden encontrar otros eventos en los que participaremos: <a href=\\\"http://www.cabolabs.com/es/eventos\\\" target=\\\"_blank\\\">http://www.cabolabs.com/es/eventos<br /><br /></a>Programa del congreso:&nbsp;<a href=\\\"http://medinfo2015.com/#program\\\" target=\\\"_blank\\\">http://medinfo2015.com/#program</a><a href=\\\"http://www.cabolabs.com/es/eventos\\\" target=\\\"_blank\\\"><br /></a></div>\r\n<p>&nbsp;</p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2015-07-10 22:06:29', 'NewsLetter', 0),
(19, 'Cursos de verano 2016', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2><span>Cursos de verano</span></h2>\r\n<div><span>Lanzamos las ediciones de verano de los cursos:</span></div>\r\n<div>\r\n<ul>\r\n<li><span style=\\\"color: #141823; font-family: helvetica, arial, sans-serif;\\\"><span>Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud</span></span></li>\r\n<li><span style=\\\"color: #141823; font-family: helvetica, arial, sans-serif;\\\"><span>Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR</span></span></li>\r\n</ul>\r\n<div><span style=\\\"color: #141823; font-family: helvetica, arial, sans-serif;\\\"><span>&nbsp;</span></span></div>\r\n</div>\r\n<div><span style=\\\"color: #141823; font-family: helvetica, arial, sans-serif;\\\"><span>Ambos cursos est&aacute;n orientados a inform&aacute;ticos, dado que son bien pr&aacute;cticos y van a tener que programar :)</span></span></div>\r\n<div><span>&nbsp;</span></div>\r\n<span>M&aacute;s informaci&oacute;n:</span><a href=\\\"http://cabolabs.com/es/capacitacion\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">http://cabolabs.com/es/capacitacion</a><br />\r\n<div>&nbsp;</div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2015-12-20 14:19:41', 'NewsLetter', 0);
INSERT INTO `cms_notifs_newsletter` (`id`, `name`, `content`, `createdOn`, `class`, `deleted`) VALUES
(20, 'ActualizaciÃ³n Mayo-2016', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a></td>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\">\r\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: large;\\\">Comunidad de openEHR en espa&ntilde;ol</span><br /><span style=\\\"text-decoration: underline; font-size: small;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"http://openehr.org.es/\\\"><span style=\\\"color: #ffffff; text-decoration: underline;\\\">http://openehr.org.es</span></a></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\" colspan=\\\"2\\\">\r\n<h1>Actualizaci&oacute;n Mayo 2016</h1>\r\n<p>Hace tiempo que no publicamos noticias y les quer&iacute;a dejar una peque&ntilde;a actualizaci&oacute;n. En este momento la Fundaci&oacute;n openEHR est&aacute; trabajando en dos &aacute;reas importantes: educaci&oacute;n y especificaciones.</p>\r\n<p>En educaci&oacute;n estamos definiendo un marco formal para acreditar formadores y certificar estudiantes con la aprobaci&oacute;n de la Fundaci&oacute;n.</p>\r\n<p>En especificaciones se est&aacute;n mejorando todas las especificaciones: modelo de informaci&oacute;n, modelo de arquetipos y plantillas y modelo de servicios. Es este &uacute;ltimo, estamos trabajando en definir una especificaci&oacute;n de servicios REST, lo que representa un gran avance para los implementadores de openEHR, ya que permitir&aacute; crear sistemas interoperables a nivel de estas interfaces t&eacute;cnicas, y ser&aacute; m&aacute;s sencillo integrar sistemas en la nube y con dispositivos m&oacute;viles.</p>\r\n<p>Relacionado a capacitaci&oacute;n, este a&ntilde;o ofreceremos 4 cursos con certificados de <a href=\\\"http://www.achisa.org\\\" target=\\\"_blank\\\">ACHISA</a> (Asociaci&oacute;n Chilena de Inform&aacute;tica en Salud) y <a href=\\\"http://www.cabolabs.com\\\" target=\\\"_blank\\\">CaboLabs</a>: Expertos en Inform&aacute;tic en Salud, Est&aacute;ndares e Interoperabilidad:</p>\r\n<ol>\r\n<li>El cl&aacute;sico curso de Introducci&oacute;n a openEHR y arquetipos</li>\r\n<li>Curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud (HL7 + DICOM + openEHR)</li>\r\n<li>Curso de Modelado e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR</li>\r\n<li>Nuevo curso de Modelado Cl&iacute;nico con openEHR (todo sobre metodolog&iacute;as y herramientas para crear arquetipos y plantillas)</li>\r\n</ol>\r\n<p><br />M&aacute;s informaci&oacute;n: <a href=\\\"http://cabolabs.com/es/capacitacion\\\" target=\\\"_blank\\\">http://cabolabs.com/es/capacitacion</a></p>\r\n&iexcl;Hasta el pr&oacute;ximo bolet&iacute;n!<br />\r\n<p>Ante cualquier duda o problema, env&iacute;a un correo a <a href=\\\"mailto:pablo@openehr.org.es\\\">pablo@openehr.org.es<br /></a><br /><br />Atte.<br />Ing. Pablo Pazos<br />Coordinador de la comunidad de openEHR en espa&ntilde;ol<br /><a href=\\\"http://www.cabolabs.com\\\" target=\\\"_blank\\\">www.cabolabs.com</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-05-30 02:12:53', 'NewsLetter', 0),
(21, 'Curso openEHR 2016', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2><span>Nueva edici&oacute;n del curso de openEHR</span></h2>\r\n<div>Estamos abriendo una nueva edici&oacute;n del Curso de openEHR: El est&aacute;ndar abierto para Historias Cl&iacute;nicas Electr&oacute;nicas interoperables y preparadas para el futuro.<br /><br />Comienza el 1 de Julio de 2016.<br />Inscripciones abiertas: &nbsp;<a href=\\\"http://informatica-medica.blogspot.com.uy/2016/06/nuevo-curso-de-openehr-de-achisa-y.html\\\" target=\\\"_blank\\\">m&aacute;s informaci&oacute;n</a></div>\r\n<div><br /><br />Les agradecemos que difundan la notifcia entre sus colegas y amigos.<br /><br /><br />\r\n<h2>Programa de Formaci&oacute;n Profesional en Inform&aacute;tica en Salud, Est&aacute;ndares y Interoperabilidad</h2>\r\n<span>Este a&ntilde;o estaremos implementando el piloto del programa para evaluar la posibilidad de hacer un plan de estudios anuales en temas avanzados y con un enfoque pr&aacute;ctico. Como es sabido, nuestras clases son se dan en l&iacute;nea pero&nbsp;en vivo y en directo (no se basa en ver videos pre-grabados), y cuentan con el respaldo de profesionales con amplia experiencia en el &aacute;rea.</span><br /><br /><span>Aqu&iacute; pueden encontrar la&nbsp;</span><a title=\\\"programa de formaci&oacute;n 2016\\\" href=\\\"http://www.cabolabs.com/educacion/programa_2016.pdf\\\" target=\\\"_blank\\\">informaci&oacute;n sobre el programa</a><span>.</span><br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-06-12 00:46:24', 'NewsLetter', 0),
(22, 'Curso ISIS 2016', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Nueva edici&oacute;n del Curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud</h2>\r\n<div>\r\n<p>Este curso est&aacute; destinado a estudiantes y profesionales del &aacute;rea inform&aacute;tica, y tiene una orientaci&oacute;n pr&aacute;ctica. Tiene una duraci&oacute;n de 6 semanas y las sesiones de clase ser&aacute;n los d&iacute;as 18 de Julio, 27 de Julio, 8 de Agosto y 17 de Agosto de 2016.</p>\r\n<p>Los objetivos del curso son:</p>\r\n<ul>\r\n<li>Conocer y utilizar distintos protocolos de comunicaci&oacute;n (TCP, MLLP, HTTP, SOAP), distintos formatos de mensajes (XML, JSON, HL7 v2.x) y est&aacute;ndares (HL7, DICOM, openEHR).</li>\r\n<li>Ganar experiencia con herramientas y tecnolog&iacute;as para implementaci&oacute;n (HAPI, PACS DCM4CHEE, EHRServer, WireShark)</li>\r\n<li>Adquirir conocimientos pr&aacute;cticos en comunicaci&oacute;n de datos cl&iacute;nicos e integraci&oacute;n de sistemas en &aacute;mbitos sanitarios.</li>\r\n</ul>\r\n<br /><br />Comienza el 18 de Julio de 2016.<br /><br />Aqu&iacute; puedes ver&nbsp;<a href=\\\"http://cabolabs.com/educacion/brochure_curso_isis_2016.pdf\\\" target=\\\"_blank\\\">m&aacute;s informaci&oacute;n</a>&nbsp;del curso.<br /><br />Las inscripciones estar&aacute;n abiertas hasta el pr&oacute;ximo 15 de Julio. Aqu&iacute; puedes encontrar el&nbsp;<a href=\\\"http://goo.gl/forms/9i9OrhkfmUFL8zHY2\\\" target=\\\"_blank\\\">formulario de inscripci&oacute;n</a>.</div>\r\n<div><br /><br />Les agradecemos que difundan la notifcia entre sus colegas y amigos.<br /><br /><br />\r\n<h2>Programa de Formaci&oacute;n Profesional en Inform&aacute;tica en Salud, Est&aacute;ndares y Interoperabilidad 2016</h2>\r\nEste a&ntilde;o estamos implementando el programa, como un plan de estudios anuales en temas avanzados y con un enfoque pr&aacute;ctico. Como es sabido, nuestras clases son se dan en l&iacute;nea pero&nbsp;en vivo y en directo (no se basa en ver videos pre-grabados), y cuentan con el respaldo de profesionales con amplia experiencia en el &aacute;rea.<br /><br />Aqu&iacute; pueden encontrar la&nbsp;<a title=\\\"programa de formaci&oacute;n 2016\\\" href=\\\"http://www.cabolabs.com/educacion/programa_2016.pdf\\\" target=\\\"_blank\\\">informaci&oacute;n sobre el programa</a>. Incluye listas de espera para los cursos y talleres que estaremos brindando hasta fin de a&ntilde;o.<br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-07-12 03:58:40', 'NewsLetter', 0),
(23, 'Curso Implementacion openEHR Presencial CHILE 2016', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Curso de Implementaci&oacute;n de Sistemas de Informaci&oacute;n con openEHR (PRESENCIAL)</h2>\r\nEstimados,<br /><br />Estaremos en Chile realizando el primer curso de implementaci&oacute;n de openEHR, ser&aacute; la semana del 5 de septiembre en Santiago.<br /><br />Pronto abriremos las inscripciones. Mientras tanto, puedes registrarte en nuestra lista de espera y ser&aacute;s notificado cuando se abran las inscripciones. Solo hay 40 plazas.<br /><br />Lista de espera: <a href=\\\"http://goo.gl/forms/bbeHNiZ2bPTCgGH83\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">http://goo.gl/forms/bbeHNiZ2bPTCgGH83</a><br /><br />Aqu&iacute; puedes encontrar el programa del curso: <a href=\\\"http://cabolabs.com/educacion/programa_implementacion_openEHR_presencial.pdf\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">http://cabolabs.com/educacion/programa_implementacion_openEHR_presencial.pdf</a><br /><br />Ante cualquier duda, no dejen de consultar.<br /><br />&iexcl;Nos vemos en Chile!<br />\r\n<div><br /><br /><br />\r\n<h2>Programa de Formaci&oacute;n Profesional en Inform&aacute;tica en Salud, Est&aacute;ndares y Interoperabilidad 2016</h2>\r\nEste a&ntilde;o estamos implementando el programa, como un plan de estudios anuales en temas avanzados y con un enfoque pr&aacute;ctico. Como es sabido, nuestras clases son se dan en l&iacute;nea pero&nbsp;en vivo y en directo (no se basa en ver videos pre-grabados), y cuentan con el respaldo de profesionales con amplia experiencia en el &aacute;rea.<br /><br />Aqu&iacute; pueden encontrar la&nbsp;<a title=\\\"programa de formaci&oacute;n 2016\\\" href=\\\"http://www.cabolabs.com/educacion/programa_2016.pdf\\\" target=\\\"_blank\\\">informaci&oacute;n sobre el programa</a>. Incluye listas de espera para los cursos y talleres que estaremos brindando hasta fin de a&ntilde;o.<br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-07-20 03:14:02', 'NewsLetter', 0),
(24, 'Curso Presencial de ImplementaciÃ³n de SIS con openEHR Inscripciones Abiertas', '<div align=\\\"center\\\">\r\n<div style=\\\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\\\">\r\n<table style=\\\"width: 100%;\\\" border=\\\"0\\\" cellpadding=\\\"10\\\">\r\n<tbody>\r\n<tr>\r\n<td style=\\\"color: #fff; background-color: #23337e;\\\"><a href=\\\"http://openehr.org.es\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\\\" border=\\\"0\\\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #fff;\\\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Inscripciones abiertas al Primer Curso Presencial de Implementaci&oacute;n de Sistemas de Informaci&oacute;n con openEHR</h2>\r\nEstimados,<br /><br />Ya est&aacute; confirmado y las inscripciones est&aacute;n abiertas.<strong> Los lugares son limitados, confirmen su inscripci&oacute;n con tiempo.</strong><br /><br />Ser&aacute; del <strong>5 al 9 de Septiembre de 2016</strong>, en <span style=\\\"font-family: inherit;\\\">Av. Independencia 1027, Independencia, <strong>Santiago, Chile</strong>.</span> (<span style=\\\"font-family: inherit;\\\">BNI, Facultad de Medicina, Universidad de Chile)<br /></span><br /><br />Toda la informaci&oacute;n del curso est&aacute; aqu&iacute;: <a href=\\\"http://informatica-medica.blogspot.com.uy/2016/07/primer-curso-presencial-de.html\\\" target=\\\"_blank\\\">http://informatica-medica.blogspot.com.uy/2016/07/primer-curso-presencial-de.html</a><br style=\\\"background-color: #fff;\\\" /><br />Y aqu&iacute; la versi&oacute;n en PDF: <a href=\\\"http://www.cabolabs.com/educacion/brochure_curso_implementacion_de_sis_openehr.pdf\\\" target=\\\"_blank\\\">http://www.cabolabs.com/educacion/brochure_curso_implementacion_de_sis_openehr.pdf</a><br /><br /><br />Les agradecemos la difusi&oacute;n entre sus contactos.<br /><br />&iexcl;Nos vemos en Chile!<br />\r\n<div><br /><br /><br />\r\n<h2>Programa de Formaci&oacute;n Profesional en Inform&aacute;tica en Salud, Est&aacute;ndares y Interoperabilidad 2016</h2>\r\nEste a&ntilde;o estamos implementando el programa, como un plan de estudios anuales en temas avanzados y con un enfoque pr&aacute;ctico. Como es sabido, nuestras clases se dan en l&iacute;nea y son en vivo y en directo (no se basa en ver videos pre-grabados), y cuentan con el respaldo de profesionales con amplia experiencia en el &aacute;rea.<br /><br />Aqu&iacute; pueden encontrar la&nbsp;<a title=\\\"programa de formaci&oacute;n 2016\\\" href=\\\"http://www.cabolabs.com/educacion/programa_2016.pdf\\\" target=\\\"_blank\\\">informaci&oacute;n sobre el programa</a>. Incluye listas de espera para los cursos y talleres que estaremos brindando hasta fin de a&ntilde;o.<br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\">LinkedIn</a>, una p&aacute;gina en <a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\">Facebook</a>, y una cuenta en <a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\">Twitter</a>.<br /><br />\r\n<table align=\\\"center\\\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\\\"http://www.linkedin.com/groups?about=&amp;gid=4347256\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en LinkedIn\\\" /></a></strong></td>\r\n<td><strong><a href=\\\"http://www.facebook.com/openEHR\\\" target=\\\"_blank\\\"><img src=\\\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\\\" border=\\\"0\\\" alt=\\\"openEHR en espa&ntilde;ol en Facebook\\\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\\\"https://twitter.com/#!/openehr_org_es\\\" target=\\\"_blank\\\"><img src=\\\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\\\" border=\\\"0\\\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\\\"background-color: #23337e; color: #fff;\\\"><span style=\\\"color: #ffffff;\\\"><a href=\\\"mailto:pablo@openehr.org.es\\\"><span style=\\\"color: #ffffff;\\\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-07-31 00:57:57', 'NewsLetter', 0),
(25, 'Mirth Workshop 2016-2 y CDA', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 758px; height: 702px;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Pr&oacute;xima edici&oacute;n del taller de Interoperabilidad con Mirth Connect y HL7</h2>\r\n<div class=\"_1mf _1mj\" data-offset-key=\"c28bu-0-0\"><span data-offset-key=\"c28bu-0-0\"><span data-text=\"true\">Debido al &eacute;xito del Taller de Interoperabilidad con Mirth Connect y HL7 es probable que haya una edici&oacute;n pronto, est&aacute;s interesado? Reg&iacute;strate en nuestra lista de espera: <a href=\"http://www.cabolabs.com/es/capacitacion\" target=\"_blank\">http://www.cabolabs.com/es/capacitacion</a></span></span></div>\r\n<div>\r\n<div><span>&nbsp;</span></div>\r\n</div>\r\n<div>\r\n<div><span><span>Adem&aacute;s, creamos un grupo para hablar de Mirth Connect en espa&ntilde;ol, compartir informaci&oacute;n y recursos: <a href=\"https://www.linkedin.com/groups/12011965\" target=\"_blank\">https://www.linkedin.com/groups/12011965</a></span></span></div>\r\n</div>\r\n<div>\r\n<div><span>&nbsp;</span></div>\r\n</div>\r\n<div>\r\n<div><span><span>Tambi&eacute;n en Facebook: <a href=\"https://www.facebook.com/groups/mirth.connect\" target=\"_blank\">https://www.facebook.com/groups/mirth.connect</a></span></span></div>\r\n</div>\r\n<br /><br />\r\n<h2>Workshop de HL7 CDA</h2>\r\n<p><span data-text=\"true\">Dentro de muy poco abriremos las inscripciones para el workshop de CDA. Puedes encontrar el programa y reg&iacute;strate en nuestra lista de espera: <a href=\"http://www.cabolabs.com/es/capacitacion\" target=\"_blank\">http://www.cabolabs.com/es/capacitacion</a></span><br /><br />Aqu&iacute; veremos desde el modelo de documentos cl&iacute;nicos de HL7, hasta c&oacute;digo para crear, procesar y validar documentos.<br /><br /><br /></p>\r\n<h2>Programa de Formaci&oacute;n Profesional en Inform&aacute;tica en Salud, Est&aacute;ndares y Interoperabilidad 2016</h2>\r\n<p>Este a&ntilde;o estamos implementando el programa, como un plan de estudios anuales en temas avanzados y con un enfoque pr&aacute;ctico. Como es sabido, nuestras clases se dan en l&iacute;nea y son en vivo y en directo (no se basa en ver videos pre-grabados), y cuentan con el respaldo de profesionales con amplia experiencia en el &aacute;rea.<br /><br />Aqu&iacute; pueden encontrar la&nbsp;<a title=\"programa de formaci&oacute;n 2016\" href=\"http://www.cabolabs.com/educacion/programa_2016.pdf\" target=\"_blank\">informaci&oacute;n sobre el programa</a>. Incluye listas de espera para los cursos y talleres que estaremos brindando hasta fin de a&ntilde;o.<br /><br /><br /></p>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\" border=\"0\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-11-02 15:37:02', 'NewsLetter', 0),
(26, 'CDA y recordatorio Mirth 2', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Inscripciones abiertas al Primer Workshop de Dise&ntilde;o e Implementaci&oacute;n de Documentos Cl&iacute;nicos HL7 CDA</h2>\r\nEstimados,<br /><br />Abrimos las inscripciones al primer taller de CDA de <a href=\"http://achisa.org/\" target=\"_blank\">ACHISA</a> y <a href=\"http://cabolabs.com/es\" target=\"_blank\">CaboLabs</a>. <strong>Se recibir&aacute;n inscripciones hasta el 5 de Diciembre de 2016.</strong><br /> <br /> En el formulario de inscripci&oacute;n est&aacute; la informaci&oacute;n de los valores del taller y m&eacute;todos de pago. <br /> <br /> <strong>Formulario de Inscripci&oacute;n: <a href=\"https://goo.gl/forms/Id62OpbG4jtgyeY52\">https://goo.gl/forms/Id62OpbG4jtgyeY52<br /><br /><br /></a></strong>M&aacute;s informaci&oacute;n: <a href=\"https://informatica-medica.blogspot.com.uy/2016/11/workshop-documentos-clinicos-cda.html\" target=\"_blank\">https://informatica-medica.blogspot.com.uy/2016/11/workshop-documentos-clinicos-cda.html</a><br />\r\n<div><br /><br /><br />\r\n<h2>Inscripciones al Workshop de Interoperabilidad con Mirth Connect y HL7 pr&oacute;ximas a cerrar</h2>\r\nComenzamos la semana que viene y <strong>se recibir&aacute;n inscripciones hasta el Jueves 24 de Noviembre.</strong><br /><br />M&aacute;s informaci&oacute;n: <a href=\"https://informatica-medica.blogspot.com.uy/2016/11/workshop-de-interoperabilidad-con-mirth.html\" target=\"_blank\">https://informatica-medica.blogspot.com.uy/2016/11/workshop-de-interoperabilidad-con-mirth.html</a><br /><br /><br /><br />\r\n<h2>Repositorio de Informaci&oacute;n Cl&iacute;nica openEHR de c&oacute;digo abierto, pronto en la nube</h2>\r\nLuego de 4 a&ntilde;os de desarrollo, estamos listos para el pr&oacute;ximo paso: ofrecer un servicio en la nube para almacenar y consultar datos cl&iacute;nicos, utilizando el est&aacute;ndar openEHR. Pronto habr&aacute;n m&aacute;s novedades, si quieres saber m&aacute;s: <a href=\"https://cloudehrserver.com/\" target=\"_blank\">https://cloudehrserver.com/</a><br /><br />M&aacute;s informaci&oacute;n sobre el proyecto: <a href=\"http://www.cabolabs.com/es/proyectos\" target=\"_blank\">http://www.cabolabs.com/es/proyectos<br /></a><br />En Twitter: <a href=\"https://twitter.com/CloudEHRServer\" target=\"_blank\">https://twitter.com/CloudEHRServer</a><br /><br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\" border=\"0\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-11-22 15:23:16', 'NewsLetter', 0),
(27, 'Inicio de cursos 2017', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Inscripciones abiertas: Curso de DIse&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR 3era ed.</h2>\r\nEstimados,<br /><br />Abrimos las inscripciones al curso de Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR de <a href=\"http://achisa.org/\" target=\"_blank\">ACHISA</a> y <a href=\"http://cabolabs.com/es\" target=\"_blank\">CaboLabs</a>. <strong>Se recibir&aacute;n inscripciones hasta el 5 de Abril de 2017.</strong><br /> <br /> En el formulario de inscripci&oacute;n est&aacute; la informaci&oacute;n de los valores del taller y m&eacute;todos de pago. <br /> <br /> <strong><a href=\"http://goo.gl/forms/v4sXzg3hGT\" target=\"_blank\">Formulario de Inscripci&oacute;n</a><a href=\"https://goo.gl/forms/Id62OpbG4jtgyeY52\"><br /><br /><br /></a></strong>M&aacute;s informaci&oacute;n: <a href=\"http://informatica-medica.blogspot.com.uy/2017/03/diseno-e-implementacion-de-bases-de.html\" target=\"_blank\">http://informatica-medica.blogspot.com.uy/2017/03/diseno-e-implementacion-de-bases-de.html</a><br />\r\n<div><br /><br />\r\n<h2>Programaci&oacute;n de cursos para 2017</h2>\r\nHemos planificado dictar cuatro cursos y dos talleres online par 2017, estos conforman el Programa de Formaci&oacute;n Profesional de Sistemas de Informaci&oacute;n en Salud, Est&aacute;ndares e Interoperabilidad.<br /><ol>\r\n<li><span class=\"ember-view\"><span>Curso de Dise&ntilde;o e implementaci&oacute;n de bases de datos cl&iacute;nicas con openEHR</span></span></li>\r\n<li><span class=\"ember-view\"><span>Curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud</span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Interoperabilidad con Mirth Connect y HL7</span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Dise&ntilde;o e Implementaci&oacute;n de Documentos Cl&iacute;nicos HL7 CDA</span></span></li>\r\n<li><span class=\"ember-view\"><span>Curso de Fundamentos e Implementaci&oacute;n de openEHR</span></span></li>\r\n<li><span class=\"ember-view\"><span>Curso de Modelado de Informaci&oacute;n Cl&iacute;nica con openEHR y Arquetipos</span></span></li>\r\n</ol><br />Adem&aacute;s ofreceremos los siguientes cursos y talleres on-site para empresas e instituciones que los soliciten:<br /><ol>\r\n<li><span class=\"ember-view\"><span> Curso de Implementaci&oacute;n de Sistemas de Informaci&oacute;n en Salud con openEHR</span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Interoperabilidad con Mirth Connect y HL7</span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Dise&ntilde;o e Implementaci&oacute;n de Documentos Cl&iacute;nicos HL7 CDA</span></span></li>\r\n<li><span class=\"ember-view\"><span>Capacitaci&oacute;n para Implementaci&oacute;n y Gesti&oacute;n de Repositorios de Informaci&oacute;n Cl&iacute;nica con EHRServer</span></span></li>\r\n</ol><br />Aqu&iacute; podr&aacute;s encontrar m&aacute;s informaci&oacute;n de los cursos y las listas de esperas, donde te puedes registrar para recibir novedades de cada curso: <a href=\"http://cabolabs.com/es/capacitacion\" target=\"_blank\">http://cabolabs.com/es/capacitacion</a><br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"http://www.dreig.eu/caparazon/wp-content/twitter-icon-32x32.png\" border=\"0\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2017-03-17 16:58:55', 'NewsLetter', 0),
(28, 'Curso Mirth 2017 y prÃ³ximos cursos', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>Inscripciones abiertas: Taller de Interoperabilidad con Mirth Connect y HL7 3era ed.</h2>\r\nEstimados,<br /><br />Abrimos las inscripciones al Taller de Mirth Connect de <a href=\"http://achisa.org/\" target=\"_blank\">ACHISA</a> y <a href=\"http://cabolabs.com/es\" target=\"_blank\">CaboLabs</a>. <strong>Se recibir&aacute;n inscripciones hasta el 26 de Abril de 2017. Comienza el 2 de Mayo.</strong><br /> <br /> En el formulario de inscripci&oacute;n est&aacute; la informaci&oacute;n de los valores del taller y m&eacute;todos de pago. <br /> <br /> <strong><a href=\"https://goo.gl/forms/sLuFOxUZn4nKj7mC2\" target=\"_blank\">Formulario de Inscripci&oacute;n</a><a href=\"https://goo.gl/forms/Id62OpbG4jtgyeY52\"><br /><br /><br /></a></strong>M&aacute;s informaci&oacute;n: <a href=\"http://informatica-medica.blogspot.com.uy/2017/04/taller-de-interoperabilidad-con-mirth.html\" target=\"_blank\">http://informatica-medica.blogspot.com.uy/2017/04/taller-de-interoperabilidad-con-mirth.html</a><br />\r\n<div><br />Este jueves haremos una charla online donde presentaremos el taller y podr&aacute;n hacer todas sus consultas, ser&aacute; <a href=\"https://www.youtube.com/watch?v=v-A77F6TdCY\" target=\"_blank\">aqu&iacute; por YouTube</a>. <br /><br /><br />Este taller vuelca nuestra experiencia de trabajo con Mirth Connect desde 2007, en un taller pr&aacute;ctico orientado a inform&aacute;ticos, veremos c&oacute;digo y haremos pruebas en vivo. Las clases ser&aacute;n en vivo y en directo (no grabadas) pero quedar&aacute;n disponibles las grabaciones una vez terminada clada sesi&oacute;n. Los materiales y el foro para consultas estar&aacute;n disponibles en el <a href=\"http://www.achisa.cl/campus2/\" target=\"_blank\">Campus Virtual de ACHISA</a>.<br /><br /><br />\r\n<h2>Programaci&oacute;n de cursos para 2017</h2>\r\nHemos planificado dictar cuatro cursos y dos talleres online par 2017, estos conforman el Programa de Formaci&oacute;n Profesional de Sistemas de Informaci&oacute;n en Salud, Est&aacute;ndares e Interoperabilidad.<br /><ol>\r\n<li><span class=\"ember-view\"><span>Curso de Dise&ntilde;o e implementaci&oacute;n de bases de datos cl&iacute;nicas con openEHR <strong>(en curso)</strong><br /></span></span></li>\r\n<li><span class=\"ember-view\"><span>Curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud <strong>(comienzo en Julio)</strong><br /></span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Interoperabilidad con Mirth Connect y HL7 <span style=\"background-color: #ffff99;\"><strong>(comienza el 2 de Mayo, INSCRIPCIONES ABIERTAS)</strong></span><br /></span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Dise&ntilde;o e Implementaci&oacute;n de Documentos Cl&iacute;nicos HL7 CDA <strong>(programado para Septiembre)</strong><br /></span></span></li>\r\n<li><span class=\"ember-view\"><span>Curso de Fundamentos e Implementaci&oacute;n de openEHR<strong> (programado para Octubre)</strong><br /></span></span></li>\r\n<li><span class=\"ember-view\"><span>Curso de Modelado de Informaci&oacute;n Cl&iacute;nica con openEHR y Arquetipos<strong> (programado para Noviembre)</strong><br /></span></span></li>\r\n</ol>Aqu&iacute; podr&aacute;s encontrar m&aacute;s informaci&oacute;n de los cursos y las listas de esperas, donde te puedes registrar para recibir novedades de cada curso: <a href=\"http://cabolabs.com/es/capacitacion\" target=\"_blank\">http://cabolabs.com/es/capacitacion<br /><br /></a><br />Adem&aacute;s ofreceremos los siguientes cursos y talleres on-site para empresas e instituciones que los soliciten:<br /><ol>\r\n<li><span class=\"ember-view\"><span> Curso de Implementaci&oacute;n de Sistemas de Informaci&oacute;n en Salud con openEHR</span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Interoperabilidad con Mirth Connect y HL7</span></span></li>\r\n<li><span class=\"ember-view\"><span>Taller de Dise&ntilde;o e Implementaci&oacute;n de Documentos Cl&iacute;nicos HL7 CDA</span></span></li>\r\n<li><span class=\"ember-view\"><span>Capacitaci&oacute;n para Implementaci&oacute;n y Gesti&oacute;n de Repositorios de Informaci&oacute;n Cl&iacute;nica con EHRServer</span></span></li>\r\n</ol><br /><br />\r\n<h2>Repositorio de Datos Cl&iacute;nicos de C&oacute;digo Abierto, ahora como Servicio en la Nube</h2>\r\nPara quienes no han seguido el desarrollo, hace 4 a&ntilde;os comenzamos con peque&ntilde;as pruebas de concepto con la idea de crear una soluci&oacute;n de almacenamiento de datos cl&iacute;nicos gen&eacute;rica y que cumpliera con el est&aacute;ndar openEHR. Pasado el tiempo logramos un producto de c&oacute;digo abierto, que hoy puede ser usado tambi&eacute;n en la nube. Visita <a href=\"http://cloudehrserver.com/\" target=\"_blank\">http://cloudehrserver.com/</a> para m&aacute;s informaci&oacute;n.<br /><br />Estamos buscando personas, empresas y otras organizaciones que deseen participar en el proyecto y apoyarlo. Es por eso que creamos el Programa de Beta Partners, donde a cambio de su contributi&oacute;n reciben transferencia de conocimiento, soporte premium y descuentos en nuestros cursos.<br /><br />M&aacute;s informaci&oacute;n sobre el Programa de Beta Partners: <a href=\"https://cloudehrserver.com/beta_partners_program\" target=\"_blank\">https://cloudehrserver.com/beta_partners_program</a><br /><br />En <a href=\"http://informatica-medica.blogspot.com.uy/2017/01/cloudehrserver-de-poc-saas.html\" target=\"_blank\">este art&iacute;culo</a> puedes leer m&aacute;s acerca de la historia del EHRServer y de c&oacute;mo se transform&oacute; en SaaS.<br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2017-04-18 06:22:34', 'NewsLetter', 0);
INSERT INTO `cms_notifs_newsletter` (`id`, `name`, `content`, `createdOn`, `class`, `deleted`) VALUES
(29, 'CaboLabs: cursos y eventos 2017', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>1. Curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud 4ta ed. (HL7, DICOM, openEHR)</h2>\r\nPr&oacute;ximo curso de interoperabilidad entre sistemas de informaci&oacute;n en salud comienza el pr&oacute;ximo 10 de Julio. Plazo para inscribirse hasta en 5 de Julio.<br /><br />Orientaci&oacute;n pr&aacute;ctica, 100% online, 4 sesiones de clase en vivo.<br /><br />M&aacute;s informaci&oacute;n <a href=\"https://www.achisa.cl/2017/06/29/curso-de-interoperabilidad-entre-sistemas-de-informacion-en-salud-4ta-ed/\" rel=\"nofollow\" target=\"_blank\">https://www.achisa.cl/2017/06/29/curso-de-interoperabilidad-entre-sistemas-de-informacion-en-salud-4ta-ed/</a><br />\r\n<div><br /><a style=\"color: #2baadf; font-weight: normal; text-decoration: underline;\" href=\"http://goo.gl/forms/9i9OrhkfmUFL8zHY2\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://goo.gl/forms/9i9OrhkfmUFL8zHY2&amp;source=gmail&amp;ust=1498864201781000&amp;usg=AFQjCNFw2-yoIA2FyA6WJoEUqR88WHbgVA\">Inscripci&oacute;n</a> | <a style=\"color: #2baadf; font-weight: normal; text-decoration: underline;\" href=\"http://cabolabs.com/capacitacion/interoperabilidad/ISIS_programa_master.pdf\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://cabolabs.com/capacitacion/interoperabilidad/ISIS_programa_master.pdf&amp;source=gmail&amp;ust=1498864201781000&amp;usg=AFQjCNGBLqavXi3YJ1Gc3u9ssrz-N7WZsw\">Programa</a><br /> <br /> <span>Consultas: <a href=\"mailto:info@cabolabs.com\" target=\"_blank\">info@cabolabs.com</a></span><br /><br />\r\n<h2>2. Pr&oacute;ximos cursos y talleres</h2>\r\n<span><span>En nuestra <a style=\"color: #2baadf; font-weight: normal; text-decoration: underline;\" href=\"https://www.cabolabs.com/es/educacion\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://www.cabolabs.com/es/educacion&amp;source=gmail&amp;ust=1498864201781000&amp;usg=AFQjCNGVq2TmQBiRdmRepSwKYaICpPTBrw\">p&aacute;gina de educaci&oacute;n</a> encontrar&aacute;s informaci&oacute;n de nuestros cursos y talleres. An&oacute;tate en las listas de espera y recibir&aacute;s notificaciones cuando las inscripciones est&eacute;n abiertas.</span></span><br /><br />\r\n<h2>3. Eventos</h2>\r\nEste a&ntilde;o estaremos visitando Chile y Argentina, apoyando eventos de formaci&oacute;n y difusi&oacute;n en temas de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad.<br /> <br /> <strong>Simposio Chileno de Inform&aacute;tica en Salud ISChile III</strong><br /> <br /> 29 y 30 de Septiembre de 2017<br /> <br /> M&aacute;s informaci&oacute;n: <a style=\"color: #2baadf; font-weight: normal; text-decoration: underline;\" href=\"http://www.ischile.org/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.ischile.org/&amp;source=gmail&amp;ust=1498864201781000&amp;usg=AFQjCNFDLgu1ARSNcchQ7f42hELJEPUDsg\">http://www.ischile.org/</a><br /> <br /> <br /> <strong>Jornadas de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires 2017</strong><br /> <br /> Actividades previas: 13 y 14 de Noviembre de 2017<br /> Jornadas 15, 16 y 17 de Noviembre de 2017<br /> <br /> Pronto habr&aacute; m&aacute;s informaci&oacute;n disponible.<br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2017-06-29 20:12:03', 'NewsLetter', 0),
(30, 'Nuevas especificaciones de openEHR', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>1. Nuevas especificaciones de openEHR</h2>\r\nopenEHR ha estado trabajando de forma activa en los &uacute;ltimos 2 a&ntilde;os para actualizar las especificaciones y proveer m&aacute;s y mejores herramientas para facilitar la implementaci&oacute;n.<br /><br />En los &uacute;ltimos meses se ha progresado mucho en cuanto a la correcci&oacute;n y actualizaci&oacute;n de la norma, y en paralelo se han definido varios elemento que ayudan a implementarla llamados ITS (Implementation Technology Specification), que incluyen: APIs REST, representaciones XML y JSON para intercambio de datos entre sistemas openEHR, reglas para soporte a la toma de decisiones, entre otras.<br /><br />Dentro de la norma, se agregaron las definiciones de reglas para soporte a la toma de decisiones, la especificaci&oacute;n para definici&oacute;n y seguimiento de tareas (aplica a medicaci&oacute;n, procedimientos, estudios, etc.), y el lenguaje de consulta de historias cl&iacute;nicas electr&oacute;nicas basadas en openEHR (Archetype Query Language).<br /><br />Ya con la especificaci&oacute;n de la API REST y las representaciones XML y JSON se abre un mundo de posibilidades para el desarrollo e integraci&oacute;n de nuevos sistemas de informaci&oacute;n en salud. A esto se le agrega la mayor disponibilidad de herramientas de c&oacute;digo abierto y un mayor n&uacute;mero de implementaciones a nivel mundial, lo que facilita que quienes dudaban en implementar el est&aacute;ndar, ahora puedan hacerlo con seguridad.<br /><br />En una semana tenemos la reuni&oacute;n del comit&eacute; de especificaciones de openEHR, donde se esperan aprobar varias de las nuevas especificaciones. &iexcl;Estar&eacute; publicando novedades en breve!<br style=\"background-color: #fff;\" />\r\n<div><span><span></span></span><br /><br />\r\n<h2>2. Eventos</h2>\r\nEste a&ntilde;o estaremos visitando Chile y Argentina, apoyando eventos de formaci&oacute;n y difusi&oacute;n en temas de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad.<br /> <br /> <strong>Simposio Chileno de Inform&aacute;tica en Salud ISChile III</strong><br /> <br /> Ser&aacute; los ias 29 y 30 de Septiembre de 2017<br /> <br /> M&aacute;s informaci&oacute;n: <a style=\"color: #2baadf; font-weight: normal; text-decoration: underline;\" href=\"http://www.ischile.org/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.ischile.org/&amp;source=gmail&amp;ust=1498864201781000&amp;usg=AFQjCNFDLgu1ARSNcchQ7f42hELJEPUDsg\">http://www.ischile.org/<br /><br /></a>El d&iacute;a 28 de Septiembre estar&eacute; brindando el Taller de Interoperabilidad con Mirth Connect y HL7 como taller pre-simposio.<br /><br />M&aacute;s informaci&oacute;n: <a href=\"http://www.ischile.org/taller1.html\" target=\"_blank\">http://www.ischile.org/taller1.html</a><br /> <br /> <br /> <strong>Jornadas de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires 2017</strong><br /> <br /> Actividades previas: 13 y 14 de Noviembre de 2017<br /> Jornadas 15, 16 y 17 de Noviembre de 2017<br /> <br /> Pronto habr&aacute; m&aacute;s informaci&oacute;n disponible.<br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2017-08-18 20:45:08', 'NewsLetter', 0),
(31, 'Workshops 2018 II', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>1. Workshop de Interoperabilidad con Mirth Connect y HL7</h2>\r\n<p><strong>Del 14 de Mayo al 3 de Junio de 2018. Organizan&nbsp;<a href=\"https://www.achisa.cl/\" target=\"_blank\">ACHISA</a>&nbsp;y&nbsp;<a href=\"http://www.cabolabs.com/\" target=\"_blank\">CaboLabs</a>.</strong><br /><br />Abrimos las inscripciones a la 5ta edici&oacute;n online del Taller de Interoperabilidad con Mirth Connect y HL7.&nbsp;<strong>Se recibir&aacute;n inscripciones hasta el 13 de Mayo de 2018.</strong></p>\r\n<p>&iexcl;Actualizamos el taller a la &uacute;ltima versi&oacute;n de Mirth 3.5.2!</p>\r\n<p><br />El objetivo del taller es ganar experiencia r&aacute;pidamente en el uso de Mirth Connect en distintos escenario de interoperabilidad de informaci&oacute;n en salud, incluyendo casos de intercambio de datos con est&aacute;ndares HL7 y DICOM.<br /><br />Este es el primer taller de Mirth Connect en Espa&ntilde;ol y es brindado desde 2014 por CaboLabs en modalidades presenciales y online. Para el dise&ntilde;o del taller ha volcado la experiencia de haber trabajado con Mirth Connect por casi 10 a&ntilde;os (&iexcl;comenzamos a usarlo en 2007!), y toda la experiencia de CaboLabs en las &aacute;reas de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad.<br /><br /><strong>El taller comenzar&aacute; el 14 de Mayo de 2018. Las sesiones virtuales sincr&oacute;nicas ser&aacute;n los d&iacute;as d&iacute;as 15, 22 y 29 de Mayo. Tendr&aacute;n una duraci&oacute;n aproximada de entre 2 horas (incluye espacio para consultas).</strong><br /><br />En el Formulario de Inscripci&oacute;n encontrar&aacute;s las instrucciones para realizar el pago y as&iacute; confirmar tu inscripci&oacute;n. Si tienes alguna duda, consulta en&nbsp;<a href=\"mailto:info@cabolabs.com\">info@cabolabs.com</a>&nbsp;<br /><br /><strong>Formulario de inscripci&oacute;n:&nbsp;<a href=\"https://goo.gl/forms/sLuFOxUZn4nKj7mC2\" target=\"_blank\">https://goo.gl/forms/sLuFOxUZn4nKj7mC2</a>&nbsp;</strong><br /><br />En el taller veremos:&nbsp;</p>\r\n<ol>\r\n<li>Instalaci&oacute;n y configuraci&oacute;n de Mirth Connect</li>\r\n<li>Introducci&oacute;n a protocolos de comunicaci&oacute;n</li>\r\n<li>Introducci&oacute;n al est&aacute;ndar HL7 v2.x (mensajer&iacute;a)</li>\r\n<li>Introducci&oacute;n al est&aacute;ndar HL7 CDA (documentos cl&iacute;nicos XML)</li>\r\n<li>Componentes de Mirth Connect</li>\r\n<li>Arquitectura de Canales Mirth Connect</li>\r\n<li>Scripts globales y de canal</li>\r\n<li>Plantillas de c&oacute;digo</li>\r\n<li>Integraci&oacute;n de c&oacute;digo Java</li>\r\n<li>M&aacute;s de 15 actividades pr&aacute;cticas de comunicaci&oacute;n entre sistemas de salud con Mirth Connect</li>\r\n</ol>\r\n<p><br />Programa completo del Taller de Interoperabilidad con Mirth Connect y HL7:&nbsp;<a href=\"https://cabolabs.com/capacitacion/mirth_connect/programa_workshop_mirth_connect_hl7.pdf\" target=\"_blank\">https://cabolabs.com/capacitacion/mirth_connect/programa_workshop_mirth_connect_hl7.pdf</a>&nbsp;<br /><br /><strong>Se emitir&aacute;n certificados para todos los participantes.</strong><br /><br /><br />M&aacute;s informaci&oacute;n:&nbsp;<a href=\"http://informatica-medica.blogspot.com.uy/2018/04/taller-de-interoperabilidad-con-mirth.html\" target=\"_blank\">http://informatica-medica.blogspot.com.uy/2018/04/taller-de-interoperabilidad-con-mirth.html</a><br /><br />Consultas:&nbsp;<a href=\"mailto:info@cabolabs.com\">info@cabolabs.com</a></p>\r\n<div><br />\r\n<h2>2. Workshop de Dise&ntilde;o e Implementaci&oacute;n de Documentos Cl&iacute;nicos HL7 CDA</h2>\r\n<strong>Del 28 de Mayo al 17 de Junio de 2018. Organizan&nbsp;<a href=\"https://www.achisa.cl/\" target=\"_blank\">ACHISA</a>&nbsp;y&nbsp;<a href=\"https://cabolabs.com/\" target=\"_blank\">CaboLabs</a>.</strong><br /><br /><span>Abrimos las inscripciones a la cuarta edici&oacute;n online del Workshop de dise&ntilde;o e implementaci&oacute;n de documentos cl&iacute;nicos HL7 CDA.&nbsp;</span><strong>Se recibir&aacute;n inscripciones hasta el 27 de Mayo de 2018.</strong><br /><br /><span>El objetivo del workshop es ganar experiencia en la implementaci&oacute;n de documentos cl&iacute;nicos CDA, comprendiendo su modelo, el formato en XML, el proceso de dise&ntilde;o de documentos cl&iacute;nicos reales, la creaci&oacute;n y uso de gu&iacute;as de implementaci&oacute;n, entre otros elementos. Haremos foco en las pr&aacute;cticas y compartiremos c&oacute;digo que te permitir&aacute; ejecutar las pruebas en tu m&aacute;quina.</span><br /><br /><strong>El comienzo ser&aacute; el 28 de Mayo de 2018. Las sesiones de clase virtuales sincr&oacute;nicas ser&aacute;n los d&iacute;as 31 de Mayo, 7 y 14 de Junio de 2018.</strong><br /><br /><span>En el Formulario de Inscripci&oacute;n encontrar&aacute;s las instrucciones para realizar el pago y as&iacute; confirmar tu inscripci&oacute;n. Si tienes alguna duda, consulta en&nbsp;</span><a href=\"mailto:info@cabolabs.com\">info@cabolabs.com</a><br /><br /><span>Formulario de Inscripci&oacute;n:&nbsp;</span><a href=\"https://goo.gl/forms/Id62OpbG4jtgyeY52\" target=\"_blank\">https://goo.gl/forms/Id62OpbG4jtgyeY52</a><br /><br /><span>Resumen de temas:</span>\r\n<ul>\r\n<li>Introducci&oacute;n a los modelos RIM y CDA</li>\r\n<li>Proceso de dise&ntilde;o de documentos cl&iacute;nicos</li>\r\n<li>Trabajando con CDA en software: generaci&oacute;n, validaci&oacute;n, procesamiento y visualizaci&oacute;n</li>\r\n<li>Trabajando con Gu&iacute;as de Implementaci&oacute;n</li>\r\n<li>Trabajando con Terminolog&iacute;as y OIDs</li>\r\n</ul>\r\n<span>En nuestra&nbsp;</span><a href=\"https://cabolabs.com/es/educacion\" target=\"_blank\">p&aacute;gina de educaci&oacute;n</a><span>&nbsp;se encuentra el programa completo.</span><br /><br /><strong>Se emitir&aacute;n certificados para todos los participantes.</strong><br /><br /><br /><span>M&aacute;s informaci&oacute;n:&nbsp;</span><a href=\"http://informatica-medica.blogspot.com.uy/2018/04/workshop-de-documentos-clinicos-cda.html\" target=\"_blank\">http://informatica-medica.blogspot.com.uy/2018/04/workshop-de-documentos-clinicos-cda.html</a><br /><br /><span>Consultas:&nbsp;</span><a href=\"mailto:info@cabolabs.com\">info@cabolabs.com</a><br /><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2018-05-05 17:39:23', 'NewsLetter', 0),
(32, 'Cursos semestre 2 2018 y eventos', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>1. Nuevo Curso de Modelado de Informaci&oacute;n Cl&iacute;nica con openEHR</h2>\r\n<p><strong>Del 13 de Agosto al 9 de Septiembre de 2018. Organizan <a href=\"https://www.achisa.cl/\">ACHISA</a> y <a href=\"https://www.cabolabs.com/\">CaboLabs</a>.</strong></p>\r\n<div dir=\"ltr\">Abrimos las inscripciones a la primera edici&oacute;n online del Curso de Modelado de Informaci&oacute;n Cl&iacute;nica con Arquetipos openEHR.<strong> Se recibir&aacute;n inscripciones hasta el 12 de Agosto de 2018.</strong><br /><br /></div>\r\n<div dir=\"ltr\">El objetivo del curso es ganar experiencia en el Modelado de Informaci&oacute;n Cl&iacute;nica para los sistemas de informaci&oacute;n, utilizando la metodolog&iacute;a formal propuesta por el est&aacute;ndar openEHR, basada en Arquetipos y Plantillas. Utilizaremos herramientas de modelado para crear nuestros propios Arquetipos y Plantillas, y veremos todos los pasos necesarios para crear modelos para utilizarlos en software.<br /><br /></div>\r\n<div dir=\"ltr\">Este es el primer curso de Modelado de Informaci&oacute;n Cl&iacute;nica en Espa&ntilde;ol, que se brinda 100% online. Este curso complementa los otros cursos dise&ntilde;ados por CaboLabs sobre openEHR, como el curso de Fundamentos de openEHR, Dise&ntilde;o de bases de datos cl&iacute;nicas openEHR, y el curso de Implementaci&oacute;n de Sistemas de Informaci&oacute;n en Salud con openEHR (m&aacute;s info: <a href=\"https://www.cabolabs.com/es/educacion\">https://www.cabolabs.com/es/educacion</a>). En CaboLabs contamos con m&aacute;s de 12 a&ntilde;os trabajando con el est&aacute;ndar openEHR.<br /><br /></div>\r\n<div dir=\"ltr\">El curso comenzar&aacute; el 13 de Agosto de 2018. Las sesiones virtuales sincr&oacute;nicas ser&aacute;n los d&iacute;as 14, 21, 28 de Agosto y 4 de Septiembre. Tendr&aacute;n una duraci&oacute;n aproximada de entre 2 horas (incluye espacio para consultas).<br /><br /></div>\r\n<div dir=\"ltr\">En el Formulario de Inscripci&oacute;n encontrar&aacute;s las instrucciones para realizar el pago y as&iacute; confirmar tu inscripci&oacute;n. Si tienes alguna duda, consulta en <a href=\"mailto:info@cabolabs.com\">info@cabolabs.com</a></div>\r\n<p>&nbsp;</p>\r\n<div dir=\"ltr\">Formulario de inscripci&oacute;n: <a href=\"https://goo.gl/forms/WRRXWlTDbX1bcqWL2\">https://goo.gl/forms/WRRXWlTDbX1bcqWL2</a></div>\r\n<p>&nbsp;</p>\r\n<div dir=\"ltr\">Resumen de tema:</div>\r\n<ul>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Mapas mentales y UML como t&eacute;cnicas de an&aacute;lisis y modelado</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Rol del modelador cl&iacute;nico en proyectos de sistemas de informaci&oacute;n en salud</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Modelo de informaci&oacute;n de openEHR</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Proceso de modelado de arquetipos</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Clasificaci&oacute;n de conceptos cl&iacute;nicos</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Herramienta: Clinical Knowledge Manager</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Herramienta: Archetype Editor</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Actividades de creaci&oacute;n de arquetipos y plantillas</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Ciclo de vida de los arquetipos</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Validaci&oacute;n t&eacute;cnica de arquetipos</div>\r\n</li>\r\n<li dir=\"ltr\">\r\n<div dir=\"ltr\">Uso de plantillas en software</div>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<div dir=\"ltr\">En nuestra <a href=\"https://cabolabs.com/es/educacion\">p&aacute;gina de educaci&oacute;n</a> se encuentra el programa completo.</div>\r\n<p><br /><strong>Se emitir&aacute;n certificados para todos los participantes.</strong><br /><br /><br />M&aacute;s informaci&oacute;n: <a href=\"http://informatica-medica.blogspot.com/2018/07/curso-de-modelado-de-informacion-clinica.html\">http://informatica-medica.blogspot.com/2018/07/curso-de-modelado-de-informacion-clinica.html</a><br /><br />Consultas:&nbsp;<a href=\"mailto:info@cabolabs.com\">info@cabolabs.com</a></p>\r\n<div><br />\r\n<h2>2. Invitaci&oacute;n a eventos</h2>\r\nEste a&ntilde;o estaremos visitando Chile y Argentina, apoyando eventos de formaci&oacute;n y difusi&oacute;n en temas de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad. Vea <a href=\"https://www.youtube.com/watch?v=XEYcTQ3M6Ys\" target=\"_blank\">nuestro video de invitaci&oacute;n</a> con comentarios sobre las experiencias del a&ntilde;o pasado.<br /><br />\r\n<p class=\"null\"><strong>1. Simposio Chileno de Inform&aacute;tica en Salud ISChile IV<br /><br /></strong>Este a&ntilde;o el programa del ISChile estar&aacute; integrado 100% con propuestas de la comunidad de profesionales de Inform&aacute;tica en Salud. Las propuestas de charlas y trabajos se pueden hacer llegar a trav&eacute;s de su web. Este a&ntilde;o vamos a estar participando del simposio, y en breve publicaremos cu&aacute;les ser&aacute;n nuestras charlas. &iexcl;Te esperamos!</p>\r\n<p><a href=\"http://ischile.org/simposio/\" target=\"_blank\">M&aacute;s informaci&oacute;n</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>2. Jornadas Universitarias de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires<br /></strong><br /> Este a&ntilde;o las cl&aacute;sicas jornadas del HIBA se har&aacute;n por primera vez fuera del hospital. El a&ntilde;o pasado tuvo una inmensa concurrencia, colmando todas las expectativas, y este a&ntilde;o se espera a&uacute;n m&aacute;s asistencia de profesionales de todo el mundo. No te lo puedes perder.</p>\r\n<p><a href=\"http://hiba.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_curso.php&amp;id_curso=49471#.W0wkXhgnag_\" target=\"_blank\">Informaci&oacute;n del evento</a></p>\r\n<br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2018-07-16 03:22:19', 'NewsLetter', 0),
(33, 'Programa de FormaciÃ³n Profesional de InformÃ¡tica en Salud 2018', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>1. Programa de Formaci&oacute;n Profesional de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad 2018</h2>\r\nEste a&ntilde;o volvemos a realizar este novedoso programa con el objetivo de que nuestros alumnos ganen experiencia pr&aacute;ctica en temas fundamentales en el desarrollo e implementaci&oacute;n de sistemas de informaci&oacute;n en salud.<br /> <br /> En todos nuestros cursos y talleres se entregar&aacute;n certificados de ACHISA y CaboLabs.<br /> <br /> Nuestras clases se dan en l&iacute;nea, en vivo y en directo (no se basa en videos pre-grabados). Adem&aacute;s cuentan con el respaldo de reconocidos profesionales con amplia experiencia en el &aacute;rea.<br /> <br />Les agradecemos el&nbsp;difundir esta noticia entre sus contactos y colegas.\r\n<p><br /> <a href=\"https://cabolabs.com/es/educacion\" target=\"_blank\">Vea nuestros dem&aacute;s cursos y talleres, y reg&iacute;strese en las listas de espera para recibir novedades.</a><br /> <br /> &nbsp;</p>\r\n<p class=\"mc-toc-title\"><span style=\"text-decoration: underline;\"><strong><span style=\"font-size: small;\">Pr&oacute;ximos