alud.pdf\" target=\"_blank\">Programa</a> / <a href=\"http://goo.gl/forms/98P582dTe0hiVm702\" target=\"_blank\">Lista de espera</a> / <a href=\"https://www.cabolabs.com/es/educacion\" target=\"_blank\">Informaci&oacute;n</a><br /> <br /> <strong>Curso de Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR 4a ed.</strong><br /> Comienzo: 19 de Noviembre de 2018<br /> <a href=\"https://www.cabolabs.com/educacion/programa_bases_de_datos_clinicas_openehr.pdf\" target=\"_blank\">Programa</a> / <a href=\"http://goo.gl/forms/pu2jj4GwYCIqJkev1\" target=\"_blank\">Lista de espera</a> / <a href=\"https://www.cabolabs.com/es/educacion\" target=\"_blank\">Informaci&oacute;n</a><br />\r\n<div><br /><br />\r\n<h2>2. Invitaci&oacute;n a eventos</h2>\r\nEste a&ntilde;o estaremos visitando Chile y Argentina, apoyando eventos de formaci&oacute;n y difusi&oacute;n en temas de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad. Vea <a href=\"https://www.youtube.com/watch?v=XEYcTQ3M6Ys\" target=\"_blank\">nuestro video de invitaci&oacute;n</a> con comentarios sobre las experiencias del a&ntilde;o pasado.<br /><br />\r\n<p class=\"null\"><strong>1. Simposio Chileno de Inform&aacute;tica en Salud ISChile IV<br /><br /></strong>Este a&ntilde;o el programa del ISChile estar&aacute; integrado 100% con propuestas de la comunidad de profesionales de Inform&aacute;tica en Salud. Las propuestas de charlas y trabajos se pueden hacer llegar a trav&eacute;s de su web. Este a&ntilde;o vamos a estar participando del simposio, y en breve publicaremos cu&aacute;les ser&aacute;n nuestras charlas. &iexcl;Te esperamos!</p>\r\n<p><a href=\"http://ischile.org/simposio/\" target=\"_blank\">M&aacute;s informaci&oacute;n</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>2. Jornadas Universitarias de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires<br /></strong><br /> Este a&ntilde;o las cl&aacute;sicas jornadas del HIBA se har&aacute;n por primera vez fuera del hospital. El a&ntilde;o pasado tuvo una inmensa concurrencia, colmando todas las expectativas, y este a&ntilde;o se espera a&uacute;n m&aacute;s asistencia de profesionales de todo el mundo. No te lo puedes perder.</p>\r\n<p><a href=\"http://hiba.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_curso.php&amp;id_curso=49471#.W0wkXhgnag_\" target=\"_blank\">Informaci&oacute;n del evento</a></p>\r\n<br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\