 /></strong></span></p>\r\n<br /> <strong>Workshop de Implementaci&oacute;n y Gesti&oacute;n de EHRServer* 1a ed. (INSCRIPCIONES ABIERTAS)</strong><br /> Comienzo 8 de Septiembre de 2018<br /> <a href=\"https://cabolabs.com/educacion/programa_workshop_ehrserver.pdf\" target=\"_blank\">Programa</a> / <a href=\"https://goo.gl/forms/pzzMxSFuzt8VuxTM2\" target=\"_blank\">Inscripci&oacute;n</a> / <a href=\"https://www.cabolabs.com/es/educacion\" target=\"_blank\">Informaci&oacute;n</a><br /> <br /> * <a href=\"https://www.cabolabs.com/es/productos/ehrserver\" target=\"_blank\">EHRServer</a> es el primer repositorio abierto de datos cl&iacute;nicos que cumple el est&aacute;ndar openEHR.<br /> <br /> <strong>Curso de Interoperabilidad entre Sistemas de Informaci&oacute;n en Salud 5a ed. (INSCRIPCIONES ABIERTAS)</strong><br /> Comienzo 22 de Octubre de 2018<br /> <a href=\"https://www.cabolabs.com/educacion/programa_interoperabilidad_sistemas_informacion_salud.pdf\" target=\"_blank\">Programa</a> / <a href=\"http://goo.gl/forms/9i9OrhkfmUFL8zHY2\" target=\"_blank\">Inscripci&oacute;n</a> / <a href=\"https://www.cabolabs.com/es/educacion\" target=\"_blank\">Informaci&oacute;n</a><br /> <br /> <strong>Curso de Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR 4a ed.</strong><br /> Comienzo: 19 de Noviembre de 2018<br /> <a href=\"https://www.cabolabs.com/educacion/programa_bases_de_datos_clinicas_openehr.pdf\" target=\"_blank\">Programa</a> / <a href=\"http://goo.gl/forms/pu2jj4GwYCIqJkev1\" target=\"_blank\">Lista de espera</a> / <a href=\"https://www.cabolabs.com/es/educacion\" target=\"_blank\">Informaci&oacute;n</a><br />\r\n<div><br /><br />\r\n<h2>2. Invitaci&oacute;n a eventos</h2>\r\nEste a&ntilde;o estaremos visitando Chile y Argentina, apoyando eventos de formaci&oacute;n y difusi&oacute;n en temas de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad. Vea <a href=\"https://www.youtube.com/watch?v=XEYcTQ3M6Ys\" target=\"_blank\">nuestro video de invitaci&oacute;n</a> con comentarios sobre las experiencias del a&ntilde;o pasado.<br /><br />\r\n<p class=\"null\"><strong>1. Simposio Chileno de Inform&aacute;tica en Salud ISChile IV<br /><br /></strong>Este a&ntilde;o el programa del ISChile estar&aacute; integrado 100% con propuestas de la comunidad de profesionales de Inform&aacute;tica en Salud. Las propuestas de charlas y trabajos se pueden hacer llegar a trav&eacute;s de su web. Este a&ntilde;o vamos a estar participando del simposio, brindando un taller el d&iacute;a 27 y una charla el d&iacute;a 28 de septiembre. &iexcl;Te esperamos!</p>\r\n<p><a href=\"http://ischile.org/simposio/\" target=\"_blank\">M&aacute;s informaci&oacute;n</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>2. Jornadas Universitarias de Sistemas de Informaci&oacute;n en Salud del Hospital Italiano de Buenos Aires<br /></strong><br /> Este a&ntilde;o las cl&aacute;sicas jornadas del HIBA se har&aacute;n por primera vez fuera del hospital. El a&ntilde;o pasado tuvo una inmensa concurrencia, colmando todas las expectativas, y este a&ntilde;o se espera a&uacute;n m&aacute;s asistencia de profesionales de todo el mundo. No te lo puedes perder.</p>\r\n<p><a href=\"http://hiba.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_curso.php&amp;id_curso=49471#.W0wkXhgnag_\" target=\"_blank\">Informaci&oacute;n del evento</a></p>\r\n<br />\r\n<p><strong>3. JII ornadas de Inform&aacute;tica en Salud de Paraguay<br /></strong><br />Pronto habr&aacute;n novedades de las jornadas en Paraguay e intentaremos tambi&eacute;n apoyar y participar del evento.</p>\r\n<a href=\"http://www.pol.una.py/JornadasInformaticaSalud/\" target=\"_blank\">Informaci&oacute;n del evento</a><br /><br /></div>\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2018-09-22 04:01:35', 'NewsLetter', 0);
INSERT INTO `cms_notifs_newsletter` (`id`, `name`, `content`, `createdOn`, `class`, `deleted`) VALUES
(35, 'Terminamos el aÃ±o con cursos y eventos 2018', '<div align=\"center\">\r\n<div style=\"border-bottom-right-radius: 5px; -moz-border-radius-bottomright: 5px; border-bottom-left-radius: 5px; -moz-border-radius-bottomleft: 5px; border-top-right-radius: 5px; -moz-border-radius-topright: 5px; border-top-left-radius: 5px; -moz-border-radius-topleft: 5px; background-color: #23337e; padding: 2px; width: 760px;\">\r\n<table style=\"width: 100%;\" border=\"0\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: #fff; background-color: #23337e;\"><a href=\"http://openehr.org.es\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/logo1.png\" border=\"0\" /></a>Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #fff;\">\r\n<h1>Bolet&iacute;n de la comunidad</h1>\r\n<h2>1. IV Curso Dise&ntilde;o e Implementaci&oacute;n de Bases de Datos Cl&iacute;nicas con openEHR</h2>\r\nLos repositorios de informaci&oacute;n cl&iacute;nica son parte fundamental de cualquier sistema de informaci&oacute;n en salud. Dise&ntilde;arlos de forma estandarizada y como base para la interoperabilidad no es tarea sencilla. En este curso te ense&ntilde;amos c&oacute;mo.<br /><br />\r\n<div align=\"center\"><img src=\"https://3.bp.blogspot.com/-i8SNsD0g0GQ/W9Fxq04y8tI/AAAAAAAAd0k/wzl1aEZCbhgTEzaWIRJSnZjAodnF_yliACLcBGAs/s320/iso_300_hor_white_1margin_0text_1square.png\" border=\"0\" width=\"216\" height=\"216\" /></div>\r\n<h3>Objetivos del curso</h3>\r\n<ul>\r\n<li>Conocer los requerimientos particulares de las bases de datos cl&iacute;nicas.</li>\r\n<li>Conocer el est&aacute;ndar openEHR para Historias Cl&iacute;nicas Electr&oacute;nicas, desde el punto de vista de implementaci&oacute;n de repositorios de informaci&oacute;n cl&iacute;nica.</li>\r\n<li>Conocer distintas t&eacute;cnicas y tecnolog&iacute;as de implementaci&oacute;n de bases de datos.</li>\r\n<li>Experimentar con los conceptos vistos en clase para el dise&ntilde;o e implementaci&oacute;n de una base de datos cl&iacute;nica.</li>\r\n</ul>\r\n<br /><br />\r\n<div align=\"center\">Aqu&iacute; puedes encontrar <a href=\"http://informatica-medica.blogspot.com/2018/10/iv-curso-diseno-e-implementacion-de.html\" target=\"_blank\">toda la informaci&oacute;n del curso</a>.</div>\r\n<br />\r\n<div align=\"center\"><a href=\"https://cabolabs.com/educacion/programa_bases_de_datos_clinicas_openehr.pdf\" target=\"_blank\">Programa</a> | <a href=\"http://goo.gl/forms/v4sXzg3hGT\" target=\"_blank\">Inscripci&oacute;n</a></div>\r\n<br />\r\n<h2>2. Invitaci&oacute;n a eventos</h2>\r\n<h3 class=\"null\">II Jornadas de Inform&aacute;tica en Salud (JIS) de Paraguay</h3>\r\n<p>Las II Jornadas de Inform&aacute;tica en Salud (II JIS) se realizar&aacute;n el 20, 21, 22 y 23 de noviembre del a&ntilde;o 2018 en el sal&oacute;n auditorio del Ministerio de Salud P&uacute;blica y Bienestar Social (MSPyBS). El evento, adem&aacute;s de compartir experiencias y dar a conocer los avances de inform&aacute;tica en salud en Paraguay, pretende concienciar y capacitar a los profesionales del &aacute;rea.<br /> <br /> Las II JIS son de acceso libre y gratuito pero requiere de una inscripci&oacute;n previa ya que existen cupos limitados. Si deseas participar de la II JIS, inscr&iacute;bete siguiendo el siguiente <a href=\"https://docs.google.com/forms/d/15253CyTZneX-hlRlWLxgi7HVYAa7yYtqsC8fryQidlw\" target=\"_blank\">enlace</a>.<br /> <br /> Desde CaboLabs, estaremos brindando una charla y un taller focalizados en la interoperabilidad entre sistemas de informaci&oacute;n en salud.</p>\r\n<p><a href=\"https://jis.spis.org.py/\" target=\"_blank\">M&aacute;s informaci&oacute;n</a></p>\r\n<br />\r\n<h2>3. Lo que vivimos en el IV Simposio Chileno de Inform&aacute;tica en Salud ISChile 2018</h2>\r\nEste a&ntilde;o, <a href=\"http://informatica-medica.blogspot.com/2017/10/iii-simposio-chileno-de-informatica-en.html\" target=\"_blank\">al igual que el a&ntilde;o pasado</a>, estuvimos en Chile acompa&ntilde;ando el <a href=\"http://ischile.org/simposio/\" target=\"_blank\">ISChile 2018</a> los pasados d&iacute;as 27 y 28 de Septiembre. Brindamos un taller de apoyo a la toma de decisiones cl&iacute;nicas y una charla sobre plataformas de microservicios.<br /><br />\r\n<div align=\"center\"><img src=\"https://4.bp.blogspot.com/-U8_WcxmSFz8/W75wjK3ZTFI/AAAAAAAAdzU/tA9sk6lpRBgECIav-Qo_o-LZnbWNgV1jwCLcBGAs/s640/_DSC6255.jpg\" border=\"0\" width=\"542\" height=\"361\" /></div>\r\n<br /><br />El evento fue un gran encuentro entre estudiantes y profesionales que trabajan en Inform&aacute;tica en Salud, y estuvo focalizado en la difusi&oacute;n del conocimiento adquirido en experiencias nacionales e internacionales. En <a href=\"http://informatica-medica.blogspot.com/2018/10/iv-simposio-chileno-de-informatica-en.html\" target=\"_blank\">este art&iacute;culo</a> te contamos m&aacute;s del evento.<br /> <br /><br />\r\n<h2>4. Novedades en formaci&oacute;n de Inform&aacute;tica en Salud, Est&aacute;ndares e Interoperabilidad para 2019</h2>\r\nPara el a&ntilde;o que viene estamos dise&ntilde;ando un novedoso conjunto de talleres focalizados en temas particulares que son de especial inter&eacute;s para dise&ntilde;o de sistemas de informaci&oacute;n en salud.<br /> <br /> Ya puedes <a href=\"https://cabolabs.com/educacion/\" target=\"_blank\">registrarte en las listas de espera</a> y recibir&aacute;s una notificaci&oacute;n cuando est&eacute;n habilitadas las inscripciones.<br /> <br />Nuevos talleres que se agregar&aacute;n a nuestro programa:\r\n<ul>\r\n<li>Arquitecturas de Sistemas de Informaci&oacute;n Hospitalarios</li>\r\n<li>Dise&ntilde;o e Implementaci&oacute;n de APIs REST en Salud</li>\r\n<li>Usabilidad en Sistemas de Informaci&oacute;n en Salud</li>\r\n<li>Introducci&oacute;n a la programaci&oacute;n para no inform&aacute;ticos</li>\r\n</ul>\r\n<br /> Y como si fuera poco, tambi&eacute;n tendremos <a href=\"https://www.veratech.es/formacion\" target=\"_blank\">cursos de HL7 FHIR y SNOMED CT a trav&eacute;s de nuestro partner Veratech</a>. Pronto habr&aacute;n muchas novedades.<br /> <br /> No te olvides de seguir nuestra <a href=\"https://www.youtube.com/playlist?list=PL-4c1WHznyukKCtzzY_auuvXQIWrRFIyq\" target=\"_blank\">serie de charlas</a> sobre Arquitecturas de Sistemas de Informaci&oacute;n Hospitalarios en YouTube.<br /><br /><br />\r\n<h2>5. Novedades de EHRServer</h2>\r\nEHRServer es la primera plataforma de c&oacute;digo abierto para almacenar, gestionar y compartir informaci&oacute;n cl&iacute;nica que cumple con el est&aacute;ndar openEHR.<br /><br />\r\n<div align=\"center\"><img src=\"https://3.bp.blogspot.com/-Y0xa4Maui8U/WYaunDsYpYI/AAAAAAAAcJ0/mmC-JJVcxNwe0OC21XYgFz6kdeJ2hwoVwCPcBGAYYCw/s400/EHRServer_white_300_horizontal.png\" border=\"0\" width=\"400\" height=\"86\" /><br /><br /></div>\r\nEn este momento nos encontramos trabajando en la nueva versi&oacute;n de EHRServer, donde agregaremos la capacidad de crear redes de servidores que se sincronicen de forma autom&aacute;tica. Esto permitir&aacute; agregar funcionalidades como respaldos autom&aacute;ticos, crear servidores secundarios para an&aacute;lisis de datos, y crear entornos de alta disponibilidad para consumo de datos cl&iacute;nicos.<br /> <br /> Este a&ntilde;o ofrecimos el primer <a href=\"http://informatica-medica.blogspot.com/2018/08/workshop-de-implementacion-y-gestion-de.html\" target=\"_blank\">Workshop de EHRServer</a> con un excelente nivel de inscripciones y un gran inter&eacute;s por parte de los alumnos. En este workshop conocieron los principios de dise&ntilde;o, el funcionamiento interno, c&oacute;mo gestionar informaci&oacute;n cl&iacute;nica, y c&oacute;mo utilizar la API REST para integrar e interactuar desde distintas aplicaciones con el EHRServer. Todos nuestros alumnos recibieron una suscripci&oacute;n gratuita a nuestro servicio en la nube <a href=\"https://www.cloudehrserver.com?lang=es\" target=\"_blank\">CloudEHRServer</a> para probar en la pr&aacute;ctica todo lo aprendido.<br /><br /><br />\r\n<h2>Redes sociales</h2>\r\n<p>Recuerda seguir a la comunidad en diversas redes sociales, participa de las discusiones, comparte informaci&oacute;n, y ayuda a la difusi&oacute;n de la comunidad. <strong>&iexcl;La comunidad la hacemos entre todos, por todos y para todos!</strong></p>\r\nGrupo en <a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\">LinkedIn</a>, una p&aacute;gina en <a href=\"http://www.facebook.com/openEHR\" target=\"_blank\">Facebook</a>, y una cuenta en <a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\">Twitter</a>.<br /><br />\r\n<table align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<strong><a href=\"http://www.linkedin.com/groups?about=&amp;gid=4347256\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/linkedin.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en LinkedIn\" /></a></strong></td>\r\n<td><strong><a href=\"http://www.facebook.com/openEHR\" target=\"_blank\"><img src=\"http://openehr.org.es/apps/cms2/skins/openehr/facebook.gif\" border=\"0\" alt=\"openEHR en espa&ntilde;ol en Facebook\" /></a></strong>&nbsp;</td>\r\n<td>&nbsp;<strong><a href=\"https://twitter.com/#!/openehr_org_es\" target=\"_blank\"><img src=\"https://g.twimg.com/about/feature-corporate/image/followbutton.png\" border=\"0\" width=\"81\" height=\"30\" /></a></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #23337e; color: #fff;\"><span style=\"color: #ffffff;\"><a href=\"mailto:pablo@openehr.org.es\"><span style=\"color: #ffffff;\">&nbsp;Pablo Pazos</span></a></span> - Coordinador de la Comunidad de openEHR en espa&ntilde;ol</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2018-11-14 22:51:17', 'NewsLetter', 0);
