INSERT INTO `foro_forums` (`id`, `forum_name`, `forum_desc`, `redirect_url`, `moderators`, `num_topics`, `num_posts`, `last_post`, `last_post_id`, `last_poster`, `sort_by`, `disp_position`, `cat_id`) VALUES
(2, 'General', 'Intercambios generales sobre el estándar openEHR, discusiones sobre su aplicación, interoperabilidad con otros estándares, etc. Se recomienda que los miembros primerizos en openEHR pregunten aquí primero.', NULL, NULL, 4, 6, 1412601161, 78, 'admin', 0, 0, 2),
(3, 'Arquetipos', 'En este foro hablaremos sobre arquetipos, su estructura, diseño, ciclo de vida, traducción, uso en sistemas de información, y modelado del conocimiento clínico en general.', NULL, NULL, 7, 23, 1416324914, 81, 'numael', 0, 4, 2),
(4, 'Cafetería', 'Aquí hablamos de todo un poco, como en una cafetería. Tanto de openEHR como de otros estándares y enfoques para el desarrollo de sistemas de información en salud.', NULL, NULL, 2, 6, 1342548416, 16, 'admin', 0, 2, 4),
(5, 'Modelo de información', 'En este foro intercambiamos información acerca del modelo de información de openEHR, como implementarlo (persistencia, procesamiento, visualización, comunicación) y qué relación tiene con otros modelos (ej. HL7 RIM, HL7 CDA, CEN/ISO 13606, DICOM, etc).', NULL, NULL, 0, 0, NULL, NULL, NULL, 0, 6, 2),
(6, 'Software', 'Diseño y desarrollo de herramientas de software que implementan openEHR', NULL, NULL, 4, 16, 1443529931, 83, 'aeguzkiza', 0, 8, 2),
(8, 'openEHR y DICOM', 'Relación y complementación entre openEHR y DICOM', NULL, NULL, 1, 4, 1387788806, 66, 'aeguzkiza', 0, 1, 5),
(10, 'Presentaciones personales', 'Aquí nos presentamos, contamos un poco de quienes somos, qué hacemos, cuáles son nuestros intereses, etc. Es una buena forma de conocer a otros profesionales con perfiles complementarios.', NULL, NULL, 6, 7, 1409929902, 75, 'admin', 0, 0, 4),
(11, 'Notificaciones', 'Foro oficial de notificaciones de la comunidad. Aquí anunciaremos noticias y novedades acerca de la comunidad y su funcionamiento.', NULL, NULL, 6, 8, 1358212014, 36, 'admin', 0, 1, 4),
(12, 'Promociones', 'Aquí es donde podemos publicar los productos y servicios que ofrecemos, tanto personales como de empresas.', NULL, NULL, 0, 0, NULL, NULL, NULL, 0, 4, 4),
(13, 'Capacitación', 'Aquí hablaremos de las ofertas de capacitación, de qué sería necesario o útil, de cómo armar cursos, charlas, presentaciones, talleres, etc.', NULL, NULL, 5, 5, 1480315023, 85, 'admin', 0, 3, 4),
(14, 'openEHR y ASTM CCR', 'Relación y complementación entre openEHR y el Continuity of Care Record', NULL, NULL, 1, 1, 1335729164, 10, 'admin', 0, 3, 5),
(15, 'La comunidad', 'Aquí hablamos sobre la comunidad, sus objetivos, líneas de acción y actividades', NULL, NULL, 4, 8, 1384922936, 58, 'admin', 0, 1, 2);
