INSERT INTO `foro_posts` (`id`, `poster`, `poster_id`, `poster_ip`, `poster_email`, `message`, `hide_smilies`, `posted`, `edited`, `edited_by`, `topic_id`) VALUES
(2, 'fvinciarelli', 13, '201.212.118.168', NULL, 'Hola Gente!. Me podrían orientar donde puedo encontrar las especificaciones en español?\n\nSaludos,\nFranco Vinciarelli.-', 0, 1334326837, NULL, NULL, 2),
(3, 'admin', 2, '186.53.171.21', NULL, 'Hola Franco,\n\nNo existen traducciones todavía. Parte de ese trabajo le corresponde a esta comunidad.\nPor otro lado, en el curso de openEHR en español se ha traducido parte de las especificaciones para armar los materiales de lectura de las clases.\n\nSaludos,\nPablo.', 0, 1334595935, NULL, NULL, 2),
(4, 'fvinciarelli', 13, '190.136.29.14', NULL, 'Hola pablo! \nTe comento que yo estoy revisando la especificacion del modulo de RM.\nEn este momento estoy sobre el stack de soporte.\nSi te parece puedo ir pasando algo.\nSaludos,', 0, 1334596495, NULL, NULL, 2),
(5, 'admin', 2, '186.53.171.21', NULL, 'El objetivo en primera instancia es poner el tema sobre la mesa. Luego que la gente hable de openEHR, un segundo paso sería tener la traducción de la especificación. El problema es que el 99% de las personas no van a ir a la especificación y es un esfuerzo enorme el de la traducción que hay que hacer.\n\nIgualmente, nada evita que lo puedas hacer, pero el trabajo de la comunidad va a formalizarse en el futuro, con un proceso editorial para lograr una especificación en español de calidad. Debemos seguir ciertas reglas mínimas e involucrar a más personas para que estos esfuerzos no queden por la mitad.\n\nTe recomendaría que esperes un poco para ver lo que ya hay traducido para no hacer el mismo trabajo dos veces.\n\n\nSaludos,\nPablo.\n\nPD: en el viejo grupo de discusión de openEHR-ES puedes encontrar más temas ya charlados sobre la aplicación de openEHR. Está aquí: [url]https://groups.google.com/forum/?fromgroups#!forum/openehr-es[/url]\nEspero en algún momento poder mover algunos de esos temas a este nuevo foro.', 0, 1334599057, NULL, NULL, 2),
(6, 'admin', 2, '186.53.175.62', NULL, 'Estimados,\n\nMe presento. Mi nombre el Pablo Pazos, soy Ingeniero en Computación. Vivo en Montevideo, Uruguay. Mis intereses son la Informática Médica y las Tecnologías Web.\n\nDesde 2006 estoy trabajando en el área de la Informática Médica, especializándome en la aplicación de estándares en sistemas de información clínicos e interoperabilidad (integración de sistemas, arquitecturas orientadas a servicios).\n\nEn esta área hoy en día trabajo asesorando empresas que desarrollan sistemas de información en salud, en lo que tiene que ver con integración de sistemas y aplicación de estándares como openEHR, HL7, DICOM y otros. También me dedico a la investigación, capacitación y docencia. En cuanto a capacitación el hito más importante es el de haber creado el primer curso completo de openEHR en español, con el apoyo de [url=http://achisa.org]ACHISA[/url].\n\nComo ingeniero y desarrollador he creado o participado en múltiples proyectos open source: [url]http://code.google.com/u/pablo.swp@gmail.com/[/url]\n\nPor más información, puedes visitar mi [url=http://www.linkedin.com/in/pablopazosgutierrez]perfil público[/url]\n\n\nSaludos,\nPablo.', 0, 1334957034, NULL, NULL, 3),
(7, 'aeguzkiza', 14, '95.214.215.138', NULL, 'Hola a todos,\nPara introducirlos en contexto, quiero destacar cómo me inicié en el mundo de la estandarización médica. Empecé trabajando en proyectos relacionados con la imagen médica, desplegando redes, estandarizando equipos, montando modelos de servicio basados en telemedicina... De modo que me ha tocado trabajar muy de cerca con DICOM.\n\nPero la utilidad de DICOM se ve muy limitada sin un buen sistema de información clínica. El PACS y el sistema de información clínica tienen que ser capaces de comunicarse para ciertas tareas básicas (como generar una worklist), y en este aspecto ya existen algunas soluciones mediante mensajes HL7. Pero surgen casos particulares en los que las imágenes médicas contienen información de gran relevancia clínica que no llegan (o es muy complicado extraer) a la historia clínica del paciente. \n\nA ver si consigo explicarlo con claridad: la información asociada a la imagen, a día de hoy, se puede observar en los propios estudios de pruebas diagnósticas basadas en imagen, pero es muy complejo explotarlos estadísticamente. Les pongo un ejemplo práctico: las técnicas de imagen que utilizan radiación ionizante calculan un valor correspondiente a la irradiación que ha sufrido el paciente durante la prueba. Pero al quedar este valor encerrado en la prueba de imagen y al existir varios PACS distribuidos en diferentes hospitales, hay habido que crear una aplicación particular para este caso, que extrae y convierte el dato de forma que se pueda calcular la dosis total de un paciente que ha pasado por varias pruebas (carnét radiológico). Pero este tipo de aplicaciones son un \'parche\', porque aunque calcule el valor, éste no queda reflejado en ninguna parte y hay que repetir el cálculo si el mismo paciente regresa más adelante (podría haberse realizado nuevas pruebas ionizantes).\n\nEn vista de este tipo de problemática, me pareció interesante openEHR y de hecho, uno de los objetivos en mi doctorado es la interoperabilidad entre la imagen y la historia del paciente. Dicho esto, que sepan que estoy dispuesto a colaborar con los que estén interesados en cómo migrar a openEHR datos de las cabeceras DICOM.\n\nDecir también que ahora mismo estoy inmerso en otros proyectos y no podré atender este tema en condiciones hasta Junio, y mientras aprovecho el curso de Pablo para conocer el estado de arte en openEHR (todavía estoy un poco verde en este aspecto).\n\nUn saludo,\n\nAitor.', 0, 1335611325, NULL, NULL, 4),
(8, 'admin', 2, '186.52.152.66', NULL, 'Bienvenido Aitor,\n\nEs un tema interesantísimo el que planteas porque involucra varios estándares y varios sistemas.\n\nMe gustaría dejar este tema abierto a discusión para plantear ideas sobre:\n\n  1. ¿cómo se podrían integrar openEHR y DICOM a nivel conceptual?, \n  2. ¿cuáles serían los mejores mecanismos de comunicación entre estos sistemas (de forma general)?, y \n  3. ¿cuáles servicios de información serían necesarios para poder implementar la aplicación particular del cálculo de la radiación total recibida por un paciente?\n\n\nIncluso más adelante podríamos pensar en un grupo de trabajo para colaborar en la investigación en este tema, crear una propuesta/estándar, publicarla y realizar algún tipo de proyecto piloto. Obviamente, lo dejo planteado para cuando tengas más tiempo.\n\nUn abrazo,\nPablo.', 0, 1335659423, NULL, NULL, 4),
(9, 'admin', 2, '186.52.177.172', NULL, 'Estimados,\n\nEl viernes pasado di una charla abierta sobre el tema de la persistencia de información clínica, incluyendo el tema de la arquitectura de sistemas de historia clínica electrónica. La presentación y las referencias podrán encontrarlas en mi [url=http://informatica-medica.blogspot.com/2012/04/charla-sobre-persistencia-de.html]blog[/url].\n\nLo interesante de el tema de la persistencia de información clínica, es que no está incluida dentro de la especificación de openEHR, por lo que es un tema abierto a análisis y discusión sobre las posibles alternativas de persistencia de información según el modelo de openEHR. Además es algo con lo que todos nos vamos a chocar tarde o temprano si queremos crear sistemas de historia clínica electrónica \"openEHR compatibles\".\n\nDejo abierto el tema y luego les comento más sobre mi experiencia personal con persistencia de información según el modelo de openEHR.\n\n\nSaludos,\nPablo.', 0, 1335728580, NULL, NULL, 5),
(10, 'admin', 2, '186.52.177.172', NULL, 'Continuity of Care Record (CCR) es un estándar para representar documentos clínico electrónicos en formato XML, los cuales sirven para comunicar información clínica básica entre distintos centros asistenciales.\n\nAlgunos links útiles:\n\n[url]http://en.wikipedia.org/wiki/Continuity_of_Care_Record[/url]\n[url]http://www.nchica.org/Past/06/presentations/Kibbe.pdf[/url]\n[url]http://www.astm.org/COMMIT/E31_ConceptPaper.doc[/url]', 0, 1335729164, NULL, NULL, 6),
(11, 'admin', 2, '186.52.188.195', NULL, 'Estimados,\n\nEn breve comenzaremos a proponer temas para debatir y aportar en cuanto a la estructura y objetivos de nuestra comunidad, buscando formalizar ambas áreas.\n\nPor otro lado, buscamos conocer las necesidades de la comunidad de Informática Médica de habla hispana, tanto a nivel de formación, técnico, y en otras áreas, y generar vínculos de colaboración entre nuestros miembros que ayuden a una mejor comprensión y aplicación de openEHR en nuestros respectivos países.\n\nEn breve comunicaremos sobre los debates y cómo participar.\n\n¡Los esperamos!', 0, 1337023066, NULL, NULL, 7),
(12, 'admin', 2, '190.135.1.113', NULL, 'El próximo 13 de junio 2012, ACHISA los invita a participar de la charla informativa virtual \"Construyendo una comunidad de openEHR en español\", abierta a todos los interesados.\n\nEsta primera charla virtual es para informar sobre openEHR y formalizar la comunidad openEHR en español.\nLa charla está dirigida a todos los actores de la salud que estén interesados en la informatización del área clínica: prestadores de servicios de salud, asociaciones científicas, universidades, entidades de gobierno, proveedores de soluciones y sistemas en salud, profesionales y estudiantes tanto informáticos como clínicos y de otras áreas.\n\nAgenda de la charla:\n\n  * ¿Qué es openEHR? (el estándar y la fundación)\n  * ¿Por qué openEHR en español?\n  * Comunidad openEHR en español: estructura, objetivos, líneas de acción\n  * ¿Cómo participar y contribuir?\n  * Espacio para preguntas\n\n\nRelatores: Pablo Pazos, Jaime de los Hoyos, Maurizio Mattoli\n\nCoordinación: Asociación Chilena de Informática en Salud (ACHISA)\n\nDía y hora: miércoles 13 de junio a las 18:30 de Chile (GMT-4) (nota: misma hora de la clase del curso de openEHR en español). Para ver a qué horario corresponde en su país o ciudad clic aquí.\n\nAcceso a la sala virtual: Link para participar a la Charla: ([url]http://www.gvowebcast.com/conference,achisa[/url]) (ingresar 15 minutos antes del horario de la charla)\n\nMás información: [url]http://informatica-medica.blogspot.com/2012/06/charla-construyendo-la-comunidad-de.html[/url]\n\nSaludos,\nPablo.', 0, 1339023614, NULL, NULL, 8),
(13, 'hivam', 39, '181.132.41.202', NULL, 'Buenos días,\n\nSugiero que se habilite la opción \"Invitar a un amigo\" o \"Recomendar\" para facilitar la difusión de la comunidad OpenEHR en español.  La opción debe incluir un mensaje corto que explique de que se trata la comunidad y sobre todo que estimule a unirse a ella.', 0, 1340549407, NULL, NULL, 9),
(14, 'admin', 2, '190.135.37.120', NULL, 'Excelente idea! es un mecanismo muy sencillo que puede permitir ampliar la comunidad.\n\n¿Conoces alguna librería PHP que tenga esa funcionalidad implementada? porque no está implementada y habría que desarrollarla.\n\nSaludos,\nPablo.', 0, 1340592090, NULL, NULL, 9),
(15, 'admin', 2, '190.135.95.216', NULL, 'Calculo que dentro un mes aproximadamente vamos a empezar a mover algunos grupos de trabajo, entre ellos:\n\n  * Grupo editorial: publicaciones, artículos, traducciones\n  * Grupo de estándares: investigación, definición, adaptación de estándares\n  * Grupo de software: proyectos de herramientas de software\n\nLas ideas son bienvenidas!\n\nSaludos,\nPablo.', 0, 1342548287, NULL, NULL, 2),
(16, 'admin', 2, '190.135.95.216', NULL, 'Estimados, los invito a publicar una pequeña presentación de cada uno, contando un poco de donde son, sus intereses, en qué trabajan, que esperan de la comunidad, etc.\n\nEs una buena forma de conocernos y vincularnos.\n\nAquí el foro: [url]http://openehr.org.es/foro/viewforum.php?id=10[/url]\n\n\nSaludos,\nPablo.', 0, 1342548416, NULL, NULL, 10),
(17, 'befama', 30, '186.112.238.231', NULL, 'Cordial Saludoa tod@s. Soy médico con estudios de maestría en educación virtual. Me interesa la aplicación de la tecnología informática en el área de la salud tanto en la educación como en la asistencia clínica. Actualmente soy docente de la escuela de medicina de la Universidad Pedagógica y Tecnológica de Colombia en Tunja. \n\nParticipé recientemente  en el curso de openEHR y estoy interesado en incorporar openEHR al diseño de  sistemas de apoyo a la toma de desciciones clínicas.', 0, 1342557547, NULL, NULL, 11),
(18, 'admin', 2, '186.52.160.24', NULL, 'Estimados,\n\nQuería compartir con uds. que vamos a estar en el CAIS 2012, ofreciendo actividades específicas de openEHR. [url]http://www.41jaiio.org.ar/cais[/url]\n\nEn este momento estamos diseñando algunos talleres, posiblemente 3, en distintas áreas de openEHR como la especificación, la implementación y la complementaridad con otros estándares.\n\nTambién es un buen lugar para juntarnos y charlar de nuestras inquietudes y planes a futuro de la comunidad de openEHR en español, sobre todo lo que tiene que ver con desarrollo de herramientas de software necesarias para poder trabajar con openEHR y poder generar interés de la academia, de la industria, de los proveedores y del área pública.\n\nPor otro lado, quería comentarles que presenté un trabajo sobre EHRGen ([url]http://code.google.com/p/open-ehr-gen-framework[/url]) y fue aceptado, así que hay otra charla más relacionada con openEHR.\nYo voy a estar llegando el lunes 27 de agosto a La Plata. Quienes deseen coordinar para vernos allá me pueden mandar mail a pablo@openehr.org.es (luego armo un mail para todos con todos los que me contacten, así nos vamos conociendo). Hay varios compañeros del curso de openEHR en español con los que ya estamos coordinando vernos, ¡no se lo pierdan!\n\nUn abrazo,\nPablo.', 0, 1342850284, NULL, NULL, 12),
(19, 'admin', 2, '186.52.160.24', NULL, 'Estimados,\n\nNecesito verificar si todos están recibiendo los boletines. Hasta el momento he enviado 2 boletines con noticias e información de cómo participar de la comunidad.\n\nPor favor confirmen si les llegaron o no, y por las dudas verifiquen si no les llegó como spam al correo que usaron para registrarse en la comunidad.\n\n\nSaludos,\nPablo.\n[url]http://www.facebook.com/openEHR[/url]', 0, 1342850493, NULL, NULL, 13),
(20, 'teleenfermeria', 51, '190.199.104.63', NULL, 'Es gratísimo establecer este encuentro de voluntades, donde todos somos bienvenidos y bienvenidas .\n\nEnfermero de Profesión, Docente , cursando-la Maestría en Informática Educativa y estudios en Telemáticas e Informática , Web Master  entre  otros temas.\n\nEn el estándar openEHR, me ha permitido ir entendiendo que la información explicita de la HCI ,donde  los conceptos clínicos individuales son modelados a una  estructura e información genérica, siendo posible tener acceso a un entorno de la gestión del conocimiento global.\n\nComo miembro de la Asociación Venezolana de Informática de Salud  y de la NI-IMIA-LAC es nuestro interés dar a conocer estas herramientas  e invitamos a los colegas de Enfermería ,ha conformar un equipo para dar conocer nuestros participación en openEHR  , sobre todo en modelar el proceso de atención de enfermería y sus diagnósticos  enfermero,  en el medio de la informatización de la Historia Clínica.', 0, 1342982300, 1342982354, 'teleenfermeria', 14),
(21, 'admin', 2, '186.54.216.65', NULL, 'Estimados,\n\nLes quería comentar de la tercera edición del curso.\n\n\nFechas:\n\nEstoy viendo para comenzar el curso entre fines de setiembre y principios de octubre, lanzando la apertura de inscripciones un par de semanas antes.\n\n¿Tienen algún inconveniente con las fechas?\n\n\nCronograma y temario:\n\nLos temas del curso serán los mismos pero cambiarán de orden, para ver más cosas prácticas al inicio que les permitan llegar mejor a la tarea obligatoria para aprobar el curso.\n\nTambién se va a reducir el tiempo de las clases (no los contenidos), para hacerlas más ágiles y dejar más tiempo para preguntas. Sería una clase por semana, con un total de 8 clases, en los 2 meses de duración del curso.\n\n\nInversión:\n\nSe mantendrán los precios de inscripción de la segunda edición del curso.\n\nHabrán descuentos por cantidad, por ejemplo si son varios estudiantes de la misma institución o varios compañeros que trabajan en la misma empresa.\n\n\nopenEHR en español:\n\nAprovecho la oportunidad para comentarles que estaremos haciendo talleres de openEHR en el CAIS2012: [url]http://www.41jaiio.org.ar/cais[/url]\n\nLos talleres serán el día jueves 30 de agosto.\n\nTambién tendremos reuniones de la comunidad ([url]http://openehr.org.es[/url]) para tratar temas de colaboración y coordinación de iniciativas locales, desarrollo de herramientas de software y modelado de contenido clínico.\n\nLos invito a seguirnos:\n\n    \n\n\nMás información sobre el curso:\n\nAquí pueden encontrar información de las ediciones anteriores:\n[url]http://informatica-medica.blogspot.com/2012/03/curso-de-openehr-en-espanol.html[/url]\n[url]http://informatica-medica.blogspot.com/2012/01/conclusiones-del-curso-de-openehr-en.html[/url]\n[url]http://informatica-medica.blogspot.com/2011/09/capacitacion-en-openehr-estandar-libre.html[/url]\n\n\nPor cualquier consulta, quedo a sus órdenes.', 0, 1344546428, NULL, NULL, 15),
(22, 'admin', 2, '186.54.216.65', NULL, 'Estimados,\n\nSi trabajan con arquetipos, tengan cuidado con los que descargan del CKM de openEHR ([url]http://www.openehr.org/knowledge[/url]) y están en estado DRAFT.\n\nAlgunos de estos arquetipos no respetan la regla que está en las especificaciones que dice que 2 nodos hermanos deben tener un id para diferenciarse. Los identificadores de nodos en los arquetipos son los códigos \"at\", o sea los \"at0000\", \"at0001\", ... etc.\n\nPor las dudas, antes de descargar un arquetipo, siempre es aconsejable ver qué problemas de validación tiene. Para hacerlo, deben ingresar con su usuario y clave al CKM (registrarse antes sino tienen uno), ingresar a un arquetipo y hacer clic en el botón \"Validation Report\" [img]http://www.openehr.org/knowledge/pics/menu/adl_error.png[/img].\n\n\nMucha suerte!\nPablo.', 0, 1344546775, NULL, NULL, 16),
(23, 'admin', 2, '190.135.46.200', NULL, 'El día jueves 30 de agosto tendremos una jornada de talleres de openEHR en el CAIS 2012.\n\n[url]http://www.cais.org.ar/?q=node/17[/url]\n\n¡Nos vemos en La Plata!', 0, 1345863511, NULL, NULL, 17),
(24, 'jrbiolinux', 20, '190.190.127.184', NULL, 'Hola a todos, me llamo Jorge Raúl Rodríguez pero todos me conocen como JR. Soy médico, me recibí en 1984, tengo la especializacion en Medicina Interna y en Cuidados Críticos en Buenos Aires Argentina. Comencé con la informática en 1986, desarrollé con algunos clegas los primeros programas de registro en terapia intensiva desde 1992 y en 1997 fundé el Grupo BioLinux. Me dedico más a las tecnologías libres para el área salud, actualmente estoy más avocado a la Telesalud. Me certifique de especialista en Informática en Salud en la Universidad de Texas en Houston, USA. Mi hospital de referencia es el Hospital Dr. Cosme Argerich del GCBA. Mi idea es poder partiicipar en todo lo que me sea posible en este nuevo emprendimiento de la comunidad en Español en openEHR. Un cordial saludo a todos. JR', 0, 1346563008, NULL, NULL, 18),
(25, 'jrbiolinux', 20, '190.190.127.184', NULL, 'Hola a todos. Bueno ayer empecé a ver como se puede aprovechar el Archetype Editor de Oceans en Linux. Probé sin éxito el AE en un Ubuntu 64 bits y un Tuquito 64 bits. Ambos con entorno Wine 1.4 completo y Mono. El AE se instala perfecto, pero luego no corre. Este comportamiento probablemente se deba a la arquitectura de 64 bits de estas dos versiones de Linux. Si bien esta fue una prueba \"al vuelo\" la idea es generar una maquina virtual con un Ubuntu 12.04.1 32 bits e ir probando ordenadamente, por pasos, la instalación y arranque del AE primero con Wine 1.4, luego sumando Mono o instalando .net 2.0 en Wine y luego hacer pruebas con Crossover 11.0. Ya les iré contando, una vez tengamos el entorno en el cual funciona AE puede hacerse una recomendación breve de como debe instalarse y utilizarse en linux de 32 bits. \nParalelamente una opción ordenada e importante es instalar wine y crossover para MAC OS X y hacer estas pruebas tambien. Alguna sugerencia?\n\nSaludos. JR', 0, 1346563543, 1346563641, 'jrbiolinux', 19),
(26, 'jrbiolinux', 20, '190.190.127.184', NULL, 'Donde está esa opción no la encuentro... me parece muy buena idea...', 0, 1346563735, NULL, NULL, 9),
(27, 'admin', 2, '186.50.135.127', NULL, 'No tenemos la funcionalidad desarrollada. Necesitaríamos una librería en PHP que la implemente para poder integrarla al portal o alguien que la programe.\n\nUn abrazo,\nPablo.', 0, 1346599852, NULL, NULL, 9),
(28, 'admin', 2, '190.135.53.222', NULL, 'Hola JR, para mi es nuevo el tema. Leí un poco aquí: [url]http://www.linuxhispano.net/2010/08/04/como-ejecutar-programas-implementados-en-net-en-linux-con-mono[/url]\n\nVoy a intentar hacer alguna prueba de lo que se comenta en el blog.\nParece que la instalación hay que hacerla si o si con Wine, y luego ejecutar con Mono.\n\nUn abrazo,\nPablo.', 0, 1346641628, NULL, NULL, 19),
(29, 'jrbiolinux', 20, '190.190.127.184', NULL, 'Si, así es Pablo, la instalación debe ser en entorno Wine y luego correrlo apoyado por Mono, pero no estoy seguro de la interacción entre mono y wine, por lo que otra posibilidad es instalar previamente .net farmework 2.0 y luego el editor y probarlo. Primero voy a leer el link que mandaste y luego tratar de armar un entorno virtual de 32 bits como comenté antes. Creo que lo ideal seria tener una maquina virtual ubuntu 12.04.1 de 32 bits con Wine 1.4 y Mono instalados... de esa manera los que deseen hacer pruebas lo pueden hacer sobre la misma plataforma, asi podemos comparar resultados. Te parece?', 0, 1346715142, NULL, NULL, 19),
(30, 'pablox', 109, '146.83.129.99', NULL, 'Quizá sea mejor utilizar una herramienta como vagrant[1], cuenta con la ventaja de ser \"estándar\" así que generar instrucciones para un entorno similar podría ser más simple.\n\nEn algún momento me parece haber corrido el Archetype Editor en mi máquina (arch linux 64) y no corría tan bien... aunque lo hice bien al vuelo. Lo agregué a mis \'todo\' para echarle una mirada luego.\n\n[1]: [url]http://vagrantup.com/[/url]', 0, 1346778394, NULL, NULL, 19),
(31, 'admin', 2, '190.135.62.174', NULL, 'Por favor verifiquen si les llegan los boletines, busquen en la carpeta de correo no deseado / spam / junk a ver si sus clientes piensan que es spam.\n\nDe lo contrario nos es imposible saber si tenemos que corregir algo en nuestro portal.\n\nMuchísimas gracias.', 0, 1346794722, NULL, NULL, 13),
(32, 'admin', 2, '186.52.183.226', NULL, 'Estimados, este año estaré en las jornadas del Hospital Italiano de Buenos Aires en una mesa organizada por HL7 Argentina donde veremos un poco de HCE openEHR. Más información: [url]http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=noticias_subcategoria.php&id_categoria=105&id_subcategoria=86[/url]\n\n\nSaludos,\nPablo.', 0, 1351797951, NULL, NULL, 20),
(33, 'admin', 2, '186.52.170.196', NULL, 'Dejo el link a la página donde está la información de la mesa redonda de openEHR con HL7 Argentina: [url]http://www.hospitalitaliano.org.ar/infomed/index.php?contenido=ver_curso.php&id_curso=13164#.UJ2Bu-RQbAP[/url]', 0, 1352499683, NULL, NULL, 20),
(34, 'admin', 2, '186.54.237.237', NULL, 'Estimados, dentro de poco el nuevo sitio de openEHR internacional estará online.\n\nEstamos completando tareas de revisión y mejora de los contenidos y en breve será necesario traducir contenido a español para seguir difundiendo el estándar por nuestras regiones.\n\nBusco armar un pequeño equipo de voluntarios que puedan asistir en las tareas de traducción, si deseas participar por favor envíame un correo a pablo@openehr.org.es\n\nEl nuevo sitio lo pueden encontrar aquí: [url]http://www-test.openehr.org/home[/url]\n\n\nSaludos cordiales y felices fiestas a todos.\n\nPablo Pazos\n[url]http://cabolabs.com[/url]', 0, 1356094421, NULL, NULL, 21),
(35, 'admin', 2, '186.54.236.152', NULL, 'Estimados, estoy organizando alguna información de la comunidad en vistas de una mejor difusión de openEHR y para organizar la participación como comunidad en algunos eventos.\n\nLes dejo algunas preguntas que les agradezco si pueden responder:\n\n * ¿ha hecho o planea hacer algún proyecto o prueba piloto en modelado clínico con arquetipos openEHR? (análisis de dominios, creación de arquetipos, capacitación, etc.)\n * ¿ha desarrollado o planea desarrollar algún software que utilice el modelo de información y/o el modelo dual de openEHR? (productos, pruebas de concepto, prototipos, etc.)\n\nMuchas gracias!', 0, 1358211861, NULL, NULL, 22),
(36, 'admin', 2, '186.54.236.152', NULL, 'Les dejo la presentación: [url]http://www.slideshare.net/pablitox/openehr-para-qu-sirve-hiba2012[/url]', 0, 1358212014, NULL, NULL, 20),
(37, 'admin', 2, '190.134.124.236', NULL, 'La nueva versión de ADL Workbench es multiplataforma: [url]http://wiki.oceaninformatics.com/confluence/display/TTL/ADL+Workbench[/url]', 0, 1368030303, NULL, NULL, 19),
(38, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola a todos,\nQuería comentar que en el apartado de estándares convendría añadir un nuevo tema que relacionara openEHR con ISO-IEEE 11073. \nEsta interoperabilidad permitiría registrar en el EHR las medidas adquiridas por dispositivos de salud personal (personal health).\n\nUn saludo, \n\nAitor.', 0, 1368704696, NULL, NULL, 23),
(39, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola a todos,\nEn el siguiente arquetipo [url=http://openehr.org/ckm/#showArchetype_1013.1.1442_3]Fundoscopic examination of eyes[/url] me he encontrado con el caso en que utilizo un elemento de tipo \"ordinal\" para clasificar la calidad diagnóstica de imágenes clínicas en base a criterios objetivos (acquisition details > visualization > quality).\nLa cuestión es la siguiente (no sé si es posible, pero desde luego sería interesante):\n¿Hay algún modo de incluir una imagen de ejemplo al ordinal para aclarar la clasificación con ejemplos prácticos.?\nEn el [url=http://www.openeyes.org.uk/elements/nscgrade/nscgrade.html]proyecto openeyes [/url]utilizan algo parecido (ver el link examples).\nPuedo definir elementos de tipo multimedia y restringirlos al tipo: imágenes. Pero no es posible adjuntar una imagen de ejemplo, que puede ser mucho mas aclarativa que el campo \"description\". \n\n\nUn saludo, \n\nAitor.', 0, 1368705864, NULL, NULL, 24),
(40, 'admin', 2, '186.54.252.187', NULL, 'Estimado Aitor,\n\nPor nodo simple (ELEMENT) puedes tener un solo DataType, ej. DvOrdinal. Si quieres asociar otro tipo de dato a ese nodo, ej. DvMultimedia (sería para contener una imagen en formato binario) o un DvURI (referencia a una imagen), se deberían usar 2 nodos ELEMENT dentro del mismo CLUSTER, ej:\n\nCLUSTER -- fundoscopic examination quality\n|_ELEMENT\n| |_ DvOrdinal -- quality\n|_ELEMENT\n  |_ DvMultimedia -- sample image\n\nObivamente esta estructura debería estar en una mayor (la OBSERVATION que modela el concepto fundoscopic examination for eyes).\n\nSaludos,\nPablo.', 0, 1368838168, NULL, NULL, 24),
(41, 'aeguzkiza', 14, '194.183.97.86', NULL, 'Hola Pablo,\nLa duda que me inquieta se podría dividir en 2 cuestiones:\nLa primera es la que me has respondido al aclararme que debía crear un nuevo elemento de tipo DV_URI o DV_MULTIMEDIA independiente del parámetro \"quality\".\nLa segunda es que no sé cómo adjuntar una imagen binaria al arquetipo (DV_MULTIMEDIA). O que expresión utilizar para asignar un enlace a una imagen concreta dentro del arquetipo (DV_URI).\nCuando defino estos elementos (DV_URI, DV_MULTIMEDIA) parecen estar pensados para que los usuarios reporten imágenes al EHR. Lo que yo quiero es adjuntar imágenes de ejemplo que acompañen al arquetipo.\n\nUn saludo,\n\nAitor.', 0, 1368963593, NULL, NULL, 24),
(42, 'admin', 2, '190.134.89.1', NULL, 'Hola Aitor,\n\n[quote=aeguzkiza]\nLa primera es la que me has respondido al aclararme que debía crear un nuevo elemento de tipo DV_URI o DV_MULTIMEDIA independiente del parámetro \"quality\".\n[/quote]\n\nNo es tan independiente porque en el ejemplo estarían dentro del mismo objeto CLUSTER. En si no existe forma de poner 2 DataTypes dentro del mismo ELEMENT (mira el modelo de información de Data Structures [1]).\n\n[quote=aeguzkiza]\nLa segunda es que no sé cómo adjuntar una imagen binaria al arquetipo (DV_MULTIMEDIA). O que expresión utilizar para asignar un enlace a una imagen concreta dentro del arquetipo (DV_URI).\nCuando defino estos elementos (DV_URI, DV_MULTIMEDIA) parecen estar pensados para que los usuarios reporten imágenes al EHR. Lo que yo quiero es adjuntar imágenes de ejemplo que acompañen al arquetipo.\n[/quote]\n\nTen cuidado porque los términos no son los correctos, me explico... los arquetipos definen las estructuras de datos, no pueden contener datos. Las imágenes binarias o las referencias se ponen en el modelo de información y es el modelo de información el que cumple con la estructura que define el arquetipo, mira la especificación de DataTypes [1]. Esto es el corazón del modelo dual.\n\nComo ejemplo, en EHRGen [2] si defines un arquetipo con un nodo DvMultimedia, generará un campo para subir un archivo: la imagen.\n\n[1] [url]http://www.openehr.org/programs/specification/releases/1.0.2[/url]\n[2] [url]https://code.google.com/p/open-ehr-gen-framework/[/url]\n\n\nSaludos,\nPablo.', 0, 1368976027, NULL, NULL, 24),
(43, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola,\nUtilizando elementos de tipo \"quantity\" me ha surgido la siguiente duda:\n¿Cuando se asigna una unidad de medida a una magnitud definida en un arquetipo, hay alguna forma de incluir las ecuaciones de conversión entre unidades dentro del arquetipo? \n¿O este es un parámetro que debe gestionarse externamente al mismo? -- Creo que es interesante que el mismo arquetipo además de definir las unidades, defina la relación entre las mismas, ya que es parte de su descripción.\n\nCreí recordar que en algún punto del estándar se definía este tema, pero no he conseguido encontrarlo. Si es así, ¿puede alguien decirme dónde buscar?\n\nUn saludo,\n\nAitor.', 0, 1369215959, NULL, NULL, 25),
(44, 'admin', 2, '190.135.57.25', NULL, 'Hola Aitor,\n\nLas unidades dependen de la magnitud física seleccionada para el nodo del arquetipo (ELEMENT). Dependiendo de qué sea lo que represente el arquetipo, el diseñador de arquetipos puede seleccionar una o varias unidades para la misma magnitud física. Luego en un template se podría restringir aún más seleccionando solo una unidad y esa es la que utilizaría el sistema final.\n\nEl arquetipo no es el lugar para poner relaciones entre unidades, también incluye multiplicadores (ej. kilo) y divisores (ej. mili), ya hay estándares que hacen eso, es más el editor de arquetipos usa ese estándar: UCUM.\n\nSaludos,\nPablo.', 0, 1369370030, NULL, NULL, 25),
(45, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola de nuevo Pablo,\nLa duda me surge con la conversión de unidades comúnmente usadas en oftalmología, pero que sin embargo no encuentro en el editor de arquetipos. Son unidades de medida resultantes de combinar varias del Sistema Internacional. Las conversiones entre estas unidades son mas complejas que las habituales en las que basta con dividir o multiplicar (P.ej: VA=1/(10^LogMAR) y LogMAR = log10(MAR)). \n\nAlgunas conversiones incluso se hacen en base a tablas preestablecidas (veamos la tabla de conversión para agudeza visual):\n[img=Conversión unidades de agudeza visual]http://www.precision-vision.com/images/visual_accuityranges.jpg[/img]\n\nEn este dilema me encuentro, sin saber muy bien cómo definir estas unidades de medida en los arquetipos. \nQuiero que otros sistemas EHR las reconozcan y sean capaces de aplicar conversiones entre unidades.\n\nUn saludo, \n\nAitor.', 0, 1369384683, NULL, NULL, 25),
(46, 'admin', 2, '190.134.115.87', NULL, 'Creo que en cualquier caso, el arquetipo no es el lugar para definir correspondencias entre unidades, eso es algo que un servicio externo de medidas y unidades debe hacer.\nDesde el arquetipo se pueden hacer referencias a estos servicios como si fueran servicios terminológicos pero para unidades. UCUM permite definir unidades que no son de uso frecuentes como combinación de unidades existentes, es como un mecanismo de extensión del mismo UCUM.\n\nSi la restricción sobre la unidad es muy compleja y no puede ser definida dentro del arquetipo, correspondería usar un constraint_binding que referencie a una restricción externa:\n\n  * [url]http://www.openehr.org/wiki/display/healthmod/Archetypes+and+Terminology[/url]\n  * [url]http://www.openehr.org/releases/1.0.1/architecture/am/adl.pdf[/url]\n\n\nEn este caso sería útil la opinión de un médico con experiencia en modelado clínico, puedes consultar a Ian McNicoll o a Heather Leslie en la lista clínica: openehr-clinical@lists.openehr.org', 0, 1369414521, NULL, NULL, 25),
(47, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola a todos,\nEstoy intentando gestionar un grupo de pacientes que participan en un proyecto de investigación clínica.\nY para ello he pensado implementar una base de datos demográfica y quiero hacerlo bien desde el principio.\nAquí es donde echo la pregunta al aire:\n\n - Leyendo las especificaciones del estándar, parece lógico que siga el modelo de información demográfica planteado por openEHR. A poder ser me gustaría que también fuera capaz de comunicarse con otros servidores (por ejemplo PACS), por lo que busco maximizar la interoperabilidad.\n - Sin embargo, estoy algo perdido en el salto de la teoría a la práctica.\n - Podeis recomendarme alguna tecnología, o incluso implementaciones que sirvan para este comentido?\n\nUn saludo, \n\nAitor.', 0, 1374580229, NULL, NULL, 26),
(48, 'admin', 2, '186.54.226.170', NULL, '[quote=aeguzkiza]Hola a todos,\n - Leyendo las especificaciones del estándar, parece lógico que siga el modelo de información demográfica planteado por openEHR. A poder ser me gustaría que también fuera capaz de comunicarse con otros servidores (por ejemplo PACS), por lo que busco maximizar la interoperabilidad.\n - Sin embargo, estoy algo perdido en el salto de la teoría a la práctica.\n - Podeis recomendarme alguna tecnología, o incluso implementaciones que sirvan para este comentido?\n[/quote]\n\nHola Aitor,\n\nopenEHR solo define el modelo demográfico, no indica qué comunicar, ni cómo, ni entre qué sistemas. Para eso se utiliza HL7 Patient Administration. IHE define los perfiles PIX y PDQ que tienen que ver con el tema. Se puede tener un repositorio openEHR con comunicación HL7 sin problemas.\n\nSaludos,\nPablo.', 0, 1374791729, NULL, NULL, 26),
(49, 'aeguzkiza', 14, '194.183.97.99', NULL, 'Hola a todos!\nEstoy inmerso en el estudio de una metodología que anime a los expertos del dominio clínico a arquetipar su conocimiento.\n\nPara entrar en materia intento encontrar estudios estadísticos acerca de los arquetipos, pero no me esta siendo nada fácil:\n- La usabilidad (cuales son los más utilizados).\n- Publicación (ritmo al que se van añadiendo arquetipos al CKM).\n-...\n\nHe estudiado las herramientas estadísticas que ofrece el CKM, pero no me han servido de mucho.\n\nQuerría saber si teneis información acerca de procedimeintos para construir arquetipos de calidad, que pueda contrastar con la metodología que tengo en mente.\n\nSin mas, vendría a ser un brainstorming con el objetivo de observar diferentes puntos de vista en este tema.\n\nGracias.\n\nUn saludo,\n\nAitor.', 0, 1375983732, NULL, NULL, 27),
(50, 'admin', 2, '190.135.34.205', NULL, 'Estimado Aitor, lo que existe en el momento sobre el proceso de modelado con foco en la calidad, está aquí: Towards best practice in the archetype development process - Alberto Moreno.\n\nCreo que resume todas las buenas ideas. No se si hay algo más para aportar sobre el trabajo, tal vez haciendo foco en otros elementos de conocimiento complementarios a los arquetipos.\n\nSaludos,\nPablo.', 0, 1376104039, NULL, NULL, 27),
(51, 'aeguzkiza', 14, '83.173.150.39', NULL, 'Gracias Pablo,\nHabía leído algo de este autor, pero no tenía conocimiento de este trabajo en concreto.\nLe he echado un vistazo por encima y parece muy interesante.\n\nEntre tanto me he encontrado con un par de artículos que me han parecido muy interesantes:\nAunque desde mi visión más tecnológica lo llegue a comprender, a la hora de transmitir el concepto, me suele costar explicar las ventajas y características de openEHR, el modelo dual, etc... a los facultativos. Generalmente me piden implementaciones en marcha o resultados cuantitativos. Creo que estos artículos pueden ser de interés para resumir estos conceptos que si no se ven funcionando parecen tan abstractos.\n\n  - Assessment of Software Maintainbility of openEHR Based Health Information Systems - A case study in endoscopy. Koray Atalag et al.\n  - Dealing with the Archetypes Development Process for a Regional EHR System. M R Santos et al.\n\nUn saludo,\n\nAitor.', 0, 1376297151, NULL, NULL, 27),
(52, 'admin', 2, '186.52.176.217', NULL, 'El próximo jueves haremos una demo del proyecto EHRServer, mostrando cómo enviar datos openEHR y consultarlos mediante servicios web.\n\nEvento en Google+ [url]https://plus.google.com/u/0/events/cnjq4f1q9u5ccd22htmpf822kh4?authkey=COyk84_kh-38Yw[/url]\n\nUtilizaremos este Hangout: [url]https://plus.google.com/hangouts/_/b1be4be49b482bb928ac78bfb133988e52214ed8?authuser=0&hl=en[/url]\n\nSi ese Hangout no funciona, publicaré un nuevo link por estos medios:\n\n- [url]http://www.linkedin.com/groups/openEHR-EHRServer-4347256.S.272348021?qid=a6ce3395-d3f9-4ed9-a2c5-cc265f881e48&trk=group_most_recent_rich-0-b-ttl&goback=%2Egmr_4347256[/url]\n- [url]https://www.facebook.com/openEHR[/url]\n- [url]https://plus.google.com/u/0/events/cnjq4f1q9u5ccd22htmpf822kh4?authkey=COyk84_kh-38Yw[/url]\n\nMás info de EHRServer: [url]https://github.com/ppazos/cabolabs-ehrserver[/url]', 0, 1379460075, NULL, NULL, 28),
(53, 'admin', 2, '190.135.65.213', NULL, 'Hicimos una demostración de un servidor clínico openEHR, mostrando la facilidad de uso y sus posibles aplicaciones, les presento a EHRServer.\n\nEs un proyecto open source que busca posicionarse como repositorio clínico, comenzando con documentos clínicos openEHR, luego iremos por HL7 CDA y CEN/ISO 13606.\n\nComo todo proyecto open source, su avance, desarrollo, robustez y documentación, depende de la comunidad: son los usuarios los únicos que pueden mejorarlo o proponer mejoras.\n\nAquí les dejo la charla: [url]http://www.youtube.com/watch?v=08vAk15utss&feature=youtu.be[/url]\n\nEl evento: [url]https://plus.google.com/u/0/events/cnjq4f1q9u5ccd22htmpf822kh4[/url]\n\nEstoy planeando el mismo evento, pero ahora en inglés para la semana que viene.\n\n\nSaludos,\nPablo.', 0, 1379741885, NULL, NULL, 28),
(54, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola Pablo,\nBasándome en la presentación de la plataforma EHR, y el \"front-end\" EMR estoy intentando cargar arquetipos propios en EMRapp. \nPara ello copio las COMPOSITION en el directorio: \'archetypes/composition\'.\n\nLa aplicación me los reconoce en la pantalla de \"creación de registros clinicos\", sin embargo al intentar acceder a los mismos muestra un error informando que la vista no existe.\n\nLo primero que pensé fue que quizás mi arquetipo podía contener errores y por ello el EMR era incapaz de construir la vista. De modo que copie un arquetipo existente que funcionaba (concretamente COMPOSITION.signos.v1) y le cambié el nombre para hacerlo pasar por otro diferente. El mensaje de error era el mismo y me fijé que para los arquetipos de ejemplo, en las clases: \n\n> \'grails-app/conf/BootStrap.groovy\' se indexan los arquetipos por defecto que trae la aplicación.\n> \'grails-app/controllers/RegistrosController.groovy\' se definían las vistas y los PATH asociados a dichos arquetipos.\n\nDefinir todo esto para mis arquetipos es una tarea pesada y al tratarse de un lenguaje dinámico, no sé hasta que punto es necesario implementar a mano estos apartados.\n\nEn resumen, ¿Cual es el modo correcto de cargar arquetipos propios en el EMR?\n\n\nUn saludo, Aitor.', 0, 1384174084, NULL, NULL, 28),
(55, 'admin', 2, '186.52.150.49', NULL, 'Hola Aitor, EMRApp no genera interfaces de usuario, debes crear tu mismo la interfaz y definir los bindings necesarios entre los campos y las paths de los arquetipos. Puedes basarte en las vistas y bindings que ya están implementadas en la aplicación.\n\nRecuerda que solo se pueden usar arquetipos planos, o sea que no se soportan aún arquetipos con slots, lo mismo en EHRServer. Para lograr un arquetipo plano por ahora hay que hacerlo a mano, pero son 15 minutos de trabajo nomás. Estuve trabajando en una herramienta para lograr arquetipos planos pero no está terminada: [url]https://github.com/ppazos/archetype-flattener[/url]\n\nSaludos,\nPablo.', 0, 1384182093, NULL, NULL, 28),
(56, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola de nuevo Pablo,\nDe hecho, los arquetipos planos los he generado con tu aplicación. \nClaro que no puedo estar seguro de que son correctos debido a que la aplicación \"flattener\" no está terminada (alguna adaptación he tenido que hacer con Notepad++).\nLa he llamado como si fuera una librería y he conseguido que me devolviera un arquetipo agrupado.\n\nAunque para comprobar la validez del arqutipo resultante se me ocurrió probarlo en el EMR, y es ahí cuando me encontré con la cuestión que comentaba.\nSabiendo que tengo que generar las vistas y hacer el binding a mano me quedo más tranquilo, ya que no creí haber pasado por alto algún método para autogenerarlas.\n\nTodavía tengo que pulir mis conocimientos de groovy, pero el flattener tiene buena pinta. \nUna pregunta, como caso de uso, ¿cual es el más actual (o completo) entre los que presentas para testear la aplicación? \n > WalkthroughSlotConstraintDefTest \n > WalkthroughSlotTest\n > WalkthroughTest\n\nHe tomado el primero como referente para ejecutar el \"flattener\".\n\nUn saludo, \nAitor.', 0, 1384184918, NULL, NULL, 28),
(57, 'admin', 2, '186.52.150.49', NULL, 'Para probar lo que devuelve el flattener, intenta abrirlo en el Archetype Editor. No recuerdo el estado final de esa herramienta. Lo más sencillo es crear un arquetipo OBSERVATION y otro COMPOSITION que lo referencie, luego hacer el flat a mano copiando la definition del de OBSERVATION dentro de la COMPOSITION, sustituyendo el SLOT. Ahí debes corregir los nodeID atNNNN, dentro de la definición y en la ontología. También debes copiar la ontología del arquetipo OBSERVATION en la del flat. Eso es más o menos lo que intenta hacer el flattener de forma automática.\n\nLos test son solamente de Walkthrough, una clase genérica que implementé para recorrer arquetipos y poder ser notificado cuando un determinado nodo es encontrado, para procesarlo de alguna forma. Esto es porque en muchas aplicaciones recorro arquetipos de distintas formas y el algoritmo base es siempre el mismo, la idea es reutilizar la recorrida y solo cambiar la lógica que se ejecuta ante un tipo de nodo específico.\nSi te fijas en EHRServer también hay 2 Walkthrough, el más nuevo es el que usa clausuras: [url]https://code.google.com/p/open-ehr-gen-framework/source/browse/#svn%2Ftrunk%2Fehrgen%2Fsrc%2Fgroovy%2Farchetype[/url]\n\nEl binding es fácil, fíjate: [url]https://github.com/ppazos/cabolabs-emrapp/blob/master/grails-app/controllers/RegistrosController.groovy[/url]\nLas vistas son GSP, un HTML + algunas partes dinámicas de Grails: [url]https://github.com/ppazos/cabolabs-emrapp/tree/master/grails-app/views/registros[/url]', 0, 1384193023, NULL, NULL, 28),
(58, 'admin', 2, '186.54.255.75', NULL, 'Más información sobre los talleres: [url]http://informatica-medica.blogspot.com/2013/11/talleres-de-openehr.html[/url]', 0, 1384922936, NULL, NULL, 29),
(59, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola a todos!\nMe he encontrado con la situación en que hay ciertos conceptos clínicos que dependen de otros.\nSin embargo, al intentar arqetiparlos no encuentro un modo de hacerlo que me deje conforme.\n\nPor ejemplo, supongamos que en una EVALUATION tenemos 3 criterios diagnósticos posibles combinables entre sí:\n - Crit 1\n - Crit 2\n - Crit 3\n\nSi seleccionamos el Crit 1, podríamos escoger también el Crit 3, pero no el Crit 2.\nSi seleccionamos el Crit 2, podríamos escoger también el Crit 3, pero no el Crit 1.\nEn resumen, Crit 1 y Crit 2 no pueden combinarse. \n\nIntento arquetiparlos como booleanos, pero los 3 conceptos son independientes entre sí de modo que es el médico quien debe tener cuidado al escogerlos. Esto impide que los datos sean validados debidamente por las herramientas que interpretan automáticamente los arquetipos openEHR.\n\nUn saludo, \nAitor.', 0, 1385632439, NULL, NULL, 30),
(60, 'admin', 2, '186.54.238.211', NULL, 'El arquetipo permite representar la estructura y validación de los datos. Las reglas particulares de dependencia deben ser implementadas en el software.', 0, 1385736894, NULL, NULL, 30),
(61, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola Pablo,\nPuede que a nivel de arquetipos no tenga sentido, \npero creo que a nivel de templates sí que podría encajar un constraint que permitiera este tipo de situaciones.\n\nMás que nada porque si implementamos esta característica a nivel de software, el estándar pierde utilidad en casos muy concretos.\n\nUn saludo, \nAitor.', 0, 1386682759, NULL, NULL, 30),
(62, 'admin', 2, '190.135.8.181', NULL, 'Con la versión actual no es posible, aunque el modelo tiene un lugar para reglas llamado assertions, pero no es usado o implementado.\nEn ADL 1.5 vamos a tener assertions más potentes y esas reglas van a poder ser expresadas. De todos modos, si son especificadas e implementadas en software hoy, mañana pueden ser modeladas con ADL 1.5 cuando esté estable. Yo no esperaría por una solución buena dentro de los arquetipos en el corto plazo.\n\nLa utilidad del estándar para este caso en particular (tiene muchas otras ventajas en otras áreas) es que los elementos para definir las reglas son estándar, es decir las paths. Otra cosa sería si ni siquiera tuviéramos definidos los nodos de datos y reglas sencillas sobre sus valores y estructura (lo que si definen los arquetipos).\n\nPor otro lado, se está definiendo GDL, que puede servir para especificar reglas.\n\nSaludos,\nPablo.', 0, 1386963428, NULL, NULL, 30),
(63, 'abenavidescr', 172, '186.32.171.57', NULL, 'Saludos.\n\nEl tema también me interesa debido a un proyecto que está en desarrollo y deseamos implementar openEHR. Pude investigar muy por encima y la organización IHE ya tiene un perfil diseñado llamado: [url=http://wiki.ihe.net/index.php?title=Radiation_Exposure_Monitoring]Wiki Radiation Exposure Monitoring (REM)[/url] y [url=http://www.ihe.net/Technical_Framework/upload/IHE_RAD_TF_Sup_Radiation_Exposure_Monitoring_Public_Comment_2008_02_29.pdf]Radiation Exposure Monitoring (REM) Integration Profile[/url]\n\nTengo interés en el tema del proyecto así que me gustaría conocer el estatus actual de esta iniciativa\n\nSaludos\n\nIng. Alejandro Benavides', 0, 1387561587, 1387561774, 'abenavidescr', 4),
(64, 'abenavidescr', 172, '186.32.171.57', NULL, 'Saludos a todos\n\nInicie en el área de la informática médica en el 2010. Mi mayor labor en este campo a sido en radiología, radioterapia e imágenes médicas. Además soy miembro fundador de la iniciativa HL7 Costa Rica y pertenezco al grupo de la Red Centroamericana de Informática en Salud.\n\nMi interés es desarrollar servicios y productos utilizando los estándares informáticos internacionales, uno de los es openEHR. En la región se desconoce totalmente el tema y deseo impulsarlo y desarrollarlo adaptándolo a los casos de uso de la región. Deseo adquirir una mejor experiencia en el estándar y poder compartir conocimiento y ayudar a la divulgación del openEHR en la región.\n\nEspero ser de aporte y poder traer mas \'adeptos\' a la comunidad\n\nSaludos', 0, 1387562795, NULL, NULL, 31),
(65, 'abenavidescr', 172, '186.32.171.57', NULL, 'Salud@s\n\nEstoy diseñando arquetipos para un RIS que se estará implementando para un centro de radioterapia. Me gustaría publicar algunos con el fin de saber si estoy modelando bien la información. Es posible en este espacio?\n\nSaludos', 0, 1387567582, NULL, NULL, 32),
(66, 'aeguzkiza', 14, '130.206.160.170', NULL, 'Hola Alejandro,\nEl tema de extraer información radiológica de las imágenes lo puse como ejemplo de un caso de uso, pero mi idea era hacer algo más genérico. \n\nDebido a la gran relevancia para radiología, se crearon los perfiles específicos para intercambiar la información acerca de la exposición. \nPero en especialidades clínicas más humildes sigue existiendo el mismo problema, al no ser capaces de reutilizar la información adjunta a las imágenes.\nLa idea que tengo en mente es utilizar arquetipos para especificar que información se desea explotar en cada momento al hacer consultas al PACS, en lugar de crear perfiles específicos que aislen la información de las imágenes. \n\nPor otra parte, el equipo de radioterapia de nuestro hospital esta muy interesado en proyectos relacionados con los perfiles que comentas.\nTenemos la suerte de que tengan gran curiosidad científica, de modo que en lugar de limitarse al trabajo de rutina siempre están investigando en cómo mejorarlo.\nEn un mes tengo previsto reunirme con ellos, y ya de paso les puedo preguntar hasta que punto, o cómo tienen solucionado ese tema. \nSi me das más detalles acerca de vuestro proyecto podré ser más específico, ya que con este equipo en concreto no nos reunimos muy a menudo.  \n\nDe todas formas, lo dicho, en mi agenda tengo previsto buscar una solución a este tema.  \n\nUn saludo, \nAitor.', 0, 1387788806, NULL, NULL, 4);
INSERT INTO `foro_posts` (`id`, `poster`, `poster_id`, `poster_ip`, `poster_email`, `message`, `hide_smilies`, `posted`, `edited`, `edited_by`, `topic_id`) VALUES
(67, 'admin', 2, '186.54.9.171', NULL, 'Hola Alejandro, el mejor lugar para publicar y revisar es en el CKM de openEHR: [url]http://ckm.openehr.org/ckm/[/url]\n\nPara publicar debes consultar a los editores jefes:\n\nHeather Leslie: heather.leslie@oceaninformatics.com\nIan McNicoll: ian.mcnicoll@openehrfoundation.org\n\nEn algún momento en el futuro deberíamos tener nuestro propio repositorio en español, pero requiere algún desarrollo de software y pago de hosting. Aún no estamos en condiciones financieras de mantener esos servicios. Tal vez con aportes de las empresas si podamos.\n\nUn abrazo,\nPablo.', 0, 1389137145, NULL, NULL, 32),
(68, 'abenavidescr', 172, '201.191.93.30', NULL, 'Deberíamos seguir con el tema y ver como construímos algo mas enfocado para latinoamerica, vos consideras en tu experiencia que esto ayudaría a la comunidad?\n\nSaludos', 0, 1389640735, NULL, NULL, 32),
(69, 'admin', 2, '186.52.36.128', NULL, 'Creo que ayudaría sobre todo porque la revisión la harían clínicos latinoamericanos. Si bien la parte formal y estructural está bueno que sea revisado por editores con más experiencia como Ian y Heather, la parte terminológica depende más de nuestra región.\n\nSobre la herramienta, creo que es secundario cómo se creará y qué tecnologías se utilizarán. Lo central sería evaluar que infraestructura será necesaria, qué servicios necesitaremos y qué personas con qué formación se necesitan. Luego evaluar qué financiamiento será necesario para que esto funcione a largo plazo. Si fuera viable, por ejemplo porque conseguimos apoyo financiero o en otros recursos de distintas empresas, vemos la parte tecnológica para poder crear la herramienta y poder implementar el repo iberoamericano :)\n\nUn abrazo,\nPablo.', 0, 1391832119, NULL, NULL, 32),
(70, 'ipascual', 208, '200.55.139.17', NULL, 'Necesito crear una primera versión de una herramienta que permita la generación de consultas en formato AQL partiendo de Arquetipos. Los arquetipos que se encuentran disponibles en los repositorios en muchos casos encuentro dificultades para cargarlos. Me he encontrado con que muchos diseñan sus propios arquetipos y luego los suben al CKM donde los revisan, me parece que para el trabajo que quiero me tomaría más tiempo del que dispongo. Alguien sería tan amable de recomendarme que hacer en este caso.\n\nOtra cuestión interesante es que dispongo de la snapshot 1.5 de openEHR que está disponible en GitHub, y le hice modificaciones especificas en la Clase  SkeletonGenerator.java para realizar convenientemente la carga de los stots, que pueda contener el arquetipo al ser leído, lo que no conozco la razón real de\npor qué se dejó de implementar esa parte, tengo la impresión de que se podría darle un tratamiento diferente a los slots y por consiguiente una mejor codificación que la yo opte. \n\nAgradecería encarecidamente la opinión de todos ustedes.', 0, 1392318790, NULL, NULL, 33),
(71, 'admin', 2, '186.54.6.48', NULL, 'Hola Ignacio, para hacer el generador debes entender la sintaxis e implementarla. En esa etapa no necesitas arquetipos reales.\nLuego necesitas cargar arquetipos desde archivos ADL para dejar que quien crea las consultas incluya las paths de los arquetipos en la consulta.\n\nLas dudas de diseño de la implementación de referencia hecha en java es mejor que las consultes con los desarrolladores. En mis implementaciones no utilizo el modelo de referencia de la implementación en java, sino que he desarrollado mi propia implementación del modelo de información. La carga de slots es sencilla, pues es leer nombres de archivos y verificar que matcheen con una expresión regular.\n\nPor otro lado, si utilizas operative templates (OPT) no es necesario resolver slots.\n\nSaludos,\nPablo.\n\nPD: héchale un vistazo al generador de consultas de EHRServer: [url]http://www.youtube.com/watch?v=08vAk15utss[/url]', 0, 1392403755, NULL, NULL, 33),
(72, 'ipascual', 208, '190.6.88.85', NULL, 'Hola Pablo Pazos.\n	He seguido de cerca todos sus proyectos, muy buenos por cierto. Ya he concluido mi trabajo de generación de consultas AQL y se han generado mejor de lo que pensaba, solo que tendría que hacer el miso trabajo incorporando las plantillas o bien las “Operational Templates” OPT serian de más ayuda, puesto que el software en este momento es muy lento por la cantidad de ficheros con los que trabaja. Estuve buscando un software que asumí que existía de Ocean Informatics, este convertía el código AQL, a SQL, pero no he tenido nada de suerte.\n	Por lo que pude ver (no conozco el lenguaje) en EHRServer indexas las contribuciones, pero no sé hasta qué punto es bueno hacer esto, con grandes volúmenes de datos, o bien esta decisión está basada en que el servidor es concebido para ser distribuido. Una vez indexado las consultas pueden hacerse mucho más fáciles, me imagino.\n	Cuál sería la manera más factible de hacer consultas al modelo de información de openEHR, o sea, hacer las recuperaciones de la información clínica con la carga semántica que poseen los arquetipos ?. Y que puedo hacer con este código AQL que ya he generado?.', 0, 1402759242, NULL, NULL, 33),
(73, 'admin', 2, '179.25.184.241', NULL, 'Hola Ignacio,\n\nParte del soporte para AQL es la transformación de esas consultas a algún lenguaje de consultas dependiente de la infraestructura como SQL o XQuery. Para esto no existe una herramienta ya que la transformación depende de la infraestructura específica que se tenga detrás del sistema, por ejemplo dentro de SQL, una consulta para MySQL puede ser distinta de una consulta para SQL Server.\n\nEHRServer tiene una ventaja: las queries están definidas en un modelo, desde el cual se generan las consultas SQL específicas. Si tu puedes hacer el mapeo entre AQL y el modelo de consultas de EHRServer, entonces tendrás una conversión a SQL bastante genérica.\n\nSupongo que como parte de tu trabajo sobre AQL has implementado un parser y un modelo que se instancia desde el parser, ¿es así?. Si es así, la transformación que debes definir es entre tu modelo y el modelo de EHRServer.\n\nSi puedes hacer ese trabajo sería un gran aporte para el proyecto, ya que es uno de los temas pendientes para EHRServer.\n\nEHRSerer realiza índices para poder ejecutar las consultas sobre datos estructurados. Tenemos pendiente medir los tiempos de las consultas para grandes volúmenes de datos, más que nada porque estoy ocupado agregando el soporte para OPTs.\n\nPara hacer consultas, necesitas un repositorio, el parser del AQL, el modelo de AQL y el mapeador del modelo al lenguaje de consulta sobre la infraestructura de tu repositorio. Tampoco se qué código has generado ni como, si puedes poner más información te puedo orientar mejor.\n\nSaludos,\nPablo.', 0, 1403033270, NULL, NULL, 33),
(74, 'geromeih', 242, '181.110.41.98', NULL, 'Buenos tardes a toda la comunidad.\n\nMi nombre es Iván Gerometta, vivo en Libertados San Martín, Entre Ríos, Arg. Trabajo como desarrollador de sistemas en el Sanatorio Adventista del Plata. Estamos dando los primeros pasos en HCE, si bien hay mucho informatizado, no lleegar a ser HCE. \n\nEspero con el tiempo poder compartir experiencias con ustedes.\n\nSaludos', 0, 1408472670, NULL, NULL, 34),
(75, 'admin', 2, '179.25.186.173', NULL, 'Bienvenido Ivan! un saludo.', 0, 1409929902, NULL, NULL, 34),
(76, 'geromeih', 242, '181.88.243.187', NULL, 'Buenas tarde a todos. \n\nEn la institución donde trabajo estamos desarrollando el software para la historia clínica electrónica. Estamos en los inicios del desarrollo, específicamente en estructura de la base de datos. Si bien en los requerimientos no está aun usar OpenEHR, si CDA para firmar los documentos, pero me gustaría que contemple en la estructura poder usarlo. \n\nLeí en documentaciones la estructura de los arquetipo pero no encontré nada en concreto como interactua con la base de datos. La consulta es si hay algún material para leer que hable específicamente de eso y si hay ejemplos mejor.\n\nDesde ya muchas gracias.\n\n\nIvan', 0, 1410207989, NULL, NULL, 35),
(77, 'admin', 2, '179.26.168.169', NULL, 'Luego de muchos pedidos estamos pensando en lanzar una edición del curso de #openEHR en español en modalidad \"libre\" que podría ser de interés para muchos de ustedes.\n\nEsta modalidad tiene la característica de ser más flexible en cuanto a los tiempos y las tareas son opcionales (solo las hacen quienes quieran el certificado de aprobación).\n\nMás info:\n\n + Los materiales y programa son los mismos que en el curso tradicional\n + Las clases son grabadas y estarán todas disponibles al inicio del curso\n + Una sola tarea opcional a realizar si desea el certificado de aprobación, aprueba con el 60%\n\nLos insteresados pueden registrarse en nuestra lista de espera y luego nos comunicaremos con uds.: openehr.org.es/curso\n\nEn breve publicaré más información.', 0, 1410475233, NULL, NULL, 36),
(78, 'admin', 2, '190.134.43.77', NULL, 'Hola Ivan, \n\nSobre la documentación de arquetipos que has leído ¿por qué crees que un arquetipo debería interactuar con la base de datos? ¿cuál te parece que es el rol del arquetipo?\n\nSaludos,\nPablo.', 0, 1412601161, NULL, NULL, 35),
(79, 'numael', 250, '190.254.213.234', NULL, 'Hola a todos.\n\nhe estado estudiando a cerca de los arquetipos y en cuanto a Cardinalidad y Ocurrences pensé que tenía claro los conceptos, pero parece que no.\n\nNo se si puedan echarme una mano.\n\n[b]Atributos:[/b] SingleAttribute: un atributo simple, puede ser obligatorio u opcional.\n               MultipleAttribute: una Atributo (List, Set, Bag), puede contener varios elementos (cantidad determinada por la cardinalidad del atributo)\n\n[b]Objetos:[/b] Ocurrences indica cuantas veces se puede repetir (instancias del mismo objeto) en el atributo padre.\n\nPero me encuentro con la siguiente fracción de un Arquetipo \n\n	ACTION[at0000] matches {	-- Imaging investigation\n		[b]ism_transition matches {[/b]\n			[b]ISM_TRANSITION[at0001] matches {[/b]	-- Planned\n				current_state matches {\n 					DV_CODED_TEXT matches {\n 						defining_code matches {[openehr::524]}\n 					}\n 				}\n 				careflow_step matches {\n 					DV_CODED_TEXT matches {\n 						defining_code matches {[local::at0001]}		-- Planned\n 					}\n 				}\n			}\n			[b]ISM_TRANSITION[at0004] matches {[/b]	-- Requested\n 				current_state matches {\n 					DV_CODED_TEXT matches {\n 						defining_code matches {[openehr::524]}\n 					}\n 				}\n				careflow_step matches {\n					DV_CODED_TEXT matches {\n						defining_code matches {[local::at0004]}		-- Requested\n					}\n				}\n			}\n			[b]ISM_TRANSITION[at0002] matches {[/b]	-- Postponed\n				current_state matches {\n					DV_CODED_TEXT matches {\n						defining_code matches {[openehr::527]}\n					}\n				}\n				careflow_step matches {\n					DV_CODED_TEXT matches {\n						defining_code matches {[local::at0002]}		-- Postponed\n					}\n				}\n			}\n                        . . .\n\nen donde el Atributo ism_transition es un SingleAttribute, y tiene almenos 3 alternativas (ISM_TRANSITION), pero cada una de estas alternativas es obligatoria, lo que nos daría 3 valores obligados para un SingleAttribute.\n\nEl arquetipo es el openEHR-EHR-ACTION.imaging.v1 y lo saqué de [url]http://openehr.org/ckm/[/url]\n\nLo mas probable es que tenga un concepto errado sobre la cardinalidad y ocurrencias.\n\nAgradezco la ayuda que me puedan prestar para solventar esa duda.', 1, 1415389901, NULL, NULL, 37),
(80, 'admin', 2, '179.25.185.129', NULL, 'Estimado,\n\nSi ACTION.ism_transition es un C_SINGLE_ATTRIBUTE, entonces los hijos que son C_OBJECT (una de sus subclases) son considerados alternativas (ver método alternatives: List<C_OBJECT> de C_SINGLE_ATTRIBUTE en [url]http://openehr.org/releases/1.0.2/architecture/am/aom.pdf[/url] página 19).\n\nEntonces, si son alternativas, solo es necesario que aparezca uno de esos nodos en las instancias del RM que cumplan con este arquetipo. Como es un atributo de ACTION y esas alternativas modelan cambios de estado, lo que contendrá cada ACTION es cada uno de los estados por los que pasa una INSTRUCTION/ACTIVITY a medida que esas ACTIONs van ejecutándose, como en el caso de ordenar un estudio imagenológico, planificarlo, coordinarlo, ejecutarlo, informarlo, etc.\n\nEspero que te ayude.\n\nSaludos,\nPablo.', 0, 1416283595, NULL, NULL, 37),
(81, 'numael', 250, '190.254.213.234', NULL, 'Hola Pablo, \n\nmuchas gracias por tu respuesta, resolvió mis dudas.', 0, 1416324914, NULL, NULL, 37),
(82, 'admin', 2, '167.57.82.166', NULL, 'Estimad@s, \n\nQuedaron abiertas las inscripciones a la nueva edición de nuestro clásico Curso de openEHR en español.\n\nGracias al apoyo de ACHISA y el Hospital Italiano de Buenos Aires, hemos lanzado una nueva edición del Curso de openEHR en español, ahora en una nueva modalidad.\n\nDesde el 22 de Junio hasta el 16 de Agosto de 2015\n\n[b]Objetivos del curso[/b]\n\n  * Conocer el estándar openEHR y su Arquitectura de sistemas de Historia Clínica Electrónica\n  * Aprender a utilizar las herramientas gratuitas para su aplicación\n  * Aprender a modelar Arquetipos y a implementarlos en sistemas de información\n\n\n[b]Destinatarios[/b]\n\n  * Estudiantes y profesionales informáticos, profesionales y técnicos de la salud (médicos, enfermeras, tecnólogos médicos, tecnólogos bio-informáticos u otros) con interés en los sistemas de información estandarizados en salud.\n  * Personas que participan o están a cargo de proyectos de informatización en salud, sobre todo del área clínica, y tengan interés por crear sistemas de información en salud con un enfoque estandarizado con visión a futuro.\n\n\nToda la información aquí: [url]http://informatica-medica.blogspot.com/2015/05/curso-de-openehr-6ta-edicion.html[/url]\n\nUn abrazo,\nPablo.', 0, 1431830632, NULL, NULL, 38),
(83, 'aeguzkiza', 14, '213.143.48.25', NULL, 'Hola a todos!\nLes voy a pedirles consejo acerca de la mejor estrategia para crear plantillas OPT para openEHR.\n\nLos editores de plantillas existentes a día de hoy no cubren las necesidades para el uso que les quiero dar. Para empezar, el template designer de Ocean informatics lleva años sin actualizarse, y por tanto, no contempla los últimos cambios en el CKM incluso para los arquetipos versionados en ADL v1.4. Por consiguiente, los siguientes casos, entre otros, producen errores:\n- Los arquetipos en versiones alpha, debido a la nueva extensión de archivo v0.\n- El uid incluido en la cabecera no estaba contemplado en versiones iniciales del ADL. \n\nPor otra parte, acabo de probar el ADL designer, que parece muy prometedor en este sentido. Sin embargo, aún esta muy verde, y de momento no implementa, por ejemplo, la funcionalidad para exportar archivos en formato OPT.\n\nMe gustaría saber si existe alguna alternativa, o de tener que generar las templates de forma manual, seguramente me podais dar algún consejo. Por ejemplo, en cuanto a cómo validar el archivo generado contra un xsd, o utilizando la herramienta openEHR-OPT de Pablo.\n\nUn saludo,\n\nAitor.', 0, 1443529931, NULL, NULL, 39),
(84, 'admin', 2, '167.56.134.112', NULL, 'Estimados,\n\nEstamos lanzando dos cursos de verano que comienzan el 7 de Enero de 2016.\n\n+ Curso de Interoperabilidad entre Sistemas de Información en Salud\n+ Curso de Diseño e Implementación de Bases de Datos Clínicas con openEHR\n\nMás info: [url]http://cabolabs.com/es/capacitacion[/url]\n\nUn abrazo,\nPablo.', 0, 1450751465, NULL, NULL, 40),
(85, 'admin', 2, '167.63.53.123', NULL, 'Primer Workshop de Diseño e Implementación de Documentos Clínicos HL7 CDA (Clinical Document Architecture)\n\nInfo: [url]http://informatica-medica.blogspot.com.uy/2016/11/workshop-documentos-clinicos-cda.html[/url]\n\nINSCRIPCIONES ABIERTAS (hasta el 5 de Diciembre)\n[url]https://goo.gl/forms/Id62OpbG4jtgyeY52[/url]\n\nResumen de temas:\n\n +   Introducción a los modelos RIM y CDA\n +   Proceso de diseño de documentos clínicos\n +   Trabajando con CDA en software: generación, validación, procesamiento y visualización\n +   Trabajando con Guías de Implementación\n +   Trabajando con Terminologías', 0, 1480315023, NULL, NULL, 41);
